INSERT INTO `evento` VALUES (193,2,'Desde el SillÃ³n','El unipersonal musical éxito de Buenos Aires llega a Colombia “¿Qué pasaría si mañana fuese el último día de mi vida?”\r\n\r\nEste interrogante existencial es el que toma a Ana, la protagonista, por completo y le dispara un sin fin de pensamientos, sentimientos y contradicciones. Ella es una chica más de esta sociedad moderna, quien tras la sorpresiva muerte de su vecina, la atraviesa la realidad de que mañana podría ser el último día de su existencia y se empieza a preguntar, tal vez por primera vez, que está haciendo con su vida.','eventimg/8152724302.jpeg','Teatro Libre - Chapinero',0,'BogotÃ¡','','','CAMARA DE COMERCIO COLOMBO-ARGENTINA ','Una obra que llega al corazÃ³n del espectador ya que toca la Ãºnica verdad inexorable que todos compartimos en este mundo: Todos nos vamos a morir. Y que es lo que vamos a hacer mientras esta vida este ganando, momentÃ¡neamente, la partida.',2,389,57,0,'PUB',2,'2014-05-02 11:36:16','','https://www.youtube.com/watch?v=DMvcBuv5Vmc',0,0,'2014-4-28 05:50:01'),(386,2,'Feria Internacional MBA','El QS World MBA Tour es la feria de programas MBA más importante del mundo y trae muchas de las escuelas de negocio más influyentes del mundo, además brinda asesoramiento de expertos en la elección del programa MBA que mejor se adapta a tu perfil, procesos de admisión y elaboración de tu CV.\r\n<br><br>Más de 60 escuelas de negocio de Norteamérica, Europa, Asia y Latinoamérica estarán presentes con sus directores de admisión dispuestos a responder tus preguntas y despejar tus dudas con recomendaciones claves para que tu admisión transcurra exitosamente.','../eventimg/1520828716Feria Internacional MBA.jpg','Hotel NH Royal Metrotel, Cll 74 #13-27',2,'BogotÃ¡','https://www.facebook.com/Colfuturo','Colfuturo','QS World Grad School Tour','    ',7,319,57,1,'PUB',2,'2015-09-02 18:04:42','','https://www.youtube.com/watch?v=nOORhKaEoec',0,0,'2015-9-1 21:55:56'),(192,2,'47 Festival de la Leyenda Vallenata. ','La leyenda Vallenata','eventimg/829107051Afiche-47-Festival-de-la-Leyenda-Vallenata-en-Homenaje-a-Diomedes-DÃ­az.jpg','Parque de la Leyenda Vallenata â€œConsuelo',0,'Valledupar','','','FUNDACIÃ“N FESTIVAL DE LA LEYENDA VALLENATA','Homenaje a Diomedes Diaz',4,286,57,0,'DEL',2,'2015-05-28 17:03:06','','https://www.youtube.com/watch?v=VAAgTuoea6M',0,0,'2014-4-21 10:52:23'),(188,2,'Pet Run 5k','Pet Run, una carrera diferente enfocada a llevar un mensaje ambientalista con ingredientes recreativos y competitivos, busca generar un espacio de unión entre seres vivos de diferentes especies, con entretenimiento para toda la familia.\r\n\r\nEn cuanto a responsabilidad social, nuestro objetivo, concientizar todos los asistentes a nuestro evento sobre la tenencia responsable, para ello contaremos con el apoyo de diferentes fundaciones para lograrlo.\r\n\r\nA largo plazo, quisiéramos construir un refugio para animales abandonados, en esta primera edición, gran parte de los recursos, serán donados a fundaciones, todo con el ánimo de seguir en la lucha de la protección de la flora y fauna, así mismo entregaremos el 1er. parque canino para Bogotá.','eventimg/1407469421Dog.jpg','Parque SimÃ³n BolÃ­var',0,'BogotÃ¡','','','RIE ENTRETENIMIENTO LTDA ','Para participar en la carrera habrÃ¡ 3 circuitos:\r\n\r\n5K: Para profesionales, entrenadores o amateurs, constituidas: un participante (mayor 18 aÃ±os o menor entre 14 y 18 aÃ±os con autorizaciÃ³n firmada por sus padres) y su perro (1 aÃ±o), que tengan la capacidad fÃ­sica de correr el trayecto.\r\n\r\n3K: Creada para parejas constituidas: un participante (mayor de 18 aÃ±os o menor con autorizaciÃ³n) y su perro (mÃ­nimo con 6 meses), que deseen completar el recorrido caminando. Esta categorÃ­a a diferencia de la 5K, principalmente recreativa y no competitiva.\r\n\r\n1K KIDS: Esta categorÃ­a estÃ¡ abierta para equipos constituidos: dos personas y su perro, adulto de 18 aÃ±os o un menor entre 14 a 18 (autorizaciÃ³n firmada); un niÃ±o de 4 a 14 aÃ±os de edad (autorizaciÃ³n firmada) y su perro (mÃ­nimo con 6 meses), que deseen caminar o correr en familia. Esta categorÃ­a a diferencia de la 5K, es principalmente recreativa y no competitiva.',3,403,57,0,'PUB',2,'2014-05-02 11:29:02','','',0,0,'2014-4-15 06:53:30'),(189,1,'Nicky Jam. Silver Night','NEW YORK SHOP celebra su VII ANIVERSARIO y te invita a vivir la SILVER NIGHT. una noche mágica en donde Bogotá podrá disfrutar de un espectacular concierto con una de las leyendas mas importantes del Reggaetón de todos los tiempos, nacido en Boston - Estados Unidos y radicado en la Isla del Encanto - Puerto Rico; NICKY JAM, con una trayectoria que comprende mas de 4 álbumes como solista y varios acompañamientos junto a otras estrellas del genero, es considerado uno de los artistas más interesantes y con mayor prestigio dentro del panorama musical latino que existe en la actualidad musical.','eventimg/1892932076nICKY.jpg','Simona Cub',0,'BogotÃ¡','Nickyjampr','','JEFFERSON STEVEN MORALES','AcompaÃ±ando esta noche mÃ¡gica, podrÃ¡s disfrutar de las mezclas en vivo del DJ MARIO ANDRETTI, uno de los mas importantes artistas de la escena dee jay en Colombia y Latino AmÃ©rica.\r\n\r\nUn mega evento que no te puedes perder.',1,183,57,0,'DEL',2,'2015-05-28 16:21:04','','https://www.youtube.com/watch?v=7T_09ueky2o',0,0,'2014-4-15 10:32:49'),(198,1,'Flisol BogotÃ¡ 2015','Es el Festival Latinoamericano de Instalación de Software Libre y actualmente es el evento de difusión de Software Libre más grande en Latinoamérica. Su principal objetivo es promover el uso del software libre, dando a conocer al público en general su filosofía, alcances, avances y desarrollo. Para tal fin, las diversas comunidades locales organizan simultáneamente eventos en los que se instala software libre y además se ofrecen charlas, ponencias y talleres en torno a la filosofía del Software Libre en toda su gama de expresiones: artística, académica, empresarial y social.','eventimg/12494295