 de Ecuador. Actualmente, las oficinas de AUALCPI se encuentran en la ciudad de BogotÃ¡, RepÃºblica de Colombia.',6,111,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=1VhPxG70-Ho',0,0,'2015-9-1 20:19:11'),(174,1,'III Festival Internacional de Cine y Tv Infantil','Cinecita es un Festival de Cine y Televisión Infantil y Juvenil que busca traer las mejores películas de todo el mundo y ponerlas al alcance de nuestros niños y jóvenes. Somos el Festival de infancia y adolescencia más grande del país. En esta versión contaremos con más de 100 películas de 22 países participantes como Rusia, Irlanda, Francia, Italia, Luxemburgo, Irak, Irán, Emiratos Árabes, Brasil, Argentina, Estados Unidos, Holanda, Polonia, Alemania, Marruecos, India, España, México y Colombia entre otros.','eventimg/1370805857Cinecita.jpg','Colegio Nuevo Gimnasio, Cll 81 # 11-71',0,'BogotÃ¡','','','','Una vez adquiera su boleta debe ingresar a nuestra pÃ¡gina web www.cinecitacolombia.co y realizar el proceso de inscripciÃ³n, seleccionando las actividades que desee realizar. Las inscripciones pueden ser individuales o grupales para instituciones educativas o empresas.\r\n\r\nNo se pierda el evento audiovisual mÃ¡s importante del aÃ±o para toda la familia! InscrÃ­base ya!',4,353,57,0,'PUB',2,'2014-05-02 02:32:19','','http://www.youtube.com/watch?v=F6wKcMZdxhw',0,0,'2014-4-4 10:40:22'),(175,1,'Infieles','En medio de situaciones hilarantes, canciones y bailes los cuatro personajes de esta comedia Gabriela (Yolanda Rayo), Patro (Liliana Gonzales), Juana (Linda Lucia Callejas) y Rafaela (Ana Jaraba) hablaran de si ellas como mujeres son capaces de ser infieles y si están dispuestas a perdonar una infidelidad para al final llegar a la reflexión más importante de este montaje, hay que ser fiel a sus principios y su persona.','eventimg/1946705062Infieles.jpg','Teatro Santa Fe',0,'BogotÃ¡','','','','',2,319,57,0,'PUB',2,'2014-05-02 02:43:48','','',0,0,'2014-4-4 11:12:19'),(176,1,'La GuzmÃ¡n en Primera Fila'