cten positivamente a la comunidad.\r\nHACER LA PAZ ES es un nuevo espacio de experimentación donde las ideas atrevidas y el conocimiento tecnológico de los jóvenes se unen con las organizaciones que tienen la voluntad y el poder de ayudar a que los proyectos se hagan realidad.\r\nLa fórmula de trabajo es simple: \r\nJóvenes + Tecnología / Innovación + Experimentación.\r\nHACER LA PAZ ES, es el lugar donde las mentes jóvenes pueden encontrar el CONOCIMIENTO Y APOYO para convertir sus IDEAS en ACCIONES PODEROSAS de CONVIVENCIA PACÍFICA en cada esquina de Colombia.','eventimg/39854904hacerlapaz.png','Camara Comercio de BogotÃ¡ Av el Dorado No 68D - 35',2,'Bogota','','','IxE = D + P','',6,362,57,0,'PUB',2,NULL,'','',0,0,'2015-4-11 06:38:42'),(207,1,'TALLER INTENSIVO DE SERIGRAFÃA CON SHUZ SHUZ','La serigrafía es un método de impresión donde se busca la reproducción de imágenes sobre cualquier material. Consiste en transferir una tinta a través de una malla tensada en un marco de madera o metálico. Este sistema permite reproducir cientos, y hasta miles de ejemplares sin perder su definición, es una técnica que se puede realizar manual o industrialmente.','eventimg/906907640intensivo-serigrafia_WEB.jpg','CasaTinta Tv 26b no. 41-40',2,'Bogota','','','CASATINTA','',6,382,57,0,'PUB',2,NULL,'','',0,0,'2015-4-11 06:45:01'),(208,1,'CONGRESO INTERNACIONAL DE ILUSTRACIÃ“N','Son cinco años de construir un espacio para la ilustración, donde más de cuarenta artistas de catorce países nos han visitado, y miles de asistentes han tenido la oportunidad de verlos de cerca y disfrutar de todas las actividades. Este año celebraremos por quinta vez la fiesta alrededor de la ilustración. Preparen portafolios y lápices, que habrá mesas de revisión, exposición y concurso, entre muchas otras actividades. Y para que se vayan programando el epicentro será en Corferias en la 28 Feria Internacional del Libro de Bogotá.','eventimg/796309806congresoilust.jpg','CasaTinta Tv 26b no. 41-40',2