pg','Teatro Libre, Calle 62 # 9A-65 ',2,'BogotÃ¡','fteatrolibre?fref=ts','@teatrolibrebog','FundaciÃ³n Teatro Libre ','No se pierda las otras dos presentaciones del Festival: Evidence Dance Company el martes 9 de junio, y Magdeburg Ballet, el miÃ©rcoles 17 de junio. Abonos del 30% y 20% disponibles en puntos de venta y taquilla del Teatro Libre de Chapinero.',2,307,57,0,'PUB',2,NULL,'','https://www.youtube.com/watch?v=ZaECztXt4dU',0,0,'2015-5-25 12:28:29'),(242,16,'Evidence Dance Company - Estados Unidos','La misión de Evidence es promover la experiencia de la migración forzada africana a través de la danza y la narración de historias. Con esto, busca proporcionar conexiones sensoriales con la historia y la tradición a través de la música, el movimiento y la palabra hablada, asumiendo como una responsabilidad el legado de esta comunidad espiritual y su liberación. \r\n\r\nFundada por Ronald K. Brown en 1985 en Brooklyn, Nueva York, Evidence Dance Company se centra en la integración de la danza tradicional africana con coreografía contemporánea. A través de su trabajo, Evidence ofrece una vista única de las luchas humanas, tragedias y triunfos. Brown utiliza el movimiento como una manera de reforzar la importancia de esta comunidad en la cultura afroamericana y para familiarizar al público con la belleza de las formas tradicionales y ritmos africanos. ','eventimg/1904416786Evidence Dance Company.jpg','Teatro Libre, Calle 62 # 9A-65 ',2,'BogotÃ¡','evidencedance?fref=nf','@teatrolibrebog','FundaciÃ³n Teatro Libre ','Brown es un defensor del crecimiento de la comunidad de la danza afroamericana y es pieza importante en la formaciÃ³n de los jÃ³venes bailarines, la creaciÃ³n de coreografÃ­as y el desarrollo de sus carreras en la danza. \r\n\r\nNo se pierda las otras dos presentaciones del Festival: Samadhi Dance Company el jueves 11 de junio, y Magdeburg Ballet, el miÃ©rcoles 17 de junio. Abonos del 30% y 20% disponibles en puntos de venta y taquilla del Teatro Libre de Chapinero.',2,322,57,0,'PUB',2,NULL,'','https://www.youtube.com/watch?v=XD8HpRLRFy4',0,0,'2015-5-25 14:12:22'),(379,16,'LAB1: ProducciÃ³n en tiempo real para presentaciones audiovisuales','vvvv es un entorno de programación gráfica para desarrollo y prototipado rápido.\r\nEstá diseñado para facilitar el manejo de ambientes multimedia a gran escala con interfaces físicas , diseño gráfico a tiempo real , audio y video con el que se puede interactuar simultáneamente con multitud de usuarios.\r\n<br><br>El taller se enfocará en los conceptos básicos del funcionamiento del programa para poder aplicar rápidamente a la creación de contenido audiovisual para presentaciones en vivo. Aprovechando la flexibilidad de la generación en tiempo real, y su capacidad de interconexión con otros entornos. Durante el taller se definen objetivos concretos a desarrollar, para que al final todo participante cuente con una herramienta básica para utilizar en presentaciones en vivo.\r\n<br><br>El taller está orientado tanto para gente que trabaja con imagen así como sonido y música, La idea es realizar ejercicios en grupos o parejas,aprovechando las herramientas de cada participante.\r\n<br><br>El taller lo facilitara <b>Manuel Palenque nacido en Buenos Aires, Argentina</b>. Aquí esta una pequeña biografía de él.\r\n<br><br>Se encuentra abocado al estudio y composición en las Artes electrónicas y el diseño interactivo en nuevos medios.\r\n \r\nDesarrolla contenidos visuales en tiempo real desde entornos de programación grafico (vvvv), tanto para composiciones cerradas de animación y arte digital, así como performáticas desde la programación en vivo.','../eventimg/228114395CasaLab1.jpg','LAB1, Cra 25 # 41 - 94 ',2,'BogotÃ¡','https://www.facebook.com/pages/LAB1/764061053692956','','Casa LAB1','    ',6,196,57,1,'PUB',2,'2015-08-28 13:12:59','','',0,0,'2015-8-28 13:05:28'),(243,16,'Un Bosque Encantado','Los conciertos de Un Bosque Encantado buscan educar afectivamente a través de la música, sembr