the world of telephony, voice over IP and unified communications.\r\nThis is the ideal place for end users, partners, resellers, integrators, manufacturers and developers to have the opportunity to share experiences, showcase new products, and open new business opportunities between the Latin American community and the world.\r\nAbout the Venue\r\nThe VoIP and Elastix community has grown exponentially in the last six years, covering all regions of the globe, with a potential of 100,000 integrators. One of the event goals is to allow manufacturers to meet the community of each region.\r\nThe venue of the fifth edition is Bogota Colombia, a potential market of 8 million people having the ideal conditions for business opportunities.','eventimg/237368656ElastixWorld 2015.png','Calle 53, Nqs # 52-1 a 52-13 ',2,'BogotÃ¡','elastix','ElastixWorld','Elastix','What will we found at ElastixWorld?\r\nThis edition will have a lot of activities, beginning with the classic conference space where we will see the best of the best in VoIP and Open Source communications.\r\nWorkshops, Challenges and more\r\nManufacturers and developers will show their product functionality on several hands-on labs that will take place on a \"Workshop Area\".\r\nSoftware developers and entrepreneurs will have their 15 minutes of fame at the 3rd edition of the \"Addons Challenge\", a space designed to promote and show the best addons available on the Elastix Market Place.\r\nAbove all this alternatives and spaces, attendees will have the chance to have a good time, do some networking, establish business potentials and to meet the minds behind the VoIP Solutions that communicate the world these days.',6,470,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=IdIG7DjqxjY',0,0,'2015-5-30 12:41:57'),(272,2,'Certificado en BioconstrucciÃ³n','El certificado en Bio Construcción ofrece un abordaje y entendimiento integral por medio de la práctica y experimentación de varias técnicas de Bio-Construcción, la historia y tradición de nuestra arquitectura local. Replanteándonos las distintas maneras de interactuar e intervenir nuestro hábitat.','eventimg/816134742Certificado BioconstrucciÃ³n.jpg','Impact Hub Bogota, Cll 69 # 6 - 20 ',2,'BogotÃ¡','ImpactHubBogota?fref=ts','ImpactHubBogota','Impact Hub BogotÃ¡','CÃ“MO FUNCIONA \r\n\r\nFUNDACIÃ“N ORGANIZMO ESTARÃ LLEVANDO A CABO LAS CLASES TEÃ“RICAS DEL CERTIFICADO DE BIO CONSTRUCCION EN EL IMPACT HUB BOGOTÃ.\r\n\r\nLa INFORMACION LA ENCUENTRAN  EN EL SIGUIENTE  LINK: http://www.organizmo.org/talleres-bioconstruccion\r\n \r\nDEBES SABER: PARA SEPARAR TU CUPO U OBTENER MÃS INFORMACIÃ“N: anamaria@organizmo.org\r\no llamando al 320 493 5732 \r\n \r\nPara reservar su cupo, consignar el valor del taller y y enviar una copia de la consignacion anamaria@organizmo.org ',6,372,57,1,'PUB',2,'2015-05-30 19:35:45','','https://www.youtube.com/watch?v=yfwyiLNQeJc',0,0,'2015-5-30 19:33:45'),(273,2,'First Thursday NXTP Labs','<b><u>¡First Thursday NXTP Labs Colombia!&nbsp;</u></b>Conecta, inspira y comparte experiencias entre emprendedores, inversionista, mentores, socios y aliados de NXTP Labs!<br><br>Te invitamos a nuestro <b>First Thursday BOGOTÁ</b>,&nbsp;para que conversemos, intercambiemos experiencias y revisemos como entre todos podemos apoyarnos y seguir construyendo la red NXTP Labs!&nbsp;Como todos los meses, la comunidad de NXTP Labs de varias ciudades de LatAm se reune el primer jueves de cada mes en su evento \"First Thursday\" con el fin de mantenernos conectados, generar más negocios dentro de la red y conocer nuevas personas.&nbsp;<br><br>Como host del&nbsp;First Thursday BOGOTÁ&nbsp;<span>de octubre tendremos a&nbsp;<a href=\"https://www.linkedin.com/pub/carlos-felipe-gutierrez-camacho/55/203/b02\" target=\"\" rel=\"nofollow\">Carlos Gutiérrez,</a>&nbsp;Country Manager en Colombia de&nbsp;<a href=\"https://www.formafina.com.co/\" target=\"\" rel=\"nofollow\">FormaFina</a>&nbsp;e inversionista a través&nbsp;de lNVX, quien n