a verdad del Bullying.png','Biblioteca PÃºblica Virgilio Barco',2,'BogotÃ¡','IE-Innovacion-En-Educacion','ie_bog','Projectora','En el Volumen 1, presentamos La verdad del Bullying o Matoneo, junto a tres conferencistas del sector educativo y de otros sectores que buscan dar herramientas a los educadores en esta problemÃ¡tica. \r\n\r\nEl evento tambiÃ©n habrÃ¡ intervenciones complementarias en Nuevos Modelos de EducaciÃ³n y Marketing para Colegios.',6,415,57,1,'PUB',2,'2015-05-30 21:52:23','','https://www.youtube.com/watch?v=FOxZHi31eu8',0,0,'2015-5-30 21:49:58'),(476,16,'Luz, ciencia y magia - FotografÃ­a publicitaria e iluminaciÃ³n en estudio','Te esperamos para esta primera clase introductoria de lo que será el <b><i>Workshop: Luz, ciencia y magia: fotografía publicitaria e iluminación en estudio organizado por SieteFotógrafos</i></b> y dictado por el maestro <b>Juan José Carrillo.\r\n</b><br><br>Si Fotografiar es <i>\"escribir con luz\",</i>  el trabajo en estudio es la base que te permitirá medir, entender, controlar y observar de forma disciplinada la luz y sus cualidades. <br><br>Mediante la ejecución práctica de diversos ejercicios, en este Workshop aprenderás los elementos teóricos necesarios que te permitirán tomar decisiones fotográficas conscientes a la hora de iluminar sobre diversas superficies, objetos y texturas.\r\n<br><br>Al finalizar este workshop, estarás en capacidad de diseñar tus propias propuestas de iluminación y además tendrás un portafolio profesional que te ayudará a abrir puertas en este campo de la fotografía comercial.\r\nMás información sobre el taller completo en: <a href=\"http://sietefotografos.com/fotografia-publicitaria-e-iluminacion-en-estudio/\" target=\"\" rel=\"\">http://sietefotografos.com/fotografia-publicitaria-e-iluminacion-en-estudio/</a>','../eventimg/746102031Luz, ciencia y magia - FotografÃ­a publicitaria e iluminaciÃ³n en estudio.jpg','Casatinta, Tranv 17 # 45D - 61 ',2,'BogotÃ¡','https://www.facebook.com/7FOTOGRAFOS','7fotografos','SieteFotÃ³grafos | escuela - club','    ',6,1117,57,1,'PUB',2,'2015-10-13 14:28:45','','https://www.youtube.com/watch?v=bDFRdTHPIqc',0,0,'2015-10-13 14:25:58'),(370,16,'Taller de comunicaciÃ³n estratÃ©gica para empresas sociales - Comunicar el HÃ­brido','<b><span class=\"wysiwyg-color-blue\"><u>QUÉ ES \"COMUNICAR EL HÍBRIDO\"\r\n</u></span></b><br><br>El taller busca transmitir el poder de la comunicación en las empresas sociales. Pretende trabajar sobre las particularidades de la comunicación en este tipo de empresas, los beneficios de su planificación, y propone una metodología para llevarla adelante de una manera estratégica.\r\n<br><br>La idea central es que los emprendimientos sociales desarrollen, o al menos comiencen a desarrollar, la planificación de la comunicación en su empresa social. <br><br><b><u>CÓMO FUNCIONA</u></b> <br><br>Taller de 6 horas, en dónde se  realizan dos partes: <br><b>a)</b> La primer parte teórica<br><b>b) </b>Un bloque práctico, dónde se desarrollan los ejercicios de la caja de herramientas.<br><br><b>PARTE A&nbsp;<br></b><b>1)&nbsp;</b>Introducción sobre la investigación realizada en Latinoamérica y sus resultados. <br><b>2)</b> El poder de la comunicación en las empresas sociales. ¿Porqué comunicar? ¿Qué comunicar? ¿Para qué comunicar?. <br><b>3)</b> Cómo pensar la comunicación en empresas sociales. Particularidades del híbrido y aspectos a tener en cuenta.\r\n<br><b>4)</b> Creación de narrativa de marca. <br><b>5)</b> Análisis de casos exitosos. Comunicación híbrida interesante. <br><b>6)</b> Desarrollo de la metodología y su caja de herramientas.\r\n<br><br><b>PARTE B</b>\r\n<br><b>7)</b> Realización de los ejercicios de la caja de herramientas: <br><blockquote><b>a)</b> Diagnóstico<br><b>b)</b> Matriz de identidad<br><b>c)</b> Definición y caracterización de públicos objetivo<br><b>d)</b> Planificación estratégica*\r\n\r\n(La cantidad de ejercicios que se realicen tendrán que ver con el tiempo que disponga el taller) </blockquote>','../eventimg/2004943582Taller de comunicaciÃ³n estratÃ©gica para empresas sociales - Comunicar el HÃ­brido.png','Impact Hub Bogota, Calle 69 # 6 - 20 ',2,'BogotÃ¡','https://www.facebook.com/ImpactHubBogota?fref=ts','ImpactHubBogota','Impact Hub BogotÃ¡','DEBES SABER: El asistente puede pagar en efectivo y tarjeta dÃ©bito o crÃ©dito en el Impact Hub o haciendo consignaciÃ³n bancaria en Bancolombia, cuenta de ahorros NÂ° 01389351250. Envia comprobante de pago al correo: bogota.administrativo@impacthub.net o rodrigo@animoanimo.com \r\n\r\nÂ¿QUIÃ‰N NOS ACOMPAÃ‘A? Julieta Bossi y Rodrigo Romero',6,255,57,1,'PUB',2,'2015-08-24 13:35:44','','https://www.youtube.com/watch?v=0pEYIkzKZac',0,0,'2015-8-24 12:58:18'),(275,1,'FORO LÃDERES Y EMPRENDEDORES EN LA U- FLEU','Es un foro','eventimg/1052076037foro_lideres.jpg','Corferias',2,'Bogota','','','','',6,296,57,1,'PUB',1,NULL,'','',0,0,'2015-5-31 13:04:35'),(276,405,'Ciclopaseos Gachancipa - Cundinamarca','Distancia desde Bogotá: 31 km - Temperatura: 13 Grados. Punto de Encuentro: El Palacio del Cerdo 400 mts adelante de la estación del ferrocarril sobre la autopista costado derecho.\r\n\r\nRuta Expertos 30 km: El recorrido que tendremos es apto para personas que tengan mucho dominio de su bicicleta y les agrade el paso por trocha y por caminos donde hay que hacer camino con el paso de la bicicleta, hay descensos técnicos, ascensos prolongados. Hermosísimos paisajes. Ruta Familiar 20 km: Esta ruta es menos complicada pero, también tiene cierto grado de dificultad.\r\n\r\nRuta para caminantes: Iniciaremos en el municipio rumbo a la colonial capilla de Santa Bárbara, para proseguir hacia el cerro con el mismo nombre. Pasaremos por fincas campesinas de la región y al llegar a lo alto de la montaña a 2800 mts disfrutaremos de la bella vista del valle del embalse de Guatavita y los encantadores bosques de acacias. En este punto disfrutaremos de nuestro refrigerio para continuar por nuestro camino que completará un circuito que llegará nuevamente al municipio de Gachancipá.','eventimg/879828451ciclopaseos.png','Gachancipa - Sitio de Encuentro (El palacio del cerdo)',2,'BogotÃ¡','ciclopaseos.adrianatinajero','@ciclopaseos','Adriana Tinajero ArÃ©valo - 3112768466','Incluye Ciclopaseo: Parqueadero, ejercicios de estiramiento muscular, bocadillo, agua, primeros auxilios, atenciÃ³n tÃ©cnico mecÃ¡nica, motos acompaÃ±antes, acompaÃ±amiento policÃ­a local, motos acompaÃ±antes, guÃ­as en bicicleta, seÃ±alizaciÃ³n , rifas de nuestros patrocinadores. camioneta de apoyo, para aquellos que asÃ­ lo requieran. \r\n\r\nSeÃ±alizaciÃ³n: Flechas con cal en el piso, papel biodegradable de color naranja para la ruta experto y blanco para la ruta de menor grado de dificultad.',3,651,57,1,'PUB',2,'2015-06-03 08:54:03','','https://www.youtube.com/watch?v=sI6uOqgak38',0,0,'2015-6-3 08:44:58'),(277,2,'Mummenschanz','En el universo sin palabras de Mummenschanz, lo ordinario se convierte extraordinario cuando materiales comunes, objetos cotidianos y formas abstractas llenas de color y forma como los famosos Máscaras de barro, Hombre Furtivo y Manos Gigantes adquieren vida. Mediante la creación de una experiencia lúdica y atractiva a través del uso inventivo de la sombra, la luz, y la manipulación creativa de objetos, Mummenschanz ofrece una visión atemporal de la condición humana. El resultado trasciende las barreras culturales y estimula la imaginación. Todo el programa de títeres y travesuras visuales se realiza sin música ni sonido. ','eventimg/2039254170Mummenschanz.jpg','Teatro ColÃ³n',2,'BogotÃ¡','','mummenschanz','AsociaciÃ³n Nacional de MÃºsica SinfÃ³nica ','El espectÃ¡culo contarÃ¡ con clÃ¡sicos favoritos del pÃºblico, asÃ­ como nuevas creaciones brillantes vistas por primera vez.',2,289,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=LUDt71uqBUU',0,0,'2015-6-30 23:00:26'),(278,2,'Accione Verde Ãrbol por Ãrbol Salvando El Planeta','¿Ya conoces a Acción Verde?\r\n\r\nSomos una organización que busca generar impactos positivos en el medio ambiente terrestre y marino, mediante acciones concretas como son la reforestación protectora con especies nativas, creando zonas de amortiguación para Reservas de la Biósfera en Colombia. \r\n\r\nHemos logrado sembrar más de 150.000 árboles, gracias a las compras ciudadanas y empresariales de Acciones Verdes, dándole así más vida a nuestro planeta para ésta y futuras generaciones.\r\n\r\nTe invitamos a que formes parte de nuestra iniciativa adquiriendo y/o regalando Acciones Verdes: porque es innovador, porque cada árbol sembrado tiene una función especial, porque ayudas al planeta y a ti mismo.','eventimg/941360505planeta verde.png','Colombia',2,'BogotÃ¡','AccionVerdeColombia?fref=nf','AccionVerdeCol','AcciÃ³n Verde','Â¿CÃ³mo sabes dÃ³nde estÃ¡ tu Ã¡rbol?\r\n\r\nPuedes saber dÃ³nde estÃ¡ plantado, la especie, el nÃºmero de tu AcciÃ³n Verde, georeferenciado y fotografiado individualmente, toda esta informaciÃ³n reportada en nuestra pÃ¡gina web www.accionverde.org.co, para garantizar que los cuidaremos a tu nombre y que puedes hacerle seguimiento.\r\n\r\nHacemos jornadas de siembra con empresas, y hacemos siembras especializadas para neutralizar emisiones de gases efecto invernadero, para que empresas, productos o eventos sean Carbono Neutro. ContÃ¡ctanos.',6,1139,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=44JbpKilbys',0,0,'2015-6-30 23:16:37'),(279,2,'Annie, La Huerfanita','Annie es una tierna y valiente huerfanita cuyo único sueño es encontrar a sus padres. Rodeada de amiguitos inigualables, un millonario grandulón de gran corazón y una amorosa asistente, emprenderá una gran aventura en donde la música, el baile y la diversión serán el camino para encontrar su mayor anhelo y felicidad. ¡Pero cuidado! La malvada y borrachina dueña del orfanato junto a su hermano ladrón y su novia tonta, hará hasta lo imposible para truncar los sueños de Annie, ¿lo logrará…? ','eventimg/1329426075Annie la huerfanita.png'