ndos, para un total de 6 minutos 40 segundos por participante.','eventimg/1830620564uxtic.png','Pontificia Universidad Javeriana, sede BogotÃ¡ ',2,'BogotÃ¡','/groups/553042211427368/?fref=ts','UxTIC_','UxTIC','Este formato de exposiciÃ³n dinÃ¡mico obliga a los participantes a ser muy concretos y pertinentes permitiendo asÃ­ mantener un nivel de interÃ©s y atenciÃ³n alto del pÃºblico. La idea es ofrecer a los semilleros de investigaciÃ³n una tribuna para presentar sus trabajos en un formato corto, sencillo e informal que permite hacer co-working con el pÃºblico y otros jÃ³venes investigadores al mismo tiempo que promueve la investigaciÃ³n y la innovaciÃ³n en Colombia, con un espirito de colaboraciÃ³n.',6,231,57,1,'PUB',2,NULL,'','',0,0,'2015-7-1 16:19:59'),(285,16,'I Simposio de ActualizaciÃ³n MÃ©dica: Arritmias Cardiacas','La Asociación Colombiana Médica estudiantil, dando cumplimiento a sus objetivos, especialmente en la línea de educación médica realizará el I Simposio de Actualización Médica: Arritmias Cardíacas. Queremos invitar a toda la comunidad estudiantil del sector salud a que participe en éste evento realizado por estudiantes y para estudiantes. Tenemos el Honor de contar con la presencia de especialistas en el tema dispuestos a brindarnos todo su conocimiento. Estén pendientes, estaremos publicando más información en estos días. ACOME tiene muchas sorpresas para los estudiantes de medicina de Colombia. ','eventimg/412238150ACOME.jpg','Universidad El Bosque, Auditorio Principal',2,'BogotÃ¡','acomeoficial','ACOMEOficial','AsociaciÃ³n Colombiana MÃ©dica Estudiantil -ACOME-','Â¿DÃ³nde puedo ponerme en contacto con el organizador en caso de tener alguna pregunta?\r\nPueden enviar sus preguntas al siguiente correo:\r\narritmias.acome@gmail.com o bogota@acome.com.co\r\n Â¿Donde puedo pagar mi entrada?\r\nSolo se podrÃ¡ pagar el ingreso del evento, a los miembros autorizados por ACOME el dÃ­a del evento en la entrada de la Universidad El Bosque.',6,359,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=Fgr7MVZCh1s',0,0,'2015-7-1 16:32:37'),(286,2,'VII Congreso Nacional de LÃ­deres en Salu','La séptima versión del congreso nacional de líderes en salud, se celebrará los días 10 y 11 de Julio en la Sede principal de la Fundación del área Ándina, en la ciudad de Bogotá. El cual contendrá páneles de tipo académico y de debate, con espacios de intervención con el público asistente. También se compartirá un espacio de participación democrática para que los miembros de ACOME elijan su nueva Junta Nacional 2015-2016, la cual representará a los estudiantes de medicina de Colombia ante entidades de ámbito nacional e internacional.\r\nLa temática a desarrollar consta de:\r\n-Nuevos retos en formación médica y perfil del profesional de salud en el nuevo milenio\r\n-El profesional de salud y su compromiso social \r\n-Emprendimiento en salud\r\n-Taller de ideación\r\n-Ética profesional\r\n-Nueva generación de líderes en salud\r\n-Liderazgo en salud\r\n-Construcción, compromiso y desarrollo de políticas en salud\r\n-Educación de posgrado\r\n-Bullying en la jerarquía académica en profesionales de la salud\r\n-Enfermedad mental en el post conflicto. Un abordaje multidisciplinario\r\n-Equipo multidisciplinario de atención primaria en salud como reto del nuevo milenio\r\n-La eutanasia como acto médico para defender el derecho a morir dignamente.','eventimg/1701616252VII Congreso Nacional de LÃ­deres en Salud.jpg','FundaciÃ³n del Ãrea Andina, Carrera 14A NÂº 70A-34 ',2,'BogotÃ¡','acomeoficial?fref=nf','ACOMEOficial','AsociaciÃ³n Colombiana MÃ©dica Estudiantil -ACOME-','Al final del evento, el dÃ­a sÃ¡bado se harÃ¡ lectura del resultado de votaciones, protocolo de posesiÃ³n y entrega de cargos de junta directiva nacional y vocalÃ­as nacionales ACOME\r\nINSCRIPCIONES:\r\nLas consignaciones se realizan al nÃºmero de cuenta de ACOME 001082870601 Cuenta Corriente en Davivienda (cada consignaciÃ³n tiene un costo de $10.000).\r\nLuego de realizar su consignaciÃ³n, envÃ­e foto, scanner o copia del recibo de pago a congresodelideres.acome@gmail.com con los datos de las personas que cancelaron su entrada, y recibirÃ¡ un correo de confirmaciÃ³n.\r\nTodos los asistentes deberan llevar documento de identificaciÃ³n, de lo contraro no se permitira el ingreso.\r\nLos Estudiantes de ciencias de la Salud. Deberan llevar carnet de la universidad a la que pertenecen.\r\nPara mayor informaciÃ³n: \r\ncongresodelideres.acome@gmail.com - www.acome.com.co - 3168769598',6,433,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=Fgr7MVZCh1s',0,0,'2015-7-6 16:30:44'),(369,16,'Tercer encuentro Red Ole','<b><u>¿Qué son los talleres OLE?</u></b>\r\n<br><br>La Secretaría de Educación a través de la Dirección de Educación Preescolar y el Equipo de Oralidad, Lectura y Escritura han celebrado un contrato con la Universidad Nacional de Colombia, el cual presenta la propuesta titulada <i>“Talleres OLE: ecosistemas comunicativos a lo largo de la vida escolar”.</i> Este Proyecto se inscribe en la perspectiva de la relevancia del lenguaje como eje principal en el desarrollo de competencias para la vida, en tanto se convierte en el instrumento esencial para adquirir, construir, reconstruir y crear conocimiento, además de explorar y definir respuestas y sentimientos para la formación integral de la persona. Se promueve el uso de la oralidad, la lectura y la escritura para comprender y participar en el mundo.\r\n<br><br><b><u>¿Cuál es el propósito de los talleres OLE?</u></b>\r\n<br><br>Los talleres OLE tienen un doble propósito. Por un lado, construir estrategias con los docentes para integrar la oralidad, la lectura y la escritura como elementos transversales al currículo, desde la perspectiva de la reorganización curricular y del desarrollo de los ciclos. Y por el otro, fortalecer la conformación de redes de conocimiento que sean sostenibles. Las redes conformadas por comunidades de aprendizaje se rigen por la convicción de que cuando los maestros comparten entre ellos sus mejores ideas y estrategias, los estudiantes son los principales beneficiarios de estas acciones (Lieberman y Wood, 2002).\r\n<br><br><b><u>Beneficios para docentes y estudiantes de los talleres OLE!<br></u></b>• Adquirir elementos básicos sobre cómo funciona el lenguaje para aprender y cómo aprovechar cada uno de los componentes (hablar, escuchar, leer y escribir) para fortalecer su práctica pedagógica. <br>• Compartir estrategias y acciones diseñadas para que la lectura, la escritura y la oralidad sean herramientas para el aprendizaje en cualquier dominio del saber y a cualquier edad. <br>• Reconocer y reflexionar sobre las experiencias con otros colegas, mediante la conformación de la red OLE.\r\n<br>• Vivenciar cotidianamente prácticas donde la oralidad, la lectura y la escritura, sean consideradas componentes fundamentales en la construcción de saberes individuales y colectivos.\r\n<br>• Reconocerse como sujetos con voz propia, participes de una realidad en la cual puede intervenir en beneficio de los intereses académicos y sociales.\r\n<br>• Comprender las distintas formas de interacción comunicativa que median en la construcción de conocimiento en cualquier dominio del saber.\r\n<br><br><b><u>Impacto de los talleres OLE!</u></b>\r\n<br><br>• Por cada docente que participe en este proceso formativo, se cualificaran de 25 a 35 estudiantes, lo que garantizara una gran cobertura.\r\n<br>• Se consolidará la red OLE en la cual los maestros y las maestras podrán participar con sus experiencias educativas, y construir conjuntamente procesos de incorporación de la oralidad, la lectura y la escritura en sus prácticas.\r\n<br>• Se construirá transversalizalidad de prácticas de oralidad, lectura y escritura a lo largo del currículo en todos los ciclos.<br><br><b>NOTA:</b>&nbsp;Se entregará certificación de asistencia y memorias vía e-mail&nbsp;<br>','../eventimg/426709513Talleres OLE.jpg','Universidad Nacional',2,'BogotÃ¡','https://www.facebook.com/Educacionbogota','Educacionbogota','Universidad Nacional de Colombia y SecretarÃ­a de EducaciÃ³n','\"CogniciÃ³n y lenguaje en la infancia\" es un grupo de carÃ¡cter interdisciplinario cuyo propÃ³sito es desarrollar investigaciÃ³n, y proyectos de extensiÃ³n y formaciÃ³n respaldados en investigaciÃ³n, en torno al desarrollo de la cogniciÃ³n y del lenguaje, y en torno al aprendizaje ligado a estos campos.',6,877,57,1,'PUB',2,'2015-10-13 13:45:24','','',0,0,'2015-8-22 23:13:16'),(287,2,'Tour de InnovaciÃ³n en el Centro de InnovaciÃ³n Social de la ANSPE','El próximo jueves 16 de julio el anfitrión del Tour será el Centro de Innovación Social (CIS) de la ANSPE (Agencia Nacional para la Superación de la Pobreza Extrema).\r\n\r\nEn esta parada del Tour conocerás la iniciativa de Hilando, un proyecto que identifica y articula actores e iniciativas de innovación social que mejoren la calidad de vida de las familias en situación de pobreza extrema.\r\n\r\nParticipa en este espacio para conectarte con otros innovadores del sector público, privado y académico.','eventimg/472897185Tour de InnovaciÃ³n en el Centro de InnovaciÃ³n Social de la ANSPE.png','Centro de InnovaciÃ³n Social de la ANSPE, Crr 13 No. 60-67',2,'BogotÃ¡','gobiernoenlinea?fref=nf','Gobiernoenlinea','Centro de InnovaciÃ³n en Gobierno ElectrÃ³nico','Cupos limitados. \r\nÂ¿Quieres conocer mÃ¡s sobre el Tour de InnovaciÃ³n? Mira el video del anterior Tour en ViveLab BogotÃ¡ http://centrodeinnovacion.gobiernoenlinea.gov.co/es',8,506,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=gwB7SEGaN_4',0,0,'2015-7-6 17:44:17'),(288,2,'Seminario PentacamÂ®','Coordinador: Dr. Eduardo Viteri (Ecuador)\r\n\r\nConferencistas:\r\nJoerg Iwanczuk (OCULUS, Alemania): “Nuevos Módulos en Software de Pentacam®, aplicaciones para cirugía de Catarata y lentes intraoculares Tóricos”\r\n\r\nDr. Ernesto Otero (Colombia): \"Pentacam® en la evaluación del paciente con Catarata\"','eventimg/2032937339Pentacam.jpg','INSIMED - A