ollo de un modelo de negocio, creación de un prototipo básico y la generación de información que valide la existencia de una oportunidad de negocio, así como el tamaño de la oportunidad. Startup Weekends culmina el domingo por la noche con presentaciones y demostraciones finales de los equipos. Los Participantes aprenden a crear startups durante el evento, teniendo la oportunidad de colaborar con individuos con mentalidades similares en un ambiente simulado, libre de riesgo. Los equipos accederán a charlas y retroalimentación de expertos en diferentes disciplinas y recibirán retroalimentación valiosa alrededor de sus proyectos, por emprendedores y expertos de su comunidad local. El fin de semana está centrado en la acción, innovación y educación. Puede ser que estés buscando retroalimentación sobre tu idea, desarrollar habilidades específicas, conocer un co-fundador, formar un equipo que te ayude a ejecutar tu proyecto o simplemente aprender, Startup Weekend es el entorno ideal para probar y realizar los primeros pasos rumbo al lanzamiento de tu propia startup. ','eventimg/1848718963StartupWeekendBogotaWomens.jpg','Impact Hub Bogota, Calle 69 # 6-20 ',2,'BogotÃ¡','startupweekend?fref=nf','StartupWeekend','UP Global','PolÃ­tica de Reembolso:  No se realizarÃ¡ reembolso alguno dentro de los Ãºltimos 7 dÃ­as antes del evento. Lamentamos los inconvenientes que esto pueda generar. Si requieres un reembolso, por favor solicÃ­talo enviando un correo a mxtickets@startupweekend.org con la siguiente informaciÃ³n:\r\nNombre completo, Datos de contacto (correo y nÃºmero de telÃ©fono con lada), Detalles del evento, DirecciÃ³n de correo electrÃ³nico con que te registraste.',6,416,57,1,'PUB',2,'2015-07-07 19:00:44','','https://www.youtube.com/watch?v=6ceKbm-N8jQ',0,0,'2015-7-7 18:48:54'),(368,16,'Cuarto encuentro Red Ole','<b><u>¿Qué son los Talleres OLE?</u></b>\r\n<br><br>La Secretaría de Educación a través de la Dirección de Educación Preescolar y el Equipo de Oralidad, Lectura y Escritura han celebrado un contrato con la Universidad Nacional de Colombia, el cual presenta la propuesta titulada <i>“Talleres OLE: ecosistemas comunicativos a lo largo de la vida escolar”.</i> Este Proyecto se inscribe en la perspectiva de la relevancia del lenguaje como eje principal en el desarrollo de competencias para la vida, en tanto se convierte en el instrumento esencial para adquirir, construir, reconstruir y crear conocimiento, además de explorar y definir respuestas y sentimientos para la formación integral de la persona. Se promueve el uso de la oralidad, la lectura y la escritura para comprender y participar en el mundo.\r\n<br><br><b><u>¿Cuál es el propósito de los Talleres OLE?</u></b>\r\n<br><br>Los talleres OLE tienen un doble propósito. Por un lado, construir estrategias con los docentes para integrar la oralidad, la lectura y la escritura como elementos transversales al currículo, desde la perspectiva de la reorganización curricular y del desarrollo de los ciclos. Y por el otro, fortalecer la conformación de redes de conocimiento que sean sostenibles. Las redes conformadas por comunidades de aprendizaje se rigen por la convicción de que cuando los maestros comparten entre ellos sus mejores ideas y estrategias, los estudiantes son los principales beneficiarios de estas acciones (Lieberman y Wood, 2002).\r\n<br><br><b><u>Beneficios para docentes y estudiantes de los Talleres OLE!</u></b>\r\n<br><br>• Adquirir elementos básicos sobre cómo funciona el lenguaje para aprender y cómo aprovechar cada uno de los componentes (hablar, escuchar, leer y escribir) para fortalecer su práctica pedagógica. <br>• Compartir estrategias y acciones diseñadas para que la lectura, la escritura y la oralidad sean herramientas para el aprendizaje en cualquier dominio del saber y a cualquier edad. <br>• Reconocer y reflexionar sobre las experiencias con otros colegas, mediante la conformación de la red OLE.\r\n<br>• Vivenciar cotidianamente prácticas donde la oralidad, la lectura y la escritura, sean consideradas componentes fundamentales en la construcción de saberes individuales y colectivos.\r\n<br>• Reconocerse como sujetos con voz propia, participes de una realidad en la cual puede intervenir en beneficio de los intereses académicos y sociales.\r\n<br>• Comprender las distintas formas de interacción comunicativa que median en la construcción de conocimiento en cualquier dominio del saber.\r\n<br><br><b><u>Impacto de los Talleres OLE!</u></b>\r\n<br><br>• Por cada docente que participe en este proceso formativo, se cualificaran de 25 a 35 estudiantes, lo que garantizara una gran cobertura.\r\n<br>• Se consolidará la red OLE en la cual los maestros y las maestras podrán participar con sus experiencias educativas, y construir conjuntamente procesos de incorporación de la oralidad, la lectura y la escritura en sus prácticas.\r\n<br>• Se construirá transversalizalidad de prácticas de oralidad, lectura y escritura a lo largo del currículo en todos los ciclos.','../eventimg/1820859810Talleres OLE.jpg','Universidad Nacional',2,'BogotÃ¡','https://www.facebook.com/Educacionbogota','Educacionbogota','Universidad Nacional de Colombia y SecretarÃ­a de EducaciÃ³n','NOTA: Se entregarÃ¡ certificaciÃ³n de asistencia y memorias vÃ­a e-mail ',6,687,57,1,'PUB',2,'2015-10-13 14:05:47','','',0,0,'2015-8-22 22:37:17'),(297,2,'Los secretos de la gestiÃ³n del conocimiento de alto rendimiento','Este seminario revela los secretos detrás de Alto Rendimiento KM - principios clave que le ayudarán a crear valor para su organización. Al final del curso los participantes se han introducido a: El contexto de negocios 2020, 7 Principios de Alto Rendimiento KM (qué son, por qué son importantes y cómo trabajar con ellos), El ','eventimg/828314785The secrets of high performance Knowledge Management.png','Indianapolis',2,'BogotÃ¡','','KMskunkworks','K3-Cubed Ltd. David Griffiths','Modelos basados en la evidencia de galardonada investigaciÃ³n y la prÃ¡ctica llev