ntar el desarrollo en la ciudad con el uso de las TIC y convertir a Bogotá en una verdadera ciudad inteligente. <br><br>El Panel se desarrollará en dos jornadas, enfocadas cada una tres ejes temáticos, en la mañana del lunes 24 de agosto iniciando a las 8:00 a.m. y terminando a las 12:00 m. se hablará de los ejes temáticos TIC, Ambiente y Servicios, y en la tarde con un horario de 2:00 p.m. a 6:00 p.m. los ejes temáticos de Seguridad, Interacción Gobierno – Ciudadanía y Desarrollo Económico. <br><br>Esperamos nos acompañes en la construcción colectiva de la Bogotá del futuro.','../eventimg/534667813Plan-Maestro-BogotÃ¡.png','Pontificia Universidad Javeriana ',2,'BogotÃ¡','https://www.facebook.com/AlcaldiaDeBogota?fref=ts','Bogota_DC','AlcaldÃ­a Mayor de BogotÃ¡ / Pontificia Universidad Javerian','Convenio de asociaciÃ³n entre la AlcaldÃ­a Mayor de BogotÃ¡ D.C. y la Pontificia Universidad Javeriana para aunar esfuerzos en la formulaciÃ³n y estructuraciÃ³n del Plan Maestro de TecnologÃ­as de InformaciÃ³n y Comunicaciones (TIC) de BogotÃ¡ Distrito Capital',6,223,57,1,'PUB',2,'2015-08-22 19:07:20','','https://www.youtube.com/watch?v=N0_PjqFh7DA',0,0,'2015-8-22 17:55:33'),(301,16,'Curso de AnaÌlisis PVT para PetroÌleo de Baja Volatilidad','Las instrucciones a impartir corresponden a un Curso Básico - Intermedio, donde se le proporcionar a los participantes los conocimientos fundamentales de las Propiedades de los Hidrocarburos (Análisis PVT), abarcando las definiciones básicas de dichas propiedades, comportamiento de fases, caracterización, muestreo y análisis de pruebas PVT de baja volatilidad en el laboratorio, uso de correlaciones empíricas programadas, resultados y validación de pruebas PVT. <br><br><b>Objetivo:</b> Suministrar a los Participantes los aspectos teóricos y prácticos del análisis de presión, volumen y temperatura (PVT) de los fluidos del yacimiento. Presentando las técnicas de evaluación que permitirán al participante determinar las propiedades de los fluidos a partir de los datos de laboratorio. Todo esto con la finalidad de obtener y manejar información fundamental para la Generación del Modelo de Yacimiento, Cálculo de Reservas, Cálculos Analíticos y Numéricos, Control y Seguimientos del Comportamiento del Yacimientos, lo que propicia la Máxima Producción de Hidrocarburos. <br><br><b>Dirigido a:&nbsp;</b><span>Ingenieros de yacimiento de mediana experiencia, personal técnico, ingenieros afines (otras disciplinas técnicas) que se desempeñen en departamentos responsables de la exploración, explotación y producción de Hidrocarburos que requieran dominio sobre el los procesos de caracterización termodinámica de los yacimientos de petróleo. Adicionalmente, personal&nbsp;involucrado con la captación de muestras y propuesta técnica para la contratación de dichos análisis.&nbsp;</span><br>','eventimg/772767767AnÃ¡lisisPVTparaPetrÃ³leodeBajaVolatilidad.jpg','UPC Global: Colombia, Crr 13A # 89 - 53, Oficina 303',2,'BogotÃ¡','https://www.facebook.com/UPCGlobal','UPCGlobal','UPC Global','Dirigido A\r\nIngenieros de yacimiento de mediana experiencia, personal teÌcnico, ingenieros afines (otras disciplinas teÌcnicas) que se desempenÌƒen en departamentos responsables de la exploracioÌn, explotacioÌn y produccioÌn de Hidrocarburos que requieran dominio sobre el los procesos de caracterizacioÌn termodinaÌmica de los yacimientos de petroÌleo. Adicionalmente personal involucrado con la captacioÌn de muestras y propuesta teÌcnica para la contratacioÌn de dichos anaÌlisis. ',6,803,57,1,'PUB',2,'2015-09-22 12:39:31','','https://www.youtube.com/watch?v=BXMnAtefpV0',0,0,'2015-7-8 22:05:27'),(302,16,'Aprende sobre la Aceleradora Agora','Agora está en busca de emprendedores motivados liderando compañías de alto crecimiento que intencionalmente crean impacto social y/o medioambiental en Colombia. Acompáñanos en las oficinas de Socialab y aprende acerca de la Aceleradora Agora. Luego, quéda