sión 3D y podrán llevarse a casa un recuerdo creado por ellos mismos. Se explicará el proceso de impresión 3D con la ayuda de un video, que al finalizar es discutido con los niños para repasar el alcance y aplicaciones de esta técnica de fabricación, el movimiento maker, hazlo tu mismo etc. También se expondrá el funcionamiento de una impresora 3D al vivo, la cual fabricará piezas extras para el juego, momento que se aprovecha para que los niños hagan preguntas y comentarios. ¡Que aprenderán! Funcionamiento y proceso de impresión 3D. Alcances, aplicaciones y limitaciones de esta técnica de fabricación digital. Desarrollo y estado del movimiento Maker - DIY, beneficios del trabajo colaborativo e interdisciplinario. Creación y personalización de un personaje con piezas impresas en 3D y materiales maleables. Beneficios de la personalización de objetos, del trabajo en grupo, etc.','eventimg/39263090TechMakerSpace.png','1/4Tech Maker, Crr 50 # 79 - 71 Piso 4',2,'BogotÃ¡','uncuartotech?fref=nf','UnCuartoTech','1/4Tech Maker Space','Pre-requisitos: No tiene. Dirigido a: NiÃ±os de 9 a 12 aÃ±os. (con acompaÃ±amiento de sus padres) DuraciÃ³n: 3 horas. Ten en cuenta que si la fecha que seleccionaste no lleno el cupo mÃ­nimo, serÃ¡ cancelado y reservaremos tu cupo automÃ¡ticamente para la siguiente fecha.',6,312,57,1,'PUB',2,'2015-07-13 14:50:18','','https://www.youtube.com/watch?v=q1HLfrHAsAI',0,0,'2015-7-13 14:48:51'),(306,16,'Â¿Como cambiar el mundo? Una introducciÃ³n prÃ¡ctica al emprendimiento social.','¿Quieres cambiar el mundo? Participa del Bootcamp de Emprendimiento con impacto social, un taller intensivo que te permitirá aprender de forma práctica cómo desarrollar proyectos y emprendimientos con impacto social. Paso a paso.\r\n¡Atrévete a emprender! Objetivo: El objetivo principal es que los participantes realizan su potencial creativo para la creación de soluciones valiosas a los problemas que ven en su mundo. Que los participantes se empoderan a tomar