pletamente, ponte en contacto con el organizador (stephandelapena@gmail.com). GarantÃ­a de SatisfacciÃ³n: Si ustedes participan en el taller completo y no quedan satisfechos, ofrecemos una devoluciÃ³n del valor completo. El taller incluye refrescos por las pausas. Por favor lleva papel y lÃ¡piz y un poco de dinero para el almuerzo y transporte (salida a terreno). Si no se realiza el taller por falta de asistencia, se devuelven los pagos.',6,383,57,1,'PUB',2,'2015-07-13 16:12:43','','',0,0,'2015-7-13 16:11:21'),(307,16,'Seminario - Taller: GestiÃ³n de Crisis en Redes Sociales','Todas las organizaciones sin excepción alguna son susceptibles de enfrentar situaciones de crisis que pueden poner en riesgo su credibilidad y estabilidad ante sus Grupos de Interés. La incidencia de dichas situaciones a nivel organizacional es muy alta en la medida en que obstaculizan el desarrollo de las actividades propias de la organización y amenazan el logro de los objetivos y planes estratégicos, e incluso la propia continuidad operativa y de gestión de la misma. Este taller brindará alternativas de prevención y solución que permitan contrarrestar la aparición de las crisis y en caso de enfrentarse a una de ellas  se pueda manejar de manera indicada, de modo que las consecuencias negativas tanto para la organización como para sus stakeholders sean mínimas.','eventimg/493703454Seminario - Taller GESTIÃ“N DE CRISIS EN REDES SOCIALES.png','BogotÃ¡',2,'BogotÃ¡','EAR-Alto-Rendimiento-SAS/1520437164881542?fref=nf','_JorgeAguilera','EAR Alto Rendimiento S.A.S','Preguntas frecuentes: Â¿DÃ³nde puedo ponerme en contacto con el organizador en caso de tener alguna pregunta? E - mail: ear.consultoria.comunicacion@gmail.com - jorgeaguileraphd@hotmail.com Celular (57) 3115782778 - 3142374237',6,282,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=HTGC3_QR1w4',0,0,'2015-7-13 17:18:01'),(361,16,'ReuniÃ³n UxTIC - Observatorio AstronÃ³mico','En junio 2012, se creó la Red Académica \"UxTIC\" (Universidades por las Tecnologías de la información y la comunicación). Su misión es contribuir a la promoción, estimulación y fomento de las TIC, mediante un mecanismo de diálogo, intercambio y cooperación multilateral entre sus miembros, con el fin de elevar la calidad y pertinencia de la gestión institucional y responder favorablemente a las necesidades de la sociedad colombiana.&nbsp;','eventimg/452042105uxtic.png','Universidad Sergio Arboleda - Observatorio AstronÃ³mico ',2,'BogotÃ¡','https://www.facebook.com/usergioarboleda','USergioArboleda','UxTIC','UxTIC: Red de universidades para fomento de la investigaciÃ³n en tecnologÃ­as de la informaciÃ³n y la comunicaciÃ³n.',6,250,57,1,'PUB',2,'2015-08-22 13:34:03','','https://www.youtube.com/watch?v=FiiZCGv-5vM',0,0,'2015-8-22 13:28:54'),(308,16,'Ciclopaseo Represa del Sisga','A un espectacular recorrido por las montañas andinas en el que bordearemos el espejo de agua de la represa del Sisga, pedaleando por los campos, nos internaremos en los bosques de pino, los campos lecheros y disfrutaremos del aroma del bosque de eucalipto…Recorrido: 27 km aprox\r\nNivel: Principiantes (para personas que regularmente montan bici). Duración aproximada: 3.5 horas. Incluye: * Inducción, * Acompañamiento de Guías en bici durante todo el recorrido, *Asistencia mecánica y de primeros auxilios, * Póliza de seguro y * Refrigerio. No incluye: Transporte, Alimentación, Bicicleta y Otra clase de servicios no descritos.','eventimg/185642450ciclopaseos escape.jpg','Represa del Sisga, ChocontÃ¡, Cundinamarca',2,'BogotÃ¡','escapeco.co','escapecolombia','escape - 317 6576933','IInformaciÃ³n: info@escapeco.co No olvides hacer valida tu reserva. Como? ConsignaciÃ³n/ Transferencia bancaria: Banco de BogotÃ¡; Cta. Corriente: 038603445. A nombre de: escape ecoturismo y deportes de aventura SAS. Pago a domicilio? LlÃ¡manos, por un costo adicional podemos enviar un mensajero en bici. *Aplica condiciones y restricciones. Como llego a lugar? \r\nUna vez hagas tu reserva te enviaremos informaciÃ³n para llegar al punto de encuentro. Que tipo de bici necesito para este escape? De preferencia bicicleta tipo de montaÃ±a, o que puedas usar en terreno destapado, pero sobre todo  EN BUEN ESTADO, (frenos, cambios, llantas, cadenilla, sillin). Si necesitas revisiÃ³n de tu bicicleta, ponte en contacto con nosotros, ya que nuestros aliados de Soul bike tienen un descuento para ti en el alistamiento de tu bicicleta. *Aplica restricciones y condiciones. Que debo llevar? Una vez te registres nos contactaremos contigo para darte los detalles. Que incluye el refrigerio? Sandwich o emparedado + Jugo + barra energetica o fruta.',3,679,57,1,'PUB',2,'2015-07-13 18:29:00','','https://www.youtube.com/watch?v=YAiQRETWl-g',0,0,'2015-7-13 18:25:55'),(309,16,'La GestiÃ³n del Conocimiento del Programa de CertificaciÃ³n de Excelencia','En un futuro próximo un cambio generacional en puestos de alta dirección amenazará la estabilidad de las organizaciones de hoy. Bajo esta evidencia:\r\n- ¿Cómo mantener o mejorar la ventaja competitiva? - ¿Cómo se puede proteger y desarrollar el valor de la empresa? Para entender la complejidad del entorno actual y el cambio generacional, las fuerzas de la realidad para dar forma al futuro. Es necesario adaptar el marco conceptual y nuevas herramientas para visualizar la realidad y las tendencias con el fin de anticiparse a los cambios del entorno y de los mercados, para centrarse, innovación, tomar mejores decisiones y resolver problemas rápidamente. Las principales dificultades conocidas en los procesos de planificación estratégica se utilizan para estar en la implementación de los planes. La metodología premiada  y desarrollada por David Griffiths doctorado. -UK, Cierra la brecha al ofrecer una visión avanzada y proactiva para la aplicación del Plan Estratégico, basado en la Gestión del Conocimiento.','eventimg/184270229THE KNOWLEDGE MANAGEMENT EXCELLENCE CERTIFICATION PROGRAMME.png','Cl. 113 #7-80 ',2,'BogotÃ¡','pa