,'AngelaZuloaga','Ãngela Zuloaga - 313 430 3645','El evento es totalmente gratuito, y puedes asistir acompanado.',6,3203,57,1,'PUB',2,'2015-08-09 18:44:48','','',0,0,'2015-7-16 22:54:57'),(316,16,'Colombia Canta y Encanta','                    \r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\">Grupo Infantil y Juvenil Colombia Canta y Encanta\r\nhace parte de la obra educativa y cultural con su mismo nombre, que realiza\r\nprogramas enmarcados en la difusión del patrimonio musical colombiano en las\r\nnuevas generaciones. Conformada por niños y jóvenes entre los 6 y 16 años,\r\nquienes reciben su formación a nivel vocal, coreográfico, dramática y didáctica\r\nsobre las músicas tradicionales colombianas, la agrupación ha podido presentar\r\nsu labor en los más exigentes escenarios en Medellín, Bogotá, Ibagué, Bucaramanga,\r\nNeiva, Armenia y múltiples municipios antioqueños. A nivel internacional han\r\npresentado su trabajo en Austria y en Estados Unidos y preparan nuevamente su\r\ngira en Europa en septiembre de 2015 participando en festivales internacionales\r\nde folklor y conciertos protocolarios representando la cultura musical\r\ncolombiana.<o:p></o:p></p>','eventimg/1516564819Colombia Canta y Encanta.jpg','Teatro ColÃ³n',2,'BogotÃ¡','pages/Colombia-Canta-y-Encanta/57770884314?fref=nf','miteatrocolon','AsociaciÃ³n Nacional de MÃºsica SinfÃ³nica ','En Ã©sta obra musical los niÃ±os paisas invitan al pÃºblico familiar a recorrer el PaÃ­s Cafetero a travÃ©s de su mÃºsica tradicional para encontrar un secreto inimaginable. Esta historia llena de alegrÃ­a, suspenso y emociÃ³n, exalta nuestro patrimonio musical y lo lleva a un lenguaje para ser disfrutado por todos quienes llevan en su corazÃ³n su alma de niÃ±os.',2,365,57,1,'PUB',2,'2015-07-28 15:50:20','','https://www.youtube.com/watch?v=V9V8mmPr2II',0,0,'2015-7-28 15:48:58'),(358,16,'Chaskij, Ensamble de Jazz (COLOMBIA)','Los hermanos Daniel (contrabajo) y Santiago de\r\nMendoza (batería), en compañía de Juan Ignacio Arbaiza (saxofón y flauta\r\ntraversa), crearon en 2012 Chaskij, un ensamble de jazz latinoamericano.\r\nChaskij es un trío de improvisación y experimentación que reúne sonidos\r\ntradicionales de Colombia y Perú. En este concierto interpretarán repertorio\r\npropio, así como interpretaciones vivas, frescas y expresivas, que les\r\nbrindarán a los oyentes una experiencia única..','eventimg/1291263769Chaskij, Ensamble de Jazz (COLOMBIA).jpg','Biblioteca Luis Ãngel Arango',2,'BogotÃ¡','https://www.facebook.com/pages/Biblioteca-Luis-%C3%81ngel-Arango/219211484932852','ConciertosBR','Chaskij, Ensamble de Jazz ','',1,248,57,1,'PUB',2,'2015-08-21 17:11:06','','https://www.youtube.com/watch?v=D-iHnTaG8fY',0,0,'2015-8-21 17:10:20'),(317,16,'GÃ¼epajÃ© / Hilos MÃ¡gicos','Las\r\nraíces de esta historia se encuentran tanto en la tradición oral de la costa\r\nnorte colombiana como en la leyenda europea de <b><i>“El Violín Mágico”.</i></b> <br><br>En ambos\r\ncasos se habla del hechizo que la música puede generar en quien la escucha.\r\nAquí <b><i>“Güepajé”</i></b> invita a vivir una aventura fantástica en medio de manglares,\r\ncon un ogro, un simpático duende, un castillo, caimanes amaestrados y algo más.\r\nPara entrar en la aventura sólo basta emprender el viaje con el abuelo Makú y\r\nConcho el pescador, buscando con ellos la legendaria “Flor del Agua”. <br><br>Si en el\r\ncamino escuchamos su música alegre y contagiosa no hay que contenerse,\r\nsimplemente es... <b><i>¡Güepajé!</i></b>','eventimg/1304980629Hilos-Magicos.jpg','Teatro ColÃ³n',2,'BogotÃ¡','https://www.facebook.com/miteatrocolon','miteatrocolon','AsociaciÃ³n Nacional de MÃºsica SinfÃ³nica ','',2,568,57,1,'PUB',2,'2015-10-05 17:27:00','','https://www.youtube.com/watch?v=yflC4U_eJt8',0,0,'2015-7-28 16:49:45'),(462,16,'HANSEL Y GRETEL','La bruja mala del bosque ha decidido hacer un plan con la madrastra de Hánsel y Gretel por la mala situación que están viviendo en el reino, le propone que ella le de los niños a cambio de comida, joyas, belleza y trucos para que se vuelva una bruja, la madrastra acepta y tiene que convencer al padre de ellos para que los abandone en el bosque, una vez abandonados Hánsel y Gretel conocen un Troll que les habla de la importancia de la familia y les dice que tienen que recuperar a su padre, ellos siguen su camino y se encuentran con una casa de dulces en la mitad del bosque,  donde son engañados por la bruja mala que se hace pasar por anciana y les promete cuidarlos y darles comida. <br><br>A Hansel lo encierra en una jaula y a Gretel la vuelve su esclava, hasta que después de darle mucha comida decide comérselo pero Hánsel y Gretel se vengan engañándola y quemándola en el horno, quedando libres y apoderándose de todas las riquezas de la bruja, vuelven a encontrarse con su padre quien decide ir a buscarlos al bosque porque la madrastra ha muerto por el trato que hizo con la bruja.<br><br><b><i>Una historia que nos enseña a ser valientes, la unión, el amor y la importancia de la familia</i></b>','../eventimg/1514851517HANSEL Y GRETEL.jpg','Teatro Santa Fe',2,'BogotÃ¡','https://www.facebook.com/miteatrocolon','miteatrocolon','ARTES Y ESPECTACULOS PRODUCCIONES SAS ','20% Dcto con El Tiempo . Max 2 boletas.',2,878,57,1,'PUB',2,'2015-10-05 17:42:24','','https://www.youtube.com/watch?v=sDM440hMCnk',0,0,'2015-10-5 17:40:47'),(318,16,'XVI Encuentro Nacional de AstronomÃ­a','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">La\r\nRed de Astronomía de Colombia RAC realizará su XVI Encuentro anual en las\r\ninstalaciones del Planetario de Bogotá en el marco de la celebración del Año\r\nInternacional de la Luz 2015.<o:p></o:p></span></p><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp