iudadanía en general para que conozca todas las posibilidades de aplicaciones TIC que se construyen con software y hardware libre, expuestas de primera mano por sus principales actores en la ciudad de Bogotá.<br></span><br><div><br></div>','eventimg/1989042010Espacio Abierto, ciudad sostenible.jpg','Universidad Distrital Sede Aduanilla de Paiba, Calle 13 No. 31-75 ',2,'BogotÃ¡','https://www.facebook.com/AltaConsejeriaTicBogota?fref=ts','ConsejeriaTIC','Alta ConsejerÃ­a Distrital TIC','AGENDA DEL EVENTO: http://mesticbogota.gov.co/bogota-abierta/dia1.html',6,323,57,1,'PUB',2,'2015-08-18 21:08:42','','https://www.youtube.com/watch?v=UieDXCVEwWA',0,0,'2015-8-17 22:14:13'),(348,16,'Microarreglos y sus aplicaciones en la clÃ­nica ','<h2><b><span class=\"wysiwyg-color-maroon\">Microarreglos y sus Aplicaciones en la Clínica</span></b></h2>En la era de la Medicina Personalizada, las herramientas genómicas juegan un papel muy relevante. Los microarreglos, desde el 2010 juegan un papel relevante en el área de la citogenética para el análisis de variantes de numero de copia relacionadas a enfermedades constitucionales o cáncer. Así mismo, los perfiles de expresión cada vez son más utilizados para entender subtipos de cáncer así como los perfiles genéticos relacionados a respuesta a fármacos.&nbsp;<br><br><span><span><span><b>Dr. Pablo Sagaribay,</b> Microarray Team Leader, Fullerton Laboratory, Mission Hospital, Ashville, North Carolina</span><br></span><span><span><span><b>Dr. Alfredo Hidalgo,</b> Head of the Cancer Genomics Laboratory, National Institute of Genomic Medicine,&nbsp;</span>México</span><br></span><span><span><b>Dr. Mariano Guardado,</b> Investigador Hospital General de México y Director de Microarreglos Laboratorio Huella Génica, México DF</span><br></span><span><b>Laura Uribe, </b>Reproductive Health Marketing Manager, Affymetrix, Inc</span></span>','eventimg/298544657Microarreglos y sus aplicaciones en la clÃ­nica.jpg','Hotel Dann Carlton, Cra. 15 #103-60',2,'BogotÃ¡','https://www.facebook.com/affymetrix?fref=ts','Affymetrix','Affymetrix','',6,310,57,1,'PUB',2,'2015-08-18 21:11:24','','https://www.youtube.com/watch?v=QMAeAU4tEGo',0,0,'2015-8-18 10:12:17'),(355,16,'Alfredo GutiÃ©rrez SinfÃ³nico','<span>En\r\nun maravilloso formato que se ha puesto de moda en todos los géneros, esta vez\r\nel vallenato se viste de gala y nos trae a un ícono, un juglar del vallenato,\r\nel tres veces Rey Del Festival de la Leyenda Vallenata, el maestro Alfredo Gutiérrez,\r\npara vestirlo de gala, con maravillosos arreglos clásicos, a cargo de La\r\nOrquesta Sinfónica de Bogotá, bajo la dirección del maestro Zbigniew Zajac. Los\r\nespectadores se deleitarán con majestuosas melodías de éste gran exponente del\r\nvallenato. Acompañado de una gran orquesta, clásicos como Anhelos, La negra,\r\nOjos indios, La muerte de Abel Antonio, entre muchos otros, de su extenso\r\nrepertorio, encenderán los ánimos del recinto para engalanar la noche.<br><br></span>El\r\nmaestro Alfredo Gutiérrez se ha caracterizado por ser una artista innovador “me\r\nencanta poder compartir este don que tengo de la ejecución para lograr hacer la\r\nmultiplicidad de tonos y precisión de los ritmos que produzco con mi veloz\r\ndigitación. El trabajar al lado del director artístico Zbigniew Zajac y la\r\nFosbo sinfónica aparte de ser un honor es un aprendizaje en mi largo camino.\r\nSoy un artista empírico, y ellos tienen una gran escuela, sin embargo, la comunicación\r\nque hemos tenido desde hace dos meses que venimos preparando los temas, ha sido\r\nimpecable, los arreglos van sujetos a mi dirección sin perder el formato al que\r\niremos dirigidos, agrego el artista.<br>','eventimg/1729907532Alfredo GutiÃ©rrez SinfÃ³nico.jpg','Teatro Jorge Eliecer Gaitan',2,'BogotÃ¡','https://www.facebook.com/teatrojorgeeliecergaitan?fref=ts','TeatroJEGaitan','Arte y Cultura Producciones SAS','Alfredo GutiÃ©rrez ya le habÃ­a hecho unos coqueteos al gÃ©nero clÃ¡sico hace algunos aÃ±os cuan