 8:30 am inicio de la actividad 9:00 am terminacion de la actividad 1 pm\r\n\r\nRealizacion domingos',3,1124,57,1,'PUB',2,'2015-10-05 22:03:04','','https://www.youtube.com/watch?v=zb3hTTVemHg',0,0,'2015-7-29 23:15:58'),(467,16,'IV VALIDA CAMPEONATO GP COLOMBIA DE MOTOVELOCIDAD','10 y 11 de octubre 2015, 8:00AM\r\nAutodromo de Tocancipa','../eventimg/713268327IV VALIDA CAMPEONATO GP COLOMBIA DE MOTOVELOCIDAD.jpg','AutÃ³dromo de TocancipÃ¡',2,'BogotÃ¡','','','AUTODROMOS S.A.','    ',3,698,57,1,'PUB',2,'2015-10-05 22:23:17','','https://www.youtube.com/watch?v=KXvhEKZl-Qc',0,0,'2015-10-5 22:22:42'),(468,16,'Â¡QUE VIVA LA ENVIDIA!','<b><i>Porque la vida está llena de cosas bonitas que le pasan a los demás.\r\n</i></b><br><br>Ricardo Quevedo llega con su nuevo show <b><i>¡QUE VIVA LA ENVIDIA!</i></b> , con las cejas más pobladas que nunca nos hará reír hasta el cansancio, un espectáculo cargado de su característico y malhumorado humor. Un show para todos los que creemos que la felicidad radica en la infelicidad de los demás, para los que no soportamos que siempre lo bueno le pase a los otros.\r\n<br><br>La traición, la desconfianza, la suspicacia, los temores, la falta de dinero, y las reacciones que tenemos cuando inevitablemente metemos las patas, entre otros temas que serán tratados con humor para demostrar que la vida está llena de cosas bonitas que les pasan a los demás.\r\n<br><br><b><u>EL COMEDIANTE\r\n<br></u></b><br>Ricardo Quevedo comenzó a hacer comedia sin saberlo, creyendo que hacía cuentería, y por eso todos los `cuenteros` de Bogotá coincidían en que era un muy mal ‘cuentero’. Comediante con un estilo propio que a fuerza de la honestidad de sus creaciones se ha ganado los aplausos y el reconocimiento del público. <br><br>Participó en el Festival del Humor del canal Caracol, integrante del elenco permanente de Comediantes de la Noche de RCN Televisión, participó en programa Stand Up sin Fronteras de Comedy Central Latinoamérica , realizó más de 1.000 funciones de su show ¿No tiene más sencillo? en Colombia, Ecuador, Nicaragua y Estados Unidos; incursionó en el cine como actor cómico en las películas ‘Nos vamos pal mundial’ y ‘Se nos armó la Gorda’.','../eventimg/1949256096Â¡QUE VIVA LA ENVIDIA!.jpg','Teatro Leonardus',2,'BogotÃ¡','https://www.facebook.com/ricardoquevedocomediante','cejaspobladas','Llenando Salas S.A.S',' 50% para estudiantes y tercera edad los viernes 8:00 p.m. y sÃ¡bados 6:00 p.m.  solo aplican en la taquilla del Teatro Leonardus .   ',2,1113,57,1,'PUB',2,'2015-10-06 13:43:51','','https://www.youtube.com/watch?v=0qqcBYhenbc',0,0,'2015-10-6 13:41:32'),(353,16,'AlexÃ¡nder Numpaque, Violonchelo','                    <span style=\"<code\">\r\n                </span><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Alexánder\r\nNumpaque ha actuado como violonchelista principal en la Orquesta Sinfónica del\r\nConservatorio Universidad Nacional y la Orquesta Sinfónica de Bogotá. Es\r\nsolista del Conjunto de Música Antigua de la Universidad Nacional e integrante\r\nde la Orquesta Filarmónica Joven de Colombia. Su concierto estará lleno de\r\ncontrastes, no sólo de periodos históricos, sino de timbres y emociones; un\r\nrecital ideal para apreciar todas las virtudes sonoras del violonchelo.</span><o:p></o:p></p>','eventimg/1989621980AlexÃ¡nder Numpaque, Violonchelo.png','Sala de conciertos Biblioteca Luis Ãngel Arango',2,'BogotÃ¡','https://www.facebook.com/BibliotecaLuisAngelArango','Banrepcultural','AlexÃ¡nder Numpaque, Violonchelo','',1,277,57,1,'PUB',2,'2015-08-19 22:08:58','','',0,0,'2015-8-19 22:05:55'),(328,16,'Torrentismo','                                        <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:\" tahoma\",\"sans-serif\"\"=\"\">Municipio\r\nde Choachi, Vereda Masa<o:p></o:p></span></p><span style=\"font-family: Tahoma, sans-serif; font-size: 10pt; line-height: normal; text-align: justify; background-color: initial;\">Incluye:\r\n2 (dos) descensos por la cascada de 30 mts, caminata ecológica, seguro, fotos\r\ndigitales, transporte interno (Puente Medina - Vereda Masa)</span><span style=\"font-size:10.0pt;font-family:\" tahoma\",\"sans-serif\"\"=\"\"><o:p><br></o:p></span><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:\" tahoma\",\"sans-serif\"\"=\"\">Ubicación:\r\nMunicipio de Choachi, Vereda Masa, sitio el alto del palo CASCADA LA JUNIA. El\r\nTorrentismo es un descenso en Rapel que se practica por medio de la caída de\r\ntorrentes de agua en cascadas de gran altura, es una actividad bastante extrema\r\ncargada de una gran dosis de adrenalina. <o:p></o:p></span></p><span style=\"font-family: Tahoma, sans-serif; font-size: 10pt; line-height: normal; text-align: justify; background-color: initial;\">Equipos\r\nBásicos: El torrentismo tiene su equipamiento específico. Este listado sirve\r\ncomo una guía básica de los elementos propios de esta actividad, aunque según\r\nel lugar y la necesidad se pueden agregar o quitar e ira de acuerdo al tipo de\r\nsalida que se planee hacer. Zapatos para el agua o tenis de amarrar con buen\r\nagarre, arnés de escalada, casco de escalada, guantes, mosquetones de\r\nseguridad, ocho descendedor. La velocidad del descenso es controlada\r\ndirectamente por quien lo práctica en el momento. Sin embargo, existirá siempre\r\nuna persona en tierra (Belay) quien controle la cuerda en el momento necesario\r\no en caso de una emergencia.</span>                    <code></code>\r\n                ','eventimg/251036883Torrentismo.jpg','Cascada La Juna, Choachi',2,'BogotÃ¡','bungeejumpingbogota','bogotabungee','BogotÃ¡ Bungee','edad mÃ­nima 14 aÃ±os \r\npeso mÃ­nimo 45 kg max 95\r\n\r\nDEBEN HACER LA RESERVA \r\nreservasbogotabungee@hotmail, indicando la cantidad de boletas que compraron esto es para todos los planes cel: 311 263 01 10 - 317 878 7823',3,1120,57,1,'PUB',2,'2015-07-29 23:47:47','','https://www.youtube.com/watch?v=zb3hTTVemHg',0,0,'2015-7-29 23:40:30'),(329,16,'Â¡Ese tal Show NO Existe!','                                                            <p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Después\r\ndel éxito del show \"Esto No Es Ficción\" llega el segundo trabajo de\r\nFreddy Beltrán llamado \"Ese Tal Show No Existe\". \"Un día me\r\npidieron que hablara de Colombia, me quede viendo el mapa y no más la forma del\r\nmismo, me pareció rarísima\"...<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Así\r\nempieza el show, una mirada al país en la que se intenta resolver muchas\r\npreguntas, entre ellas: ¿Se han dado cuenta que ahora todos son\r\n\"Presuntos\"?, ¿Al país le falta motivación?, ¿Qué es eso de la\r\n\"Casa por cárcel”?, ¿Cuál es el remedio para los corruptos?; Estas y otras\r\npreguntas serán resueltas en este stand-up comedy de temas tragedy.<o:p></o:p></span></p>\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Pretende\r\nhacer una crítica social a través del humor, una mirada en 85 minutos sobre el\r\npaís y cosas qué, o no se han dado cuenta, o no las quiere decir.<o:p></o:p></span></p>','eventimg/2124518858Â¡Ese tal Show NO Existe!.jpg','Teatro Santa Fe, Centro',2,'BogotÃ¡','events/990625527643772/','FreddyComedianT','Artes y EspectÃ¡culos Producciones SAS','Edad mÃ­nima de ingreso 18 aÃ±os',2,541,57,1,'PUB',2,'2015-07-30 16:07:39','','https://www.youtube.com/watch?v=CwQ3TCloxj8',0,0,'2015-7-30 16:07:08'),(330,16,'Â¿FE?','                                        \r\n                <p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Catolicismo,\r\nchamanismo, cristianismo, esoterismo, agnosticismo, veganismo, e incluso\r\nateísmo, son algunos de los múltiples ismos del collage que querámoslo o no,\r\nconforman nuestra fe de hoy en día. Una fe que no se decide por ninguna\r\ndoctrina en exclusiva, y que a la vez cree alternadamente en todas, según\r\nnuestra conveniencia o desesperación. Creemos en la fuerza de Jesucristo, pero\r\nconsultamos brujas para una ayudita extra. Somos ateos, pero oramos en secreto\r\npor si las moscas. Adoramos a los animales, pero para acentuar nuestro odio a\r\nlos demás. Nos las damos de escépticos, pero secretamente esperamos la señal\r\ndivina. Presumimos de una fe a toda prueba, pero nos aterra el azar. Siete\r\nescenas nos ayudarán a burlarnos de este bricolaje en donde la incertidumbre es\r\nla gran conclusión, pues fe y duda son amigas inseparables, y nosotros, su\r\ncampo de batalla permanente.<o:p></o:p></span></p>','eventimg/1982327741FE.jpg','Casa E, Centro',2,'BogotÃ¡','CasaEoficial','CasaE_',' CorporaciÃ³n Ensamble Latino','ActuaciÃ³n: Diana Jaramillo, Reina SÃ¡nchez.\r\nDramaturgia y direcciÃ³n: Pedro Miguel Rozo\r\nAsistencia tÃ©cnica: Jonathan Villamil\r\nDirecciÃ³n de Arte: Leandro Mussi\r\nVestuario: AngÃ©lica Maldonado\r\nDiseÃ±o de imagen: Diego Sierra',2,187,57,1,'PUB',2,'2015-07-31 08:36:54','','',0,0,'2015-7-31 08:22:19'),(331,16,'Â¿QuiÃ©n se Quiere Ir? De George Harris','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Tomar\r\nun avión e irse hacia cualquier destino se ha vuelto una solución para aquellos\r\nque ven complicada la vida en nuestros países.<o:p></o:p></span></p><p><span style=\"font-family: Tahoma, sans-serif; font-size: 12pt; line-height: normal; text-align: justify; background-color: initial;\">Bajo\r\nesta premisa un joven latinoamericano decide abrirse campo en USA, sin darse\r\ncuenta que empezaría a formar parte de un universo nunca antes explorado: ser\r\ninmigrante. George Harris nos narra las ventajas y bemoles de vivir en\r\nVenezuela con su Stand Up Comedy que busca satirizar y resaltar las razones que\r\ntenemos para regresar. ¿Quién Se Quiere Ir? es un homenaje para todos los\r\nvalientes que se van de sus países, para aquellos que siguen luchando en el\r\ndestino escogido y para los no menos valientes que deciden regresar.</span><span style=\"font-size:12.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p><br></o:p></span><span style=\"font-family: Tahoma, sans-serif; font-size: 12pt; line-height: normal; text-align: justify; background-color: initial;\"><br></span></p><p><span style=\"font-family: Tahoma, sans-serif; font-size: 12pt; line-height: normal; text-align: justify; background-color: initial;\">Esta\r\npieza fue estrenada en el año 2005 en Madrid, España para luego llevarla a\r\nVenezuela con el ánimo de reflejar la situación que están viviendo los países\r\nlatinoamericanos. Ha sido presentado con gran éxito en España, Venezuela,\r\nMiami, NY, Houston, Atlanta, Orlando, Bogotá y Panamá entre otras.</span></p>','eventimg/1344804471QuiÃ©n se Quiere Ir De George Harris.jpg','Teatro Astor Plaza',2,'BogotÃ¡','elgeorgeharris','ElGeorgeHarris','Aguacate Ink','Lo pueden ver en vivo con El Show de George Harris a travÃ©s de su canal de humor www.elgeorgeharris.com todos los jueves 10PM. Todos los lunes el mismo show tambiÃ©n es transmitido por TV Venezuela para todos los Estados Unidos.',2,271,57,1,'PUB',2,'2015-07-31 10:36:47','','https://www.youtube.com/watch?v=7Ho1fiwLz3U',0,0,'2015-7-31 10:33:35'),(332,16,'Con M de Magia','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">La\r\nnueva franja en La Comedia Teatro que tendrá los más sorprendentes y divertidos\r\nespectáculos de magia todos los martes del año. Con una programación especial,\r\ntodos los asistentes serán testigos de los milagros que ocurren en las manos de\r\nlos más importantes artistas del ilusionismo en la actualidad. Cada mes habrá\r\nun espectáculo diferente para sorprender a toda la familia.</span></p>','eventimg/401366422Con M de Magia.jpg','La Comedia Teatro',2,'BogotÃ¡','lacomediateatro','LaComediaCo','Juan Ãlvarez Magia S.A.S','MagnÃ­ficos Martes llenos de ilusionismo para toda la familia! ',2,368,57,1,'PUB',2,'2015-07-31 12:34:51','','https://www.youtube.com/watch?v=m__5v3EVzX0',0,0,'2015-7-31 12:33:56'),(333,16,'Cartas de Sangre','                                        <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Es\r\nuna obra de teatro de terror representada por la Compañía Teatro Vivo de\r\nColombia en la Casa Teatro de Bogotá, es una itinerancia contenida por una\r\nantigua casa del barrio Palermo, el público asume diferentes roles dentro de la\r\npropuesta y es quien define el final de la obra, por esta razón decimos que en\r\nnuestros montajes teatrales el PÚBLICO ES EL PROTAGONISTA.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><strong><u><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">SINOPSIS:</span></u></strong><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"> En la crónica roja\r\nse anuncia que un extraño cadáver fue encontrado desmembrado a las afueras de\r\nla ciudad y mantiene en alerta a las autoridades, pues completa un ciclo\r\ndantesco de muertes que aterra a los bogotanos. La maldad camina por las\r\ncalles. (NOMBRE DE PROTAGONISTAS DEL PÚBLICO DE LA HISTORIA 3) afamado\r\nperiodista investiga sobre estos hechos y encontró que una visita a una\r\ncéntrica casona pueda ser fundamental para hallar respuestas al misterio.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">En\r\nesa casona funcionaba un viejo inquilinato en la que dos familias se enfrentan\r\na muerte por poseerla, sin saber que en el siniestro sótano de la casa se\r\nesconde algo o alguien que no es humano. En ese sótano hace diez años BRÍGIDA\r\ncometió un crimen insidioso que marcó a sus habitantes, mató en extrañas\r\ncircunstancias a una de sus hermanas. Desde entonces nadie se había atrevido a\r\nabrir ese lugar por miedo. Cuando las puertas de ese lugar estén abiertas no\r\nsólo el pasado regresará buscando redención en la muerte, la maldad encarnada\r\ncaminará por los pasillos dejando a su paso un mensaje escrito en cartas de\r\nsangre.<o:p></o:p></span></p>','eventimg/1034652661Cartas de Sangre.jpg','Casa Teatro de BogotÃ¡',2,'BogotÃ¡','pages/Casa-Teatro-de-BogotÃ¡/307881735961677?fref=ts','CasaTeatroBog','Grupo Taller Social S.A.S','Todos los Viernes y sÃ¡bados 7:00 p.m.',2,345,57,1,'PUB',2,'2015-07-31 14:08:04','','https://www.youtube.com/watch?v=vAMO6kyjgOI',0,0,'2015-7-31 14:06:45'),(334,16,'CÃ¡llate y Escribe: Andrea GuzmÃ¡n & Jimmy VÃ¡squez','                    \r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\">¿Ha vivido el drama de sentirse menos que su pareja\r\nporque supera sus talentos o tal vez lleva más plata a la casa, pero se aman y\r\nde alguna manera buscan soportarse? Si no lo ha vivido seguro se le hace\r\nconocida la historia o le recuerda alguna parecida con sus amigos o familiares.\r\nEntonces no deje de ver la nueva comedia semántica Cállate y escribe, que llega\r\nal Teatro Nacional Fanny Mikey y le sacará sus mejores carcajadas. ¡Imperdible!<o:p></o:p></p>','eventimg/515135079CÃ¡llate y Escribe Andrea GuzmÃ¡n y Jimmy VÃ¡squez.jpg','Teatro Nacional Fanny Mikey',2,'BogotÃ¡','lacasadelteatronacional?fref=nf','fteatronacional','FundaciÃ³n Teatro Nacional','Edad mÃ­nima de ingreso 12 aÃ±os',2,241,57,1,'PUB',2,'2015-07-31 16:22:46','','https://www.youtube.com/watch?v=BqDrRnjgGXk',0,0,'2015-7-31 16:22:24'),(352,16,'Â¿A quÃ© le llamamos paz?','<span class=\"wysiwyg-color-blue\">El cuarto debate, que tendrá lugar en la Biblioteca Virgilio Barco el domingo 6 de septiembre a las 10 de la mañana, girará en torno a uno de los temas más importantes de la agenda nacional: La paz. En esta ocasión, la discusión se centrara en preguntas como ¿A qué le llamamos paz? ¿Para conseguir la paz se necesita perdón, reconciliación, olvido, memoria, justicia, venganza? ¿Qué es perdonable y qué es imperdonable? ¿Sobre qué bases éticas y morales opera la justicia? ¿Cómo no alentar la impunidad histórica y el olvido? ¿Cóm</span>o garantiza la justicia que haya verdad?','eventimg/1907839795A que le llamamos Paz.jpg','Biblioteca PÃºblica Virgilio Barco',2,'BogotÃ¡','https://www.facebook.com/CulturaenBogota?fref=ts','CulturaenBta','SecretarÃ­a Distrital de Cultura RecreaciÃ³n y Deporte','Preguntas frecuentes\r\nÂ¿El evento tiene algÃºn costo?\r\nNo, todos los debates son gratuitos.\r\n \r\nÂ¿Hay algÃºn lÃ­mite edad para asistir al evento?\r\nNo hay lÃ­mite de edad\r\n \r\nÂ¿DÃ³nde puedo ponerme en contacto con el organizador en caso de tener alguna pregunta?\r\nSi tiene alguna pregunta escrÃ­banos a comunicaciones@scrd.gov.co\r\n \r\nÂ¿Es transferible mi registro/entrada?\r\nSi es transferible\r\n \r\nÂ¿Debo llevar mi entrada impresa al evento?\r\nSi debe llevar su entrada impresa. ',6,216,57,1,'PUB',2,'2015-08-18 21:37:47','','https://www.youtube.com/watch?v=Bvt9Gdm-SXg',0,0,'2015-8-18 13:24:11'),(335,16,'Boleros para un Actor','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Jorge Cao, un señor\r\nactor, un señor cantante. Un espectáculo lleno de boleros, amor, pasión. Y\r\nentonces resultó que el actor cubano Jorge Cao era también cantante. Y de los\r\nbuenos. Su voz suena espesa, amable, bella, profunda,<o:p></o:p></span></p><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Esa voz arranca a\r\ncantar y repasa las líneas románticas de ‘Mi ayer’, uno de esos boleros que\r\nastilla corazones, escrito por el cubano Ñico Rojas, uno de los grandes\r\ncompositores de Cuba: “Ayer encontré la felicidad, ayer fuiste de mi nada más y\r\nhoy tú serás quién me dirá muy quedo amor, yo a ti también te quiero”...<o:p></o:p></span></p>','eventimg/74048832Boleros para un Actor.jpg','Auditorio las Bethlemitas',2,'BogotÃ¡','pages/Jorge-Cao/177987786197?fref=nf','JorgeCao2','CorporaciÃ³n ArtÃ­stica En Escena','Edad mÃ­nima de ingreso 14 aÃ±os',2,256,57,1,'PUB',2,'2015-07-31 17:52:12','','https://www.youtube.com/watch?v=zc3nfaQ0YA8',0,0,'2015-7-31 17:51:20'),(473,16,'SER MUJER ES COSA PA MACHOS','<b><i>Ser Mujer es cosa Pa Machos ,la comedia de las comedias. Esta obra recrea con muchísimo humor las diversas facetas del universo femenino, pero vividas, experimentadas, sentidas y sufridas, por un hombre.\r\n</i></b><br><br><u><b>El Experimentará:</b></u> los tacones, la celulitis, la depilación, el Síndrome Premenstrual, la pérdida de la virginidad, el embarazo, etc., porque…”la única forma de comprender a las mujeres es meterse en su universo”.\r\n<br><br><b><u>Disfrute una hora y 20 minutos del mundo femenino:</u></b> historias y reflexiones sobre sexo, maternidad, pareja y mucho más, en un completo divertimento a cargo de un sólo actor.\r\n\r\n<br><br><b><u>La Obra se divide en 3 actos:</u></b>\r\n\r\nLas mujeres se entusiasman con cualquier cosa y después….se casan con El.\r\nLa pérdida de la Virginidad le duele más a los papás que a Uno.\r\nUno puede olvidar uno mala noche….pero No al Culpable.','../eventimg/634951794SER MUJER ES COSA PA MACHOS.jpg','Teatro Bernardo Romero',2,'BogotÃ¡','https://www.facebook.com/TEATROBRL','TeatroBRL','CARLOS QUIROGA','FICHA TÃ‰CNICA\r\nMonÃ³logo interpretado por Carlos Quiroga\r\nDiseÃ±o de Vestuario: HernÃ¡n Zajar\r\nDramaturgia y DirecciÃ³n General: Carlos Quiroga    ',2,930,57,1,'PUB',2,'2015-10-06 19:23:42','','https://www.youtube.com/watch?v=9kMUWRdoOzo',0,0,'2015-10-6 19:21:23'),(338,16,'Las Aventuras de Tom Sawyer','                    \r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Pensando\r\nen uno de nuestro más valioso público: los niños y niñas, regresa esta vez a\r\nlas tablas del Teatro Nacional Fanny Mikey Las aventuras de Tom Sawyer, una\r\nobra familiar, escrita por Mark Twain, basada en la imaginación de este\r\npequeño, quien tiene una mente llena de magia y fantasía. Aquí todos los\r\nespectadores podrán ser testigos de cómo cada búsqueda de Tom se convierte en\r\nun encuentro con el amor, la disciplina, la amistad, la imaginación, y a la vez\r\npermite poder dejar ver aquella picardía y valentía que lo caracterizan. La\r\nobra ocurre en un pueblo alejado de la modernidad, de los juegos para niños\r\nactuales y de la tecnología, para presentar alternativas diferentes y muy\r\ndivertidas para que los niños sueñen y jueguen.<o:p></o:p></span></p>','eventimg/1573417773Las Aventuras de Tom Sawyer.jpg','Teatro Nacional Fanny Mikey',2,'BogotÃ¡','TeatroNacionalFannyMikey','fteatronacional','FundaciÃ³n Teatro Nacional','Las aventuras de Tom Sawyer nos invita a hacer parte de una puesta en escena llena de fantasÃ­a y humor, que permitirÃ¡ a los niÃ±os y a sus familias reencontrarse con su imaginario, poder inventar grandes historias con sus amigos y creer en un universo mÃ¡gico, donde sin importar el lugar, siempre habrÃ¡ oportunidad para jugar y ser un hÃ©roe. Todas las travesuras del pequeÃ±o y valiente Tom Sawyer nos harÃ¡n creer y afirmar que de la mano de la amistad, la familia, el perdÃ³n y el amor es posible llevar una vida en armonÃ­a, sin nunca olvidarnos que podremos conocer nuevos mundos por medio de nuestras ilusiones y que nuestro Ãºnico reto es dejarlas volar.',2,265,57,1,'PUB',2,'2015-08-05 13:35:52','','https://www.youtube.com/watch?v=T5yI_blC0m4',0,0,'2015-8-5 13:35:00'),(339,16,'Cosi Fan Tutte de W.A. Mozart','                    <p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Se trata de una\r\nsimpática comedia de enredos donde dos hermanas cambian de amantes sin saberlo,\r\nya que regresan disfrazados para probar una apuesta que hacen con el viejo\r\nfilósofo Don Alfonso que les apuesta que no hay mujer fiel, si se les da la\r\noportunidad dejan de serlo. En Colombia se estrenó en 1984 y regresa por\r\nprimera vez al Teatro Colón desde esas 6 funciones bogotanas y la función que\r\nse hizo en el Teatro Municipal de Cali.<o:p></o:p></span></p>\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">La puesta en escena\r\nestará a cargo de Gianpaolo Corti, asistente de Giorgio Strehler en la célebre\r\nproducción del Piccolo de Milano, última puesta en escena operística del gran\r\nmaestro italiano antes de morir.<o:p></o:p></span></p>','eventimg/1159104096CosiFanTuttedeW.A.Mozart.jpg','FundaciÃ³n CamarÃ­n del Carmen',2,'BogotÃ¡','miteatrocolon?fref=nf','miteatrocolon','Teatro ColÃ³n','Para nuestras funciones en el Teatro ColÃ³n tendremos un elenco prÃ¡cticamente colombiano con todos nuestros grandes cantantes que triunfan en el exterior: Juanita Lascarro como Fiordiligi, Alejandro Escobar (Ferrando), Juan Fernando GutiÃ©rrez (Guglielmo), Valeriano Lanchas (Don Alfonso) y Karolyn Rossero (Despina), acompaÃ±ando a una de las mejores Dorabellas de la actualidad: Paola Gardina que viene de interpretar el rol en la Scala de Milano y en el Teatro Real de Madrid. Todos bajo la direcciÃ³n de Hillary Griffiths dirigiendo la Orquesta SinfÃ³nica de Colombia.',2,271,57,1,'PUB',2,'2015-08-05 14:03:28','','https://www.youtube.com/watch?v=mixf13coXLA',0,0,'2015-8-5 14:01:24'),(340,16,'De Cantina en Cantina','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Llega\r\nun show imperdible y lleno de sentimiento y emoción con Majida Issa, Diana\r\nHoyos, Yolanda Rayo y Aida Morales.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Ana\r\n(Majida Issa/Diana Hoyos), Fernanda (Yolanda Rayo) y Rocío (Aida Morales) son\r\ntres mujeres que trabajan de meseras en \"La Cantina\". Un lugar donde\r\nlos hombres van a desahogar sus penas y sus amores. Una mañana cuando todo\r\nparecía estar normal y mientras organizaban lo que había quedado de la noche\r\nanterior, Fernanda descubre que detrás de la barra hay un hombre muerto. De\r\ninmediato nos vemos sumergidos en un recorrido musical por el tiempo y la vida\r\nde cada una de ellas. Una serie de divertidas situaciones que saltan entre la\r\ncomedia y el drama amoroso al ritmo de rancheras, música popular y música de\r\nplancha. ¿Quién lo mató?, ¿Qué pasó la noche anterior?, ¿Por qué?<o:p></o:p></span></p>','eventimg/1704687990De Cantina en Cantina.jpg','Teatro Nacional La Castellana',2,'BogotÃ¡','teatronacional.co','fteatronacional','FundaciÃ³n Teatro Nacional','Toda la tragedia empieza, una vez descubren al muerto, pues es allÃ­ donde inicia un viaje en el que cada una de las mujeres cuenta su propia historia de vida, quienes son ellas, quÃ© hacen en ese lugar, porque cada una de ellas piensa que una o la otra fue la culpable de la muerte del dueÃ±o de la cantina; salen a la luz sus dolores personales presentes y pasados a travÃ©s de un lenguaje musical a ritmo de rancheras, mÃºsica popular y mÃºsica de plancha.',2,382,57,1,'PUB',2,'2015-08-05 14:37:34','','https://www.youtube.com/watch?v=rOKFQQ0r73w',0,0,'2015-8-5 14:34:36'),(341,16,'De la Cuna a la Jungla','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">T\r\nde Teatro y Centro Cultural OLD MUTUAL programan al colectivo musical TU\r\nROCKCITO con su concierto “De La Cuna a La Jungla” una divertida obra musical\r\nplena de sonidos e imágenes atractivas creadas por los juegos corporales, las\r\ncanciones para moverse y saltar, sonidos del cuerpo para armar orquestas y la\r\nespontaneidad de los padres y sus hijos al intercambiar los ritmos de la lúdica\r\ny la imaginación.<o:p></o:p></span></p>\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">DE\r\nLA CUNA A LA JUNGLA es el concierto para los más pequeños del colectivo TU\r\nROCKCITO, proyecto de música infantil que trabaja en torno a espacios únicos\r\npara la familia, proponiendo juegos musicales como un lugar indiscutible para\r\nel desarrollo y el disfrute durante la primera infancia. DE LA CUNA A LA JUNGLA\r\npropone la música para ser felices, además es la mejor excusa para que padres e\r\nhijos se encuentren y disfruten de un momento especial. Canciones para cantar,\r\nreír, jugar y hacer cosquillas son la especialidad durante el show.<o:p></o:p></span></p>','eventimg/2119343733De la Cuna a la Jungla.jpg','Auditorio Centro Cultural Old Mutual',2,'BogotÃ¡','','','FundaciÃ³n T de Teatro','El concierto De la Cuna a la Jungla llegÃ³ a mÃ¡s de 30.000 niÃ±os durante el 2014 y aproximadamente 60.000 personas desde el 2012. Ha recorrido la ciudad de BogotÃ¡ y el ancho y largo del territorio Colombiano en diversos formatos. ',2,298,57,1,'PUB',2,'2015-08-05 17:03:08','','https://www.youtube.com/watch?v=W8ypyMFEovc',0,0,'2015-8-5 17:01:22'),(342,2,'DescÃ¡rate con la Azcarate','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">basado\r\nen la cruda y divertida realidad. Con su característica fluidez y humor negro,\r\n“La Azcárate” logra captar la atención del público convirtiéndose en un espejo\r\na través del cual hombres y mujeres pueden verse reflejados. Ninguna relación\r\nde pareja es igual a otra, existen leyes y acuerdos individuales. Sin embargo,\r\nasí queramos negarlo solemos caer en situaciones comunes que han sido la\r\nmateria prima de esta obra.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Los\r\ncelos, la constante búsqueda de pareja, las frustraciones, el matrimonio, los\r\nex, la luna de miel, las suegras, la convivencia, el sexo y la infidelidad son\r\nalgunos de los temas que Alejandra toca desde una perspectiva femenina más no\r\nfeminista, ya que los abarca con una óptica graciosa y equitativa entre\r\ngéneros. Polémica, controvertida, rápida, divertida y franca tal como su\r\nprotagonista, son las características centrales de este show.<o:p></o:p></span></p>','eventimg/176050981DescÃ¡rate con la Azcarate.jpg','Auditorio las Bethlemitas',2,'BogotÃ¡','pages/Alejandra-Azcarate/416069278486159?fref=nf','LAAZCARATE','CorporaciÃ³n ArtÃ­stica En Escena','Es una invitaciÃ³n a reÃ­rse de las desgracias emocionales y a gozarse los errores cometidos. El resultado serÃ¡ lograr en corto tiempo unas abdominales marcadas por las carcajadas y el riesgo de: \r\n1) Echar a su pareja actual o evitar conseguir otra\r\n2) Lograr perfeccionar sus tÃ¡cticas para mentir\r\n3) Convencerse de que la vida es una obra de teatro',2,377,57,1,'PUB',2,'2015-08-06 16:04:29','','https://www.youtube.com/watch?v=iSV3DGPI0Bo',0,0,'2015-8-6 16:01:10'),(343,2,'Festival de MÃºsica Barroca','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">El\r\nFestival Internacional de Música Sacra de Bogotá y el Teatro Jorge Eliécer\r\nGaitán traen a Colombia a Capilla de Sol, uno de los grupos más representativos\r\nde música barroca latinoamericana quienes interpretarán piezas musicales que\r\nse&nbsp; ejecutaban en las iglesias de las\r\nmisiones jesuíticas de Moxos y Chiquitos en&nbsp;\r\nel este boliviano y villancicos de Juan de Araujo, Maestro de Capilla de\r\nla Catedral de Sucre.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Capilla\r\ndel Sol se presentará en el Teatro Jorge Eliecer Gaitan el proximo 3 de\r\nOctubre.&nbsp; Será con el repertorio “A\r\ncantar todo gargüero…”,&nbsp; una selección de\r\nvillancicos de Juan de Araujo, uno de los músicos más importantes que vivieron\r\nen Sudamérica en el siglo XVII.”…nos enorgullece que el Barroco Americano,\r\nnuestro repertorio, llegue a teatros tan importantes como el Gaitán de\r\nprestigio internacional, dándole una difusión y un prestigio social que hace\r\naños no tenía” señala Ramiro Albino, director del conjunto, quien, además, ha\r\nescrito dos textos sobre El villancico americano en la época de Juan de Araujo\r\nque invitamos a leer en este artículo.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Capilla\r\ndel Sol (Conjunto Residente del Museo Isaac Fernández Blanco, Buenos Aires)\r\nestá integrado por&nbsp; Adriana Sansone y\r\nSilvina Sadoly, Sopranos, Verónica Canaves, alto, Matías Tomasett, Tenor,\r\nRamiro Albino, flauta, Eduardo Rodríguez, bajón, Evar Cativiela, vihuela de\r\nmano, Federico Ciancio, clave y órgano, Ramiro Albino, dirección musical, Leila\r\nMakarius y Jorge Cometti, coordinación artística.<o:p></o:p></span></p>','eventimg/2143898832Festival de MÃºsica Barroca.jpg','Teatro Jorge Eliecer Gaitan',2,'BogotÃ¡','teatrojorgeeliecergaitan?fref=nf','TeatroJEGaitan','Instituto Distrital de las Artes - IDARTES','La mÃºsica sacra en Bolivia en el Siglo XVIII: de las grandes Catedrales a las pequeÃ±as Iglesias Misionales\r\n\r\nCapilla del Sol (Argentina)\r\nRAMIRO ALBINO, direcciÃ³n musical\r\nJORGE COMETTI direcciÃ³n artÃ­stica',2,461,57,1,'PUB',2,'2015-08-06 16:37:19','','https://www.youtube.com/watch?v=len9oqpdEqc',0,0,'2015-8-6 16:34:37'),(351,16,'El DÃ­a MÃ¡s Lab','<b>Squadra\r\nGroup y el I+ED Lab</b> unen fuerzas para estructurar en Colombia un modelo de\r\ninnovación que ampliará el campo de acción e impacto de ideas que por falta de\r\nestrategias para su desarrollo no progresan.<br><br>El\r\nevento de lanzamiento <b><u>EL DÍA MÁS LAB</u></b> ofrece la oportunidad a todos los\r\nasistentes de ver proyectos, prototipos y productos que solucionan de manera\r\ncontundente y creativa necesidades de empresas e instituciones de todos los\r\nsectores. \r\n\r\n&nbsp;\r\n\r\n<br><br><b><u>PROGRAMACIÓN\r\nEL DÍA MAS LAB:</u>&nbsp;<br><br>GENERAL / 10:00 AM - 4:00 PM <br>Público:</b>\r\nEstudiantes, creativos y personas amantes de la innovación.\r\n\r\nActividades:\r\nDesarrollo del Concurso Creativo, workshops con expertos del I+ED Lab y muestra\r\nde prototipos de marcas como BMW.&nbsp;<br><b>Requisitos:</b>\r\nInscripción completa en nuestro formulario (Datos obligatorios:\r\nNombre - Correo - Celular)\r\n<br><br><b>Workshops:&nbsp;</b>Efímero -&nbsp;El\r\naire no es Efímero.\r\n\r\n<br><b>Doméstico:&nbsp;</b>La\r\nflexibilidad de los objetos, de las necesidades del siglo.\r\n\r\n<br><b>Food\r\nDesign:</b> \r\n\r\nDiseño\r\nal paladar para comunicar.<br><br><b><u>VIP / 6:00 pm - 12: