ght:normal\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Ricardo\r\nQuevedo e Iván Marín una vez más juntos, desde la televisión, teatros y clubs\r\nde comedia, han logrado hacer que sus shows sean de los más queridos,\r\ndivertidos y apetecidos por los colombianos; imposible perderse esta combinación\r\nfuertemente divertida. Así que prepárense y alisten la quijada porque la risa\r\nque se les viene la podría descuadrar.<o:p></o:p></span></p>','eventimg/853265727Fiesta de Verano.jpg','Matildelina, Calle 81 # 11-34',2,'BogotÃ¡','vallenatohouse?fref=nf','Matildelinabar','Hugo Armando Devia GÃ³mez I.D.','Edad mÃ­nima de ingreso 18 aÃ±os',2,549,57,1,'PUB',2,'2015-08-06 17:11:11','','https://www.youtube.com/watch?v=db-e4jxczEg',0,0,'2015-8-6 17:09:19'),(354,16,'AlexÃ¡nder Pastrana, Piano Jazz','Alexánder\r\nPastrana hará un recorrido por algunas de las obras más reconocidas en la\r\nhistoria del jazz. Obras de Bill Evans, John Coltrane, Thelonious Monk, Miles\r\nDavis y Oscar Peterson, entre otros compositores, brindarán al público la\r\nposibilidad de conocer la manera como Pastrana reinterpreta el legado de un\r\ngénero nacido en el siglo XX.','eventimg/828315901AlexÃ¡nderPastrana,PianoJazz.jpg','Biblioteca Luis Ãngel Arango,',2,'BogotÃ¡','https://www.facebook.com/pages/Biblioteca-Luis-%C3%81ngel-Arango/219211484932852','ConciertosBR','AlexÃ¡nder Pastrana','',1,250,57,1,'PUB',2,'2015-08-21 12:54:49','','https://www.youtube.com/watch?v=QbRegB3imB8',0,0,'2015-8-21 12:47:28'),(345,2,'Granujas','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Un\r\ndivertido montaje teatral por episodios que se robará toda su atención. Escrita\r\ny dirigida por el reconocido dramaturgo Santiago Merchant, e interpretada por\r\nun elenco de lujo, llega a las tablas del Teatro Nacional La Castellana, la\r\nobra ganadora del Premio Fanny Mikey 2012: “Granujas”, una arriesgada y\r\ndivertida puesta en escena al estilo del cine negro y del cómic, que logra\r\nmezclar recursos cinematográficos y televisivos sobre las tablas. Así, entre\r\nficción, suspenso y comedia se desarrolla una historia de pillos que planean el\r\nrobo más importante de sus vidas, sin imaginarse que se les va a convertir en\r\nla peor de sus aventuras, y en la que el espectador por momentos tendrá la idea\r\nde estar al mismo tiempo entre el teatro y una sala de cine.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Bayo\r\ny Fif, son dos hermanos que quieren hacer la misión más grande de sus vidas:\r\nRobar un banco para darse unas largas vacaciones. Lo que ignoran, es que tras\r\nese dinero se están moviendo los más truculentos planes de todos los bandidos\r\nde medio pelo de la ciudad: Joe Pesci, Pappi De Prato y por supuesto Ekaterina,\r\nla dama fatal del bajo mundo. Todos, sin querer, se encontrarán en el dilema\r\nmás absurdo y peligroso de sus vidas. Desearían nunca haberse encontrado.<o:p></o:p></span></p>','eventimg/1000127851Granujas.jpg','Teatro Nacional La Castellana',2,'BogotÃ¡','pages/Teatro-Nacional-La-Castellana/234481779916864','fteatronacional','FundaciÃ³n Teatro Nacional','Edad mÃ­nima de ingreso 16 aÃ±os',2,334,57,1,'PUB',2,'2015-08-06 17:47:38','','https://www.youtube.com/watch?v=5M-xZRUlU_s',0,0,'2015-8-6 17:44:05'),(346,2,'HipnotÃ­zate de la Risa','                    \r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">El\r\nShow, ¡1,2,3… Duerme! Ven e hipnotízate de la risa en un espectáculo que pondrá\r\nde manifiesto el poder de la mente a través de situaciones graciosas en las que\r\ntomarán rol voluntarios del público. En este estado de hipnosis viajamos por la\r\nimaginación para disfrutar y reírnos con cómicas puestas en escena, dirigidas\r\npor Mustafa Badawy. Venga y sorpréndase del ilimitado poder de la mente\r\nsubconsciente, en un ambiente de risa y diversión que a lo largo de todo el\r\nespectáculo y con las actuaciones más cómicas garantizará el disfrute de toda\r\nla audiencia y de los implicados. Mustafa Badawy, hipnotista colombo egipcio\r\nformado en Las Vegas E.U, desmitifica la práctica de la hipnosis llevándola al\r\námbito de la comedia en un espectáculo donde la risa es la principal\r\nprotagonista. ¡Una fusión entre el humor y el dejarse llevar que dan como\r\nresultado una realidad paralela donde todo puede suceder!<o:p></o:p></span></p>','eventimg/915162519HipnotÃ­zate de la Risa.jpg','La Comedia Teatro',2,'BogotÃ¡','lacomediateatro?fref=nf','LaComediaCo','La Comedia Teatro SAS','EstÃ¡s adentro? EstÃ¡s afuera? Â¡1,2,3â€¦ Despierta!',2,414,57,1,'PUB',2,'2015-08-06 18:17:37','','',0,0,'2015-8-6 18:17:20'),(390,16,'Segunda ReuniÃ³n Preparatoria del Concurso de Radios en LÃ­nea','La Red Internacional de Diseño - enREDo coordinador de la Red UxTIC en el marco de Colombia 3.0 la iniciativa sin ánimo de lucro del Ministerio de Tecnologías de la Información y las Comunicaciones, donde se reúnen los representantes de la industria de los contenidos digitales, en un evento de talla mundial. <br><br>Los invita en el Centro de Alta Tecnología a&nbsp;la segunda reunión preparatoria del Concurso de Radios en Línea. Se centrará en el tema de la radio digital y se invitarán a realizadores (universitarios y comunitarios) de éstas a discutir sobre su experiencia en la edición, producción y promoción de este tipo de medios. \r\n\r\n<br>