nNos complace invitarles a una noche donde podamos discutir sobre la industria y los negocios en nuestra región, seguido de un coctel e intercambios con colegas al final del primer dia de conferencias. <br><br><b><i>Este evento está dirigido a Sangoma Empowered Partners, clientes y prospectos.\r\nAtender al evento es gratuito. No obstante debe registrarse.*\r\n</i></b><br><br><b><i>Esperamos nos acompañen y se sientan “Empowered by Sangoma”.</i></b>\r\n<br><br><u><b>Agenda:\r\n<br></b></u><b>5:45 PM</b> – Registro<br><b>6:00 PM</b> – Introducción y Bienvenida\r\n<br><b>6:15 PM</b> – Estado del Negocio y Crecimiento en las Ventas de la Region\r\n<br><ul><li>SBCs</li><li>FreePBX&nbsp;</li><li>Skype for Busienss/Express for Lync&nbsp;</li><li>Vega Gateways&nbsp;</li><li>Dirección a esperar de Sangoma&nbsp;</li></ul><b>7:30 PM</b> – Coctel e Intercambio\r\n<br><br><b><u>Presentadores:</u></b> <br><ul><li>Enrique Amaro, Regional Director – CALA &amp; Iberia, Sangoma Technologies</li><li>Ernesto Casas, Director of Pre-Sales Engineering – CALA &amp; Iberia, Sangoma Technologies&nbsp;</li><li>Moises Silva, Software Engineering Manager, Sangoma Technologies&nbsp;</li><li>Doug Vilim, VP of Global Sales, Sangoma Technologies</li></ul>','../eventimg/1274905529Sogo.jpg','Centro Empresarial y Recreativo EL CUBO',2,'BogotÃ¡','https://www.facebook.com/Sangoma','Sangoma','Sangoma Technologies','    ',6,264,57,1,'PUB',2,'2015-09-22 11:07:48','','https://www.youtube.com/watch?v=lLlqH1KDd7w',0,0,'2015-9-22 10:47:40'),(427,16,'El fenomeno Dron: usos, riesgos y reglamentaciÃ³n','A nivel mundial, las aeronaves no tripuladas (UAVs, RPAs, ARTs o Drones) han incrementado su participación en múltiples industrias y nichos de mercado. En Colombia, crece la comunidad de profesionales y aficionados que emplean drones en ausencia de una normatividad legal sobre su uso comercial.\r\n<br><br>Recientemente se publico la primera circular oficial al respecto, que con el argumento jurídico de ofrecer un contexto de seguridad a los ciudadanos por medio de una estricta regulación, impide el libre ejercicio de esta actividad. Esto ha generado una evidente inconformidad de parte de los propietarios de estas maquinas voladoras, quienes reclaman una reglamentación incluyente y flexible, que no obstaculice el aprovechamiento de esta tecnología.\r\n<br><br>Entonces, <b><i>¿qué son finalmente estas divertidas máquinas?\r\n\r\n¿Para que sirven? ¿cual es el impacto de sus distintas aplicaciones en la sociedad?\r\n\r\n¿Cuáles son los riesgos en que incurren los pilotos?</i></b>\r\n\r\n<br><br>Vamos a resolver estas y otras preguntas en el primer encuentro de Café Numérique Bogotá. <br><br><b><i>¡Acompañenos!</i></b>','../eventimg/1765095949El fenomeno Dron.jpg','HackBo, Cll 44 NÂº 8 - 50 Of. 201 ',2,'BogotÃ¡','https://www.facebook.com/Caf%C3%A9-Num%C3%A9rique-Bogota-613096225497308/timelin','CafeNBogota','CafÃ© NumÃ©rique Bogota','CafÃ© NumÃ©rique BogotÃ¡ es una comunidad que se construye en torno a las nuevas tecnologÃ­as en espacios de reuniÃ³n conviviales. En CafÃ© NumÃ©rique BogotÃ¡ organizamos eventos de apropiaciÃ³n de tecnologÃ­as de la informaciÃ³n, la ciencia y la innovaciÃ³n en ambientes informales y descomplicados como en un CafÃ©-Bar.',8,264,57,1,'PUB',2,'2015-09-22 13:20:37','','https://www.youtube.com/watch?v=-V2t1OSefVc',0,0,'2015-9-22 13:13:12'),(428,16,'1er Seminario de Actividad FÃ­sica RecreovÃ­a 20 AÃ±os moviendo a los Bogotanos','En el marco de los 20 años del Programa Recreovía del Instituto Distrital de Recreación y el deporte genera un espacio académico y practico en el cual se convocan universidades, marcas lideres en Fitness, coordinadores de Programas de Actividad Física en el ámbito comunitario e invitados especiales, para analizar el impacto, desarrollo y proyección de los programas de promoción de hábitos y estilos de vida  saludable en diferentes niveles.\r\n<br><br>Para este evento contaremos con la presencia de las Universidades que tienen especializaciones en Actividad Física, Representantes de las empresas privadas lideres en tendencias fitness, coordinadores y lideres de procesos comunitarios a nivel del país y la presentación del estudio de la Universidad de los Andes y Colciencias.<br><br>Establecer un espació para exponer los resultados obtenidos y la evolución del programa Recreovía en sus 20 años de intervención en la promoción de  la practica de la actividad física en la Ciudad de Bogotá y como este se ha convertido en un modelo a seguir a nivel nacional e internacional.\r\n<br><br><b>Para este primer Seminario contará con la siguiente temática:</b>\r\n<br><ul><li>La actividad física en la academia\r\n\"investigación, impacto y proyección a nivel nacional e\r\ninternacional\"&nbsp;</li><li>Evaluación de la efectividad del programa recreovía\r\npara la promoción de la actividad física en ámbitos comunitarios</li><li>Tendencias actuales del Fitness \"Tributo 30\r\naños formando los mejores profesores de clases grupales de Colombia\"&nbsp;</li><li>Tendencias actuales del Fitness y la comunidad&nbsp;</li><li>Actividad Física Comunitaria: \"Acciones y\r\nExperiencias Exitosas de Colombia para el Mundo\"</li></ul>','../eventimg/848849120Instituto Distrital de RecreaciÃ³n y Deporte - IDRD, Programa RecreovÃ­a.jpg','SalÃ³n Presidente del IDRD, Cll 63 # 59A - 06',2,'BogotÃ¡','https://www.facebook.com/prensa.idrd','RecreoviaIDRD','Instituto Distrital de RecreaciÃ³n y Deporte - IDRD','Es la instituciÃ³n lidere en promover el Deporte, la RecreaciÃ³n y la Actividad FÃ­sica el cual cuenta con un programa lider durante 20 aÃ±os en la promociÃ³n, prÃ¡ctica y generaciÃ³n de estrategÃ­as para que en la ciudad de BogotÃ¡ cuente con una oferta permente de actividad fÃ­sica para la salud y generar hÃ¡bitos y conciencia en la importancia de realizar actividad fÃ­sica',3,575,57,1,'PUB',2,'2015-09-22 14:11:48','','https://www.youtube.com/watch?t=9&v=LjQtahDcCdQ',0,0,'2015-9-22 13:57:09'),(429,16,'BogotÃ¡ Workplace Conf