Audiovisuales Escolares 2015 Prende El Suiche','\"Un espacio para promover el conocimiento, la creatividad, la imaginación y el uso de la TICs\"','../eventimg/1687938131Colegio Nueva ConstituciÃ³n IED.png','Colegio Nueva ConstituciÃ³n, Crr 107B # 74-31',2,'BogotÃ¡','','','Colegio Nueva ConstituciÃ³n IED','Juan Carlos SuÃ¡rez GÃ³mez - Docente LÃ­der Proyecto EMF',5,926,57,1,'PUB',2,'2015-09-22 15:20:01','','',0,0,'2015-9-22 15:15:07'),(431,16,'Curso de SimulaciÃ³n de ProducciÃ³n para Bombeo MecÃ¡nico','<b>Objetivo:</b>\r\nEste curso tiene como objetivo principal presentar al usuario la poderosa y eficáz herramienta integrada que nos brinda la empresa líder en Optimización de sistemas de bombeo mecánico; como Theta Oilfield Services, por medio de la integración bajo la ambiente especializado con los software: RODSTAR, XDIAG, XBAL y XTOOLS. De igual manera se exponen los principios básicos que describen el funcionamiento del método como sistema de levantamiento artificial para la extracción de petróleo.\r\n<br><br>El Ingeniero podrá diseñar sistemas nuevos, evaluar pozos existentes y predecir el comportamiento futuro determinando el índice de productividad de los pozos a través de análisis sofisticados de curvas IPR e identificar los pozos candidatos a optimización. Esto se logrará mediante la interpretación del registro dinamométrico mediante el análisis paramétrico, el balanceo de las unidades, diagnóstico de la condición de la bomba, cargas en la unidad de superficie, esfuerzos en la sarta de cabillas, torque impuesto sobre la caja de engranaje, enfocando los resultados hacia una eficiencia mayor del sistema y los menores gastos en equipos instalados y consumo de energía por cada barril de petróleo producido.\r\n<br><br><b>Dirigido A:</b>\r\nEstá dirigido al personal de Ingeniería, técnicos de campos, supervisores y  operadores de producción y personal que esté involucrado en el desarrollo y prácticas de tecnologías en simulación y diseño de sistemas de bombeo mecánico utilizando el Software de Theta Oilfield Services.\r\n<br><br><b>Contenido Programático:</b>\r\n<br><ul><li>Bomba de Subsuelo</li><li>Principios Dinamométricos&nbsp;</li><li>Análisis Diagnóstico</li><li>Integración de las herramientas de Adquisición de Datos de Campo y Software&nbsp;</li><li>Especializado de Diseño y Diagnóstico&nbsp;</li><li>Experto\r\nDiseño de Sistemas de Bombeo Mecánico&nbsp;</li><li>Análisis Kinemático de las Unidades de Bombeo&nbsp;</li><li>Diseño de Cabillas de Ácero RODSTAR&nbsp;</li><li>Ejemplos Prácticos&nbsp;</li><li>XTOOLS&nbsp;</li><li>Proceso de Siete Pasos de Optimización</li></ul>','../eventimg/920747806Curso de SimulaciÃ³n de ProducciÃ³n para Bombeo MecÃ¡nico.png','UPC Global, Carrera 13A # 89 - 53',2,'BogotÃ¡','https://www.facebook.com/UPCGlobal','UPCGlobal','UPC Global','Empresa lÃ­der en consultorÃ­a que da soluciones estratÃ©gicas en Ã¡rea de levantamiento artificial. Estamos dedicados en el suministro de software, hardware y capacitaciÃ³n para analizar y optimizar el rendimiento de pozos de petrÃ³leo y gas. La lÃ­nea de productos UPC tambiÃ©n se extiende a barras pulidas, abrazaderas, preventivos de reventones (BOP), y prensaestopas.',6,972,57,1,'PUB',2,'2015-09-22 15:54:40','','https://www.youtube.com/watch?v=BXMnAtefpV0',0,0,'2015-9-22 15:42:20'),(432,16,' Curso de Mediciones AcÃºsticas y DinamomÃ©tricas','<b>Objetivo:</b>\r\nPresentar a los analistas de producción y optimización con sistemas de bombeo mecánico, utilizando las técnicas más novedosas de la industria.\r\n<br><br>El Dr. Podio presenta el Analizador de Pozos de Echometer de una manera más avanzada en cuanto a sus aplicaciones, equipo y software para llevar acabo las mediciones acústicas y dinamométricas con el uso del software TWM y el nuevo TAM para equipos inalámbricos.<br><br><b><u>Temas:</u></b><br><ul><li>Aplicaciones del Analizador de Pozos</li><li>Software utilizado con el Analizador de Pozos</li><li>Total Well Management (TWM)</li><li>Total Asset Moni