sobre límites y disciplina, aprendiendo que no es necesario usar la violencia y la represión para educar. \r\n\r\nEs hora de atrevernos a hacer las cosas de un modo distinto al que lo hemos hecho siempre.\r\n<br><br>En el seminario Crianza Respetuosa abrimos nuevas ventanas con referentes para impartir crianzas conscientes, informadas y libres de violencia, porque de la calidad de la crianza depende que construyamos un mundo más violento o más humanizado.​\r\n<br><br><b><i>“Los niños son el tesoro de la nación”</i></b>','../eventimg/1010420787CRIANZA RESPETUOSA - BERNA ISKANDAR.jpg','J.W. Marriot Salon Ceiba',2,'BogotÃ¡','https://www.facebook.com/conocemimundo','conocemimundo','LIBARDO ENRIQUE GARCIA GUERRERO','    ',6,872,57,1,'PUB',2,'2015-10-05 19:25:48','','https://www.youtube.com/watch?v=4YhPTd7foI8',0,0,'2015-10-5 19:23:37'),(466,16,'MÃ¡s que Sexo','Los Invito a mi conversatorio <b>\"Más que Sexo\" </b>donde hablare temas de Pareja, Mitos, tips de Sexualidad, beneficios del Sexo, errores cometidos en la cama.<br><br><b><u>TEMAS:<br></u></b><ul><li>DIFERENCIAS MASCULINAS Y FEMENINAS</li><li>BENEFICIOS DEL SEXO A LA SALUD FEMENINATUMBANDO MITOS DE LA SEXUALIDAD</li><li>MITOS DEL AMOR ROMANTICO</li><li>ERRORES COMETIDOS EN LA CAMA</li><li>RE-APRENDENDO A SEDUCIR</li><li>TIPS PARA CALENTARSE Y CALENTAR AL OTRO</li></ul>','../eventimg/1643561477MAS QUE SEXO.jpg','AUDITORIO ABC, CALLE 104 # 17-22 ',2,'BogotÃ¡','https://www.facebook.com/flavialanags','flavia2santos','JOSÃ‰ LARA','AUDITORIO ABC, CALLE 104 # 17-22 - COLEGIO NUESTRA SEÃ‘ORA DEL BUEN CONSEJO',2,669,57,1,'PUB',2,'2015-10-05 19:53:22','','https://www.youtube.com/watch?v=pkdMr6XOfj8',0,0,'2015-10-5 19:46:33'),(469,16,'6to. CLOWN ENCUENTRO INTERNACIONAL','<b><u>Programación:\r\n</u></b><br><br><b>OBRA: VARIETE INAGURAL // FECHA</b> lunes 2 de noviembre 2015 - 8:00 pm <br><b>OBRA: ESPECTACULO COLOMBIANO // FECHA</b> martes 3 de noviembre 2015 - 8:00 pm\r\n<br><b>OBRA: J.O.C. EL VIAJE DE UN PAYASO // FECHA</b> miércoles 4 de noviembre 2015 - 8:00 pm\r\n<br><b>OBRA: LA PERSEGUIDA // FECHA</b> jueves 5 de noviembre 2015 - 8:00 pm\r\n<br><b>OBRA: MUTE // FECHA</b> viernes 6 de noviembre 2015 - 8:00 pm \r\nO<br><b>OBRA: FABRICANTE DE CONFETI // FECHA</b> Sábado 7 de noviembre 2015 - 8:00 pm','../eventimg/14476587926to. CLOWN ENCUENTRO INTERNACIONAL.jpg','La Casa del Teatro Nacional',2,'BogotÃ¡','https://www.facebook.com/teatronacional.co','fteatronacional','FUNDACION TEATRO NACIONAL ','    ',2,1067,57,1,'PUB',2,'2015-10-06 14:26:17','','',0,0,'2015-10-6 14:23:36'),(470,16,'A PUERTA CERRADA','<b><i>Obra realizada con el apoyo de la Fundación para la Divulgación de las Artes \"El Vulgar\"</i></b>\r\n<br><br>En una habitación sin ventanas se encuentran encerrados tres extraños personajes: Garcin, un activista político, Inés, una empleada de correos, y Estelle, una señorita de la alta sociedad francesa. \r\nAparentemente no tienen nada en común y aun así son obligados a enfrentar sus propias culpas frente a los ojos acusadores de los demás y de una estatua que en el fondo los vigila.\r\n<br><br><b><i>No hay escapatoria, cuando la puerta se cierra el infierno aparece…</i></b>','../eventimg/1407255622A PUERTA CERRADA.jpg','Teatro Libre',2,'BogotÃ¡','https://www.facebook.com/fteatrolibre','teatrolibrebog','FUNDACIÃ“N TEATRO LIBRE	','    ',2,1337,57,1,'PUB',2,'2015-10-06 15:36:11','','',0,0,'2015-10-6 15:35:09'),(471,16,'BLANCA NIEVES Y LOS SIETE ENANITOS','Teatro - Teatro Nacional La Castellana','../eventimg/194990765BLANCA NIEVES Y LOS SIETE ENANITOS.jpg','Teatro Nacional La Castellana',2,'BogotÃ¡','https://www.facebook.com/Teatro-Nacional-La-Castellana','fteatronacional','FUNDACION TEATRO NACIONAL ','    ',2,1117,57,1,'PUB',2,'2015-10-06 16:30:17','','https://www.youtube.com/watch?v=ZvunTM-7RC8',0,0,'2015-10-6 16:28:42'),(472,16,'SIN ANESTESIA Con Diego Matheus','Diego Mateus regresa al origen del Stand up comedy sin ningún tipo de mecanismo extraño, sólo contra el mundo, eso sí, con toda la clase, la elegancia y la sofisticación, acordes con su discurso. Él, con un lenguaje directo e incorrecto, tocará temas como el rock, la policía, las mamás hitlerianas, la política, las impertinencias, entre muchos otros. Este es un viaje por el mundo de la desobediencia, para que usted se sienta trasgresor, pueda pensar al margen y aun así, saber que no acabará en la cárcel por lo que diga o por lo que escuche. Salga de su rutina y diviértase con este show lleno del mejor humor negro, que invita a la resistencia desde la risa. ¡Imperdible!\r\n<br><br>Diego Mateus es ese tipo de ser misterioso que puede llegar a intimidar si se lo cruza a media noche por una desierta calle bogotana, sin embargo no es más que una pose de supervivencia. Es uno de los comediantes más enérgicos y honestos de la escena colombiana, quien a partir de la conversación con su audiencia, genera un discurso lleno de reflexiones punzantes e ideas directas sobre la humanidad. Con la particular agudeza en su discurso y su brillante capacidad para improvisar líneas de humor en sus espectáculos, Diego nos lleva con este nuevo show a través de un viaje lleno de sinceridad y desobediencia para hablar de la educación, el consumo, la moral y otro sin fin de temas que merecen ser abordados… SIN ANESTESIA.\r\n<br><br>Esta obra podría definirse como la filosofía de vida de Mateus, importaculismo cítrico en el universo de la calle, del barrio y lo cotidiano. Con una banda sonora de puro rock y un diseño cuidado en el vestuario y la escenografía, llega a la sala del Teatro Nacional Fanny Mikey, a las Noches de Stand Up de los martes y miércoles, porque va acorde con la línea de humor, dice lo que se le antoja, y tiene un discurso lleno de interesantes reflexiones que todos hemos pensado alguna vez, pero no nos atrevemos a decir, o por lo menos no en público.','../eventimg/879277628SIN ANESTESIA Con Diego Matheus.jpg','Teatro Nacional Fanny Mikey',2,'BogotÃ¡','https://www.facebook.com/diegomatteus','diegomatteus','FUNDACION TEATRO NACIONAL ','Ficha tÃ©cnica:\r\nDirector y dramaturgo: Diego Mateus\r\nDirectora de arte: Maddalena Zanardi\r\nIluminaciÃ³n: Daniel CalderÃ³n / DECA\r\nVestuario: Maddalena Zanardi\r\nMÃºsica: Danny Jones\r\nCortinas y audios: Felix RiaÃ±o\r\nProductor de campo: David Martinez\r\nProductor ejecutivo: Daniel CalderÃ³n\r\nComediante: Diego Mateus    ',2,222,57,1,'PUB',2,'2015-10-06 17:22:21','','https://www.youtube.com/watch?v=Y0JrgQiImDc',0,0,'2015-10-6 17:18:18'),(474,16,'RASGOS Y COLORES DEL MESTIZAJE','Espectáculo que recoge diversos aspectos del Folclore Nacional en una narrativa escénica que resume la historia del país. Relatada mediante la puesta en escena de aspectos históricos a través de la música, las danzas folclóricas y la danza moderna.','../eventimg/908461375RASGOS Y COLORES DEL MESTIZAJE.jpg','Teatro Patria',2,'BogotÃ¡','https://www.facebook.com/ligia.degranados?fref=ts','','CORPORACION BALLET FOLKLORICO COLOMBIANO','    ',2,776,57,1,'PUB',2,'2015-10-09 12:56:39','','https://www.youtube.com/watch?v=mdE3449oE2E',0,0,'2015-10-9 12:55:19'),(475,16,'eCommerce DAY','El Tour de eventos <b>eCommerce DAY</b> crea un espacio para la difusión, promoción y reflexión sobre la importancia del impacto que ha producido Internet y las nuevas tecnologías en la vida, trabajo y negocios de las personas y empresas, permitiendo una mejora en la competitividad de nuestra economía y la reducción de la brecha que separa a nuestros emprendedores, empresas y profesionales en diferentes regiones América Latina.\r\n<br><br>El eCommerce DAY es una iniciativa del Instituto Latinoamericano de Comercio Electrónico eInstituto que realiza desde el año 2008 en diferentes países de la región en forma conjunta con sus capítulos locales y tiene como objetivo fomentar un ámbito donde las empresas del mundo de los negocios por Internet puedan intercambiar experiencias y soluciones, creando también un canal de colaboración para aquellos interesados en ingresar activamente y aprovechar los beneficios de la Economía Digital.','../eventimg/1687471368ecomerce day.png','Plaza Tequendama, Carrera 10 #26-21',2,'BogotÃ¡','https://www.facebook.com/ecommerceday','eCommerceDay','CÃ¡mara de Colombiana de Comercio ElectrÃ³nico CCCE','El eCommerce DAY Tour 2015 es una iniciativa regional del Instituto Latinoamericano de Comercio ElectrÃ³nico (eInstituto)\r\ncoorganizado localmente por la CÃ¡mara de Colombiana de Comercio ElectrÃ³nico CCCE',6,703,57,1,'PUB',2,'2015-10-13 12:31:24','','https://www.youtube.com/watch?v=EXin9Hwga6k',0,0,'2015-10-13 12:28:00'),(477,16,'OpenIDEO Meetup BogotÃ¡: Â¡Lanzamiento del nuevo reto!','<b><i>¿Quieres contribuír con tus ideas a resolver retos globales? </i>¡Te invitamos al lanzamiento del nuevo reto de OpenIDEO: Higher ED!&nbsp;</b>Un taller donde usaremos las metodologías de IDEO para solucionar un reto global. <br><br><b>¿Que es OpenIDEO?</b> \r\nOpenIDEO reune innovadores sociales y emprendedores entusiastas alrededor del mundo, en talleres experienciales para aprender y aplicar la metodología Human-Centered Design (Diseño centrado en las personas) y resolver retos sociales y globales con ideas emprendedoras. <br><br><b>¿Qué pasará en el taller?</b>\r\n<br><ul><li>Presentación y networking de comunidad</li><li>Presentación de la plataforma OpenIDEO: ¡Los valores agregados de participar en la comunidad global Meetups!&nbsp;</li><li>El lanzamiento del nuevo reto “Higher ED“ en conexión con 15 ciudades&nbsp;</li><li>Presentación de la metodología Human-Centered Design&nbsp;</li><li>Inicio del trabajo por equipos, con inspiración e ideación para resolver el reto.&nbsp;</li></ul><b>&nbsp;¡Los esperamos!</b>','../eventimg/1927148706OpenIDEO Meetup BogotÃ¡ Â¡Lanzamiento del nuevo reto!.jpg','Impact Hub BogotÃ¡, Cll 69 # 6-20',2,'BogotÃ¡','https://www.facebook.com/groups/OpenIDEOMeetupBogota/?fref=ts','OpenIDEO','OpenIDEO Meetup BogotÃ¡ & Impact HUB BogotÃ¡','    ',8,1070,57,1,'PUB',2,'2015-10-13 15:13:36