r\nY su cierre de lujo será el 25 de marzo en el mismo escenario del Jorge Eliécer Gaitán a ritmo de una Big Band. Un formato que, en lo personal es del gusto de Cepeda y en el que interpreta boleros al mejor estilo de las grandes Big Band. Temas como: Piel canela, Sabor a mí, No voy a dejarte ir, Las cuarenta, La última noche, Cómo fue, Inolvidable, Voy a extrañarte, Hola soledad, Negrura y Si me comprendieras entre otros, formarán parte del repertorio, acompañado por 30 músicos que harán de ese cierre una noche inolvidable.','../eventimg/830371270andres cepeda 23.jpg','Teatro Jorge EliÃ©cer GaitÃ¡n',2,'Bogota','','','','    Descuentos: \r\n20% de descuento para suscriptores del Club Vivamos El Tiempo, vÃ¡lido en todos los canales.\r\n20% de descuento para compradores de los 3 conciertos, vÃ¡lido en puntos de venta y call center',1,260,57,1,'PUB',2,'2017-01-23 21:57:01','','',0,0,'2017-1-23 21:48:41'),(496,1,'Aprender a hacer Cerveza Artesanal','En este curso teórico-práctico de 6 horas se enseñarán los principios básicos de la fabricación de cerveza:\r\n\r\nTipos de cerveza\r\n* Maltas, levaduras y lúpulos\r\n* Equipos y procesos básicos\r\n* Terminología cervecera\r\n<br>&nbsp;¿Qué se debe saber?\r\n\r\nEl curso está dirigido a cualquier persona que quiera empezar el apasionante hobby de fabricar cerveza en casa o en su negocio. No necesitas conocimientos previos, solo muchas ganas de aprender.\r\n\r\nDurante la jornada, serán parte de la fabricación de su primera cerveza artesanal, una american pale ale y saldrá con los conocimientos necesarios para replicarla en casa o en su negocio.','../eventimg/562486538cerveza.jpg','Hotel Lancaster House',2,'Bogota','','','3186279016 / contacto@escuelacervecera.com   ','    ',6,165,57,1,'PUB',2,'2017-01-24 20:16:41','','',0,0,'2017-1-24 19:23:32'),(497,1,'Â¡QuÃ© feo es ser Feo! de Freddy BeltrÃ¡n ','En ‘Qué feo es ser feo’ Freddy Beltrán clasifica a los hombres en ‘feo, medio feo, refeo y los ¡Oich, tampoco!’, que son la mayoría de los colombianos, aunque lo nieguen. Además, hace un homenaje a los órganos, músculos, nervios, miembros inferiores y superiores, dientes, lunares y demás partes que componen el cuerpo humano: una completa radiografía de nuestra anatomía, convirtiéndose en un médico que responderá preguntas como: ¿En qué se parece el apéndice a un político? ¿Tienen tibia los esquimales? ¿No podría ser más corto el nombre del esternocleidomastoideo? Los hombres guapos siempre envidian la ingeniosa “parla” de un feo para conquistar y Freddy lo sabe de sobra; por eso, en dos horas, cuenta esos tips para levantar, con su fino humor y esa gracia para burlarse de sí mismo.\r\n\r\n“Los feos somos más, muchos más, no nos hagan enfadar”','../eventimg/490206243FreddyBeltran2.jpg','Astor Plaza Sala de Eventos ',2,'Bogota','','','Astor Plaza Sala de Eventos Ltda. ','    Eventos Viernes y SÃ¡bados',2,167,57,1,'PUB',2,'2017-01-25 12:55:15','','',0,0,'2017-1-24 21:46:56'),(498,1,'Piter Albeiro - Por Primera Vez ','Con casi 600 funciones PITER ALBEIRO regresa a bogota para su ULTIMA TEMPORADA de \"Por primera vez\" el show que con tanto éxito ha llevado a más de 20 países. \r\n\r\nSin duda alguna es uno de los Stand Up mas taquilleros de los últimos tiempos, y gran parte de su éxito se lo debe al humor blanco con el que se tocan los conflictos de pareja, y las diferencias entre hombres y las mujeres. Sin apelar a ninguna grosería el comediante deja al desnudo nuestros defectos y hace campañas para que la gente empiece a ser realmente Feliz. Si ya la vio sabe de que hablamos y si no la ha visto puede ser la ultima oportunidad.','../eventimg/1460922179Peter Albeiro.jpg','Teatro Gimnasio Moderno',2,'BogotÃ¡','','','OMAR ALEJANDRO LEYVA','* Edad mÃ­nima de ingreso 12 aÃ±os \r\n* Para comprar tu entrada http://bit.ly/2jnY05q ',2,202,57,1,'PUB',2,'2017-01-25 12:33:14','','',0,0,'2017-1-24 22:09:05'),(499,1,'Multitudinaria Bicicaravana por el DÃ­a de los humedales','La Fundación Humedales de Bogotá invita a todos los bogotanos a sacar la bicicleta y celebrar con toda el día mundial de estos ecosistema, considerados la cuna de la biodiversidad en la capital.\r\n\r\nEsta será la quinta versión de la bicicaravana, cuyo propósito este año es ir en defensa de la Reserva Thomas Van Der Hammen y sus humedales.\r\n\r\nEl recorrido le permitirá visitar importantes lugares para Bogotá, en los que se buscará exigir la recuperación y conservación de estos espacios, que entre tantas bondades, evitan que se inunde la ciudad en época de lluvias.\r\n\r\nEn esta versión, la Fundación Humedales sugiere a los participantes disfrazarse de la biodiversidad de estos espacios naturales: aves, mamíferos, invertebrados, entre otros animales, o ir con camiseta verde.\r\n\r\nCabe recordar que en esta fecha se celebra el convenio sobre los humedales en la ciudad Ramsar (Irán) en 1971.','../eventimg/801123887Bicicaravana_diadeloshumedales_2015-260.jpg','Parque El Virrey',2,'BogotÃ¡','','',' FundaciÃ³n Humedales de BogotÃ¡ ','Parque El Virrey y en la plazoleta de la escultura a Edgar Negret (carrera 15 con calle 88)\r\n\r\nEntrada Gratis',3,174,57,1,'PUB',2,'2017-01-24 22:56:52','','',0,0,'2017-1-24 22:54:50'),(500,1,'Noche de Gala con Pipe PelÃ¡ez ','Después de un año con llenos totales en diferentes escenarios del mundo, el 2017 se prepara para recibir en el escenario del Teatro Jorge Eliécer Gaitán a Felipe “Pipe” Peláez, el próximo 4 de Marzo, en un súper concierto en el que el cantautor de grandes éxitos junto a Manuel Julián, su acordeonero y su grupo ofrecerán a los espectadores, un gala de grandes éxitos. \r\n\r\nNacido en Maracaibo Venezuela pero criado y de corazón totalmente guajiro el artistas colombiano es uno de los representantes del género que más éxitos le ha dado a muchos de los intérpretes del vallenato. Además de componer, como intérprete que se ha paseado por muchos géneros incluidos la música tropical, la balada, la salsa y el merengue, Felipe Peláez es considerado uno de los artistas más polifacéticos.\r\n\r\nEn el 2012 llegó su primera nominación al Grammy con la producción “De otra manera” un álbum realizado con los mejores pianistas, bajistas y artistas del género vallenato del momento donde la ausencia del acordeón en un formato netamente acústico dio como resultado el disco más exitoso del momento para el artista que lo llevó a alzarse con el galardón en el formato de mejor álbum cumbia-vallenato en el 2013, con su producción “Diferente”.\r\n\r\nDe su reciente álbum Vestirte de amor que se desprende el numero uno por varias semanas que lleva el mismo nombre y su más reciente tema objetivo Full Full que está abanderando las listas más importantes. Canciones como Tan Natural, Te amo te amo, El más grande Amor, Loco, Cuando quieras quiera, Lo tienes Todo, Vestirte de amor, Full Full, por mencionar algunos harán parte de su gran repertorio esa noche del 4 de marzo en Bogotá.\r\n\r\nFelipe Peláez es un artista integral que canta, compone, produce, y dirige. A lo largo de sus más 20 años de carrera musical ha conquistado múltiples escenarios, alcanzando la fama y el reconocimiento internacional, que le han permitido obtener grandes premios, muestra de ello el Grammy al mejor álbum Cumbia Vallenato con su producción “DIFERENTE” en el 2013, y su reciente nominación al Grammy Latino 2016.','../eventimg/238259777una_noche_intima__con_felipe_pelaez.jpg','Teatro Jorge EliÃ©cer GaitÃ¡n',2,'BogotÃ¡','','','ARTE Y CULTURA PRODUCCIONES SAS ','http://vive.tuboleta.com/shows/show.aspx?sh=PIPEJE17',1,230,57,1,'PUB',2,'2017-01-25 21:30:29','','',0,0,'2017-1-25 21:20:10'),(501,1,'Â¿QuiÃ©res un amigo? Adopta un Perrito','Peluditos.org, una organización que le busca hogar a animales en Bogotá, llevará a cabo una jornada de adopción de perros el próximo sábado 4 de febrero.\r\n\r\nSi está buscando un amigo, sobre todo un perro pequeño para tenerlo en la ciudad, esta es tu oportunidad.\r\n\r\nDurante el evento encontrará más de 300 perros de tamaño pequeño.\r\n\r\nSi desea adoptar antes uno de estos animalitos, puede llamar a los teléfonos 316 3963909 0 319 6582488.\r\n\r\nEsta organización también entrega gatos en adopción, por si su interés es tener un felino.\r\n\r\nPor otro lado, si su interés es ayudar, también puede participar como voluntario.','../eventimg/356196385Perros-en-adopcion.jpg','Pet Gourmet Salitre - Crr 68D # 23-31 - Lc 5',2,'BogotÃ¡ ','','','','Para mayor informaciÃ³n puedes visitar la pÃ¡gina oficial de la OrganizaciÃ³n http://www.peluditos.org/',9,182,57,1,'PUB',2,'2017-01-26 17:07:00','','',0,0,'2017-1-25 22:03:08'),(502,1,'Entre Perros nos Entendemos con Alejandro RiaÃ±o ','Después del arrollador éxito de “Cada niño con su boleta”, arrancamos el 2017 con Alejandro Riaño y su nuevo show \"Entre Perros Nos Entendemos\" una novedosa, divertida y sorprendente puesta en escena.\r\n\r\nEsta vez echa al agua a los hombres, revelando las técnicas que utilizan para levantar, entre otras estrategias que le harán descubrir “el perro que lleva adentro”. Venga y ríase del suyo. ','../eventimg/1161404964alejandro RaiÃ±o.jpg','Teatro Nacional Fanny Mikey',2,'BogotÃ¡ ','','','FUNDACION TEATRO NACIONAL','    Edad mÃ­nima de ingreso 12 aÃ±os \r\n',2,177,57,1,'PUB',2,'2017-01-25 22:43:53','','',0,0,'2017-1-25 22:30:04'),(503,1,'Ana Gabriel - La Reina de la Balada y la Ranchera ','Prepárate Medellín para recibir este próximo 4 de Marzo en la Plaza de Toros la Macarena a la Reina de la balada y la ranchera Ana Gabriel y junto a ella el rey del despecho Darío Gómez , el tenor del vallenato Jean Carlos Centeno y la voz del sentimiento Hebert Vargas. \r\n\r\nEn los intermedio homenaje al divo de Juárez Juan Gabriel y Rocío Dúrcal. \r\n\r\nAna Gabriel ha recibido más de 13 premios Lo nuestro, Premios Billboard, Premios Grammy Latinos, discos de diamante, Discos de oro, Discos de platino, séxtuplo, quíntuplo y triple disco de platino, casete y triple CD de platino, casetes y doble CD disco platino, casetes de oro, galardón diamante, charolas de oro, plata, Premio Billboard a la artista del año en el 1994, Premio Billboard a la cantante del año 1998, Premio a la estrella Billboard en el 2002, Recibió el premio Lo nuestro a la Excelencia en el 2006, Recibió el premio a la artista más popular de Viña del Mar en el 2014 junto con las gaviotas de oro y plata y las antorchas, ha sido nominada numerosas ocasiones y estos son solo algunos, entre otros premios especiales por su trayectoria artística.\r\n','../eventimg/1062508785ana-gabriel.jpg','Plaza de Toros La Macarena',2,'MedellÃ­n ','','','http://vive.tuboleta.com/shows/show.aspx?sh=NAGAME17','    Edad mÃ­nima de ingreso 18 aÃ±os \r\n',1,242,57,1,'PUB',2,'2017-01-26 21:33:31','','',0,0,'2017-1-26 20:39:08'),(504,1,'Claudia de Colombia, La diva del amor ','<div>El jueves 16 de febrero el teatro Jorge Isaacs se vestirá de Amor para recibir en su escenario a una de las mejores voces de Latinoamérica.\r\nDesde siempre a existido una cantante que ha sorprendido a los televidentes del Club del Clan, (un programa muy famoso de la época) con su rostro angelical, pero con una voz tan poderosa que conquistó a hombres y mujeres detrás de la pantalla.\r\nEra Gladys Caldas, una adolescente de Manizales, quien llegó al programa con una maleta de ilusiones y sueños. La niña y su nombre pasaron al olvido, pues al poco tiempo, ella se convirtió en una hermosa mujer llamada Claudia de Colombia.\r\nLa artista transforma la letra de cada canción en un sentimiento; estas características son su sello personal y esencia como artista. Han pasado 40 años desde ese día, en que la tierna Claudia de Colombia dio paso a primera cantante internacional que tuvo el país, pero su belleza y talento siguen intactos, como si el tiempo no hubiera pasado, como sí sus canciones aún estuvieran en la radio. Regresa a Cali para deleitarnos con temas que la catapultaron como ‘Río Badillo ‘y ‘Cuando voy por la calle’. Y canciones nuevas pegajosas y llamativas (Mentiras blancas). Julio Sánchez Cristo bautizó la obra: ‘Toda una vida con Claudia de Colombia’ Fue la cantante más internacional que tuvimos en los años 70. Eran los tiempos en que la voz lo era casi todo. No habían llegado los videos y las pequeñas películas que hoy se montan alrededor de una sola canción.\r\n</div>','../eventimg/1169361146clao.gif','Teatro Jorge Isaacs, Cali',2,'CalÃ­ ','','','http://vive.tuboleta.com/shows/show.aspx?sh=CLAUDIAC16','Edad mÃ­nima de ingreso 18 aÃ±os\r\nLos precios de Preventa son hasta el dÃ­a 06 de Febrero de 2017, y precio full desde el dÃ­a 07 de Febrero de 2017.\r\n',1,192,57,1,'PUB',2,'2017-01-26 22:25:21','','',0,0,'2017-1-26 22:06:23'),(505,1,'El hombre reina y la mujer gobierna por Luz Estrada ','Protagonizada por Luz Estrada ganadora del Premio India Catalina 2016 como Mejor Actriz Antagónica por su papel como “Sonia Monsalve” en “Las Hermanitas Calle” y premiada en 2012 como Mejor Monólogo por el Instituto Distrital de las Artes de Bogotá, es una comedia que ha conquistado al público de Bogotá, Medellín, Barranquilla y Miami. \r\n\r\nEsta disparatada historia de la humanidad, es una particular y divertida reflexión acerca del poder que han tenido los mal medidos encantos femeninos desde el paraíso terrenal hasta nuestros días y nos demuestra que las mujeres, sin hacer mucho alboroto, han tomado algunas de las decisiones más importantes de nuestra historia.','../eventimg/2053790946LuzEstradaUno_Guru_2016.jpg','Teatro Sala Belartes',2,'BogotÃ¡ ','','','ARTES Y ESPECTACULOS PRODUCCIONES SAS','Eventos los dÃ­as Jueves y SÃ¡bados / Jueves 6:00 p.m. y SÃ¡bados 8:00 p.m. \r\n\r\nEdad mÃ­nima de ingreso 15 aÃ±os\r\n',2,169,57,1,'PUB',2,'2017-01-26 22:45:46','','',0,0,'2017-1-26 22:39:57'),(506,1,'IvÃ¡n MarÃ­n con Â¿Por quÃ© Carajos?â€','¿Por qué la gente le habla a las matas? ¿Por qué suele molestarse Dios? ¿Por qué las actrices porno no se quitan los tacones? ¿Por qué nunca atraparon a los Magníficos? las respuestas a estos y muchos otros interrogantes las verá en el show de Stand-up comedy “¿Por qué Carajos?”, un monólogo en el que Iván Marín presenta un detallado repertorio de sin sentidos, expone las profesiones y profesionales insufribles, esclarece enigmas que nadie más formula, analiza el placer hallado en el sufrimiento futbolístico y denuncia los peligros del cine nacional.','../eventimg/1888730049ivan-marin.jpg','Teatro Sala Belartes',2,'BogotÃ¡','','','ARTES Y ESPECTACULOS PRODUCCIONES SAS','    Edad mÃ­nima de ingreso 15 aÃ±os\r\n',2,156,57,1,'PUB',2,'2017-01-27 17:34:43','','',0,0,'2017-1-27 17:32:06'),(507,1,'Soy Luna - MedellÃ­n ','Soy Luna en Concierto, con el elenco encabezado por Karol Sevilla, ofrecerá una puesta en escena impactante y un gran despliegue musical con canciones originales de la serie. La música de Soy Luna es un éxito: sus dos álbumes, “Soy Luna” y “Música en Tí”, a la fecha llevan más de 29 millones de reproducciones en Spotify y 205 millones de reproducciones en VEVO.\r\n\r\nEste es el primer show en vivo de la exitosa serie de Disney Channel. Durante la emisión de su primera temporada, Soy Luna mostró una excelente performance liderando la audiencia en Latinoamérica. En Chile, la serie fue la opción más vista por los niños, en ese horario, entre todos los canales de TV (abierta y cable). Además, se ubicó en el #1 puesto entre todos los canales de cable.','../eventimg/928097550luna.jpg','Plaza de Toros La Macarena',2,'MedellÃ­n ','','','','El precio Preventa es vÃ¡lido hasta el 16 de Febrero o hasta agotar existencia',1,276,57,1,'PUB',2,'2017-01-28 15:30:46','','',0,0,'2017-1-28 15:29:11'),(508,1,'Mujeres a la Plancha ','Una noche para desarrugar el corazón, para levantarse la falda o ponerse el pantalón, un concierto con 4 grandes cantantes de nuestro país, que nos llevaran a un viaje de canciones, no solo para planchar, sino para llorar, reír y vivir una noche inolvidable.\r\n\r\nDirector: Juan Carlos Mazo\r\nELENCO ALTERNO: Majida Issa, Verónica Orozco, Diana Ángel, Laura Mayolo y Yolanda Rayo','../eventimg/1913006633nota-mujeres-a-la-plancha-copia.jpg','Teatro Nacional La Castellana',2,'BogotÃ¡','','','FUNDACION TEATRO NACIONAL ','    Edad mÃ­nima de ingreso 12 aÃ±os \r\n',1,181,57,1,'PUB',2,'2017-01-28 16:38:52','','',0,0,'2017-1-28 16:31:38'),(509,1,'Conferencia: Relaciones Laborales Sanas ','El Objetivo de la conferencia es fortalecer habilidades gerenciales y directivas como: Aspectos legales y reglamentarios con el personal, Comunicación sistémica en la organización, Credibilidad y toma de decisiones en equipo & Liderazgo y habilidades interpersonales. El mismo va dirigido a: Empleados de la organización que hacen parte de comités, Jefes de área, líderes de la empresa.\r\nHabilidades Adquiridas:Al finalizar el seminario-taller la persona estará en capacidad desarrollar herramientas que permitan mediar una convivencia armoniosa y saludable para los empleados de la organización enmarcado en la actual normatividad y las habilidades personales necesarias para un mejor ambiente laboral.','../eventimg/629363772Buenas-relaciones-laborales.jpg','Club El Nogal - Salon Santiago Carrera 7 # 79',2,'BogotÃ¡ ','','','https://www.eventbrite.es/e/entradas-conferencia-relaciones-','Este evento sera dirigido por: Yolima Amparo Restrepo.',6,209,57,1,'PUB',2,'2017-01-29 20:44:10','','',0,0,'2017-1-29 20:32:10'),(510,1,'El Nombre','&nbsp;El nombre nuevo integrante de la familia siempre se transforma&nbsp;en un tema de debate, no sólo por parte de los padres, también de los amigos y familiares que desean dar su opinión acerca de lo más conveniente para ese nuevo ser.&nbsp;Una pregunta tan simple como: ¿Qué nombre le pondrás a tu bebé? &nbsp;saca a relucir sentimientos que van desde la amistad y la complicidad hasta la hipocresía.&nbsp;<br>Después de agotar taquilla en países como Francia, España, Argentina, Chile y México llega a Colombia “EL NOMBRE” una puesta inteligente y fresca, cercana y directa.&nbsp;','../eventimg/1825866037elnombra.jpg','Teatro Nacional La Castellana',2,'BogotÃ¡ ','','',' FUNDACION TEATRO NACIONAL','Funciones de jueves a domingo \r\nLos dÃ­as Jueves y Viernes funciÃ³n a las 8:30 p.m.\r\nLos dÃ­as SÃ¡bado con funciÃ³n a las 6:00 p.m. y 8:30 p.m. \r\nLos Domingos a las 6:00 p.m. ',2,249,57,1,'PUB',2,'2017-01-29 23:07:47','','',0,0,'2017-1-29 22:01:19'),(511,1,'InFieles Porque ser Fiel esta de moda ','In-fieles no sólo es una comedia musical, es un viaje de emociones por un universo lleno de matices.\r\n Estas In-fieles ríen, lloran, cantan, bailan, pero lo más importante es que desnudan su alma, en medio de situaciones hilarantes, el público rie a carcajadas, así como tienen momentos de reflexión. Esta comedia musical ha marcado un cambio en las nuevas propuestas musicales de nuestro país ya que se destaca por ser un montaje atrevido, muy latino y sobre todo muy real. Con más de 250 funciones estas In-fieles siguen cautivando al público, así que en cualquier lugar donde estas artistas se presenten estamos seguros que los asistentes no sólo se divertirán, sino además agradecerán ver en escena a estas maravillosas y talentosas actrices','../eventimg/416227955Infieles1.jpg','Teatro Sala Belartes',2,'BogotÃ¡ ','','','ARTES Y ESPECTACULOS PRODUCCIONES SAS','Edad mÃ­nima de ingreso 18 aÃ±os\r\n',2,144,57,1,'PUB',2,'2017-01-29 22:53:48','','',0,0,'2017-1-29 22:44:31'),(512,1,'Korn','Korn regresa a Colombia en el 2017!!! \r\n\r\nPresentando su más reciente trabajo discográfico The Serenity of Suffering.\r\n\r\nLa banda estadounidense Korn, una de las bandas más importantes del rock llega a Colombia en el momento cumbre de su carrera. La cita con el poder de Korn será en la Carpa Corferias el 17 de abril, y Bogotá será testigo de una noche que estallará con característico sonido en vivo lleno de energía y poder. \r\n\r\nLa banda californiana visita Colombia en el marco de la gira de promoción de su más reciente lanzamiento de The serenity of suffering, su nuevo álbum, número 12 de su trayectoria y una muestra clara de la reinvención del rock pesado en toda su expresión. Hasta la fecha, Korn ha vendido más de 60 millones de álbumes en todo el mundo y han obtenido siete nominaciones a los premios Grammy, de los cuales han Ganado dos. \r\n\r\n\"Rotting In Vain\", primer sencillo promocional de esta nueva placa discográfica, alcanzó el cuarto puesto del ranking en las radios del formato Active Rock en Estados Unidos y mantiene la cuarta posición del ranking de Temas Rock de Billboard por 13 semanas consecutivas. \"Insane\" y \"A Different World\" (junto a Corey Taylor de Slipknot) fueron otras canciones que Korn había lanzado las últimas semanas para adelantar su regreso discográfico. \r\n\r\nEste álbum ubica a Korn en el mejor momento de su carrera y a sus miembros, Jonathan Davis (vocal), James “Munky” Shaffer (guitarra), Reginald “Fieldy” Arvizu (bajo), Brian “Head” Welch (guitarra) y Ray Luzier (batería) en una maquina emocional que libera toda su ira explorando su lado más oscuro y sus emociones más fuertes, transformándolas en canciones.','../eventimg/1283225725Korn_635_635_s_c1.jpg','Gran Carpa AmÃ©ricas - CORFERIAS',2,'BogotÃ¡ ','','','','    Edad mÃ­nima de ingreso 18 aÃ±os\r\n',1,318,57,1,'PUB',2,'2017-01-30 21:18:45','','',0,0,'2017-1-30 21:09:24'),(513,1,'Guaco ','Guaco no se detiene:\r\nva contigo con música, video, arte y cine\r\n\r\nEl pasado 30 de septiembre La Súper Banda de Venezuela presentó nueva canción, videoclip y un tráiler cinematográfico como un adelanto a lo que serán sus grandes producciones este 2017\r\n\r\nLa canción “Lágrimas no más” es el primer sencillo de “Bidimensional”, el nuevo álbum que Guaco tiene previsto lanzar al mercado en abril de 2017 conjuntamente con la película documental “Guaco: Semblanza”, de la cual se presenta el tráiler en exclusiva en las principales salas de cine de Venezuela.\r\n\r\nLágrimas no más; con letra y música del cantautor venezolano Cáceres, “Lágrimas no más” es una canción con contagioso ritmo urbano que puede ser escuchada y descargada en la página web promocionespepsi.com totalmente gratis.\r\n\r\nBidimensional\r\n\r\nLa nueva producción discográfica de Guaco, que será lanzada en abril de 2017, contará con la distribución de Pepsi y Cinex en Venezuela y de Sony Music Latin a nivel internacional. Será un álbum que tendrá dos dimensiones musicales: la mitad de los temas serán grandes éxitos grabados en formato sinfónico junto a una gran orquesta dirigida por Gustavo Dudamel y la otra mitad contendrá canciones inéditas interpretadas sólo por La Súper Banda de Venezuela.\r\n\r\nLa portada de Bidimensional será una obra de arte original del maestro Carlos Cruz-Diez, realizada especialmente tanto para la edición regular como para la edición limitada de colección que estarán disponibles para el público en general al mismo tiempo que la edición digital del álbum. El nuevo logo y cromática que identifica a Guaco durante esta temporada también han sido diseñados exclusivamente por Cruz-Diez.','../eventimg/822374713Guaco.jpg','4.40 Music Hall',2,'BogotÃ¡ ','','','','Edad mÃ­nima de ingreso 18 aÃ±os\r\n',1,314,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=nH93oVLXKjk',0,0,'2017-1-30 21:37:54'),(514,1,'Melendi - Quitate las gafas ','El 2017 inicio con el nuevo disco del cantante español Melendi Quítate las gafas, y con el anuncio de su gira en América con paradas en Estados Unidos, Ecuador, Panamá, México, Colombia, Chile y otras por confirmar. \r\n\r\nLa actuación de Melendi tendrá lugar el 30 de marzo en el Teatro Royal Center de la ciudad de Bogotá. \r\n\r\nMelendi, es actualmente una de las figuras más importantes del panorama musical de los últimos años, y uno de los artistas más queridos y admirados de habla hispana y visita nuestro país iniciando una imparable etapa musical y en el mejor momento de su carrera con el lanzamiento de: Quítate las gafas. Este es el octavo trabajo discográfico del artista español, producido en su totalidad por él mismo y compuesto por once temas con una faceta y composición más dulce, este disco incorpora ritmos latinos en algunas de sus canciones y denota una clara madurez musical e interpretativa que ha tenido una gran acogida entre su público, siendo “Quitate las Gafas” el disco más vendido de las pasadas navidades en España. \r\n\r\nMelendi se abre a nuevas sonoridades, con un disco que reivindica como motor de cambio el conocimiento, además, presenta la primera colaboración de su carrera con, \"Mi mayor fortuna\", junto al grupo colombiano ChocQuibTown.\r\nMelendi transmite sentimientos y situaciones cotidianas, entre personas de todas las generaciones, logrando con ello una extraordinaria conexión con su público. ','../eventimg/1369271976Melendi.jpg','Royal Center',2,'BogotÃ¡','','','PRISA MÃšSICA AMÃ‰RICA S.A.S','Edad mÃ­nima de ingreso 14 aÃ±os',1,201,57,1,'PUB',2,'2017-01-30 22:13:31','','',0,0,'2017-1-30 22:13:02'),(515,1,'Concierto Carnaval Puerta de Oro ','Para celebrar el carnaval con los grandes\r\n- Carlos Vives\r\n- Silvestre Dangond\r\n- Nicky Jam','../eventimg/1105680385carlosvives.png','Centro de Convenciones Puerta de Oro',2,'Barranquilla','','','ELEVA GROUP S.A.S','Edad mÃ­nima de ingreso 18 aÃ±os\r\n',1,196,57,1,'PUB',2,'2017-01-31 23:40:41','','',0,0,'2017-1-31 23:34:11'),(516,1,'La fÃ¡brica de la felicidad ','Fábrica de la felicidad es un programa de liderazgo para integrar cuerpo, mente y emoción en cada actividad que realices. Es un seminario vivencial, con técnicas de alto impacto donde eres tú el protagonista\r\n\r\nTe llevamos a despertar, reencontrar y conectar nuevamente con todo el poder que llevas dentro. Pondrás a prueba las creencias limitantes que hasta ahora no han permitido que consigas los resultados que quieres para tu vida\r\n\r\nCaminaras sobre brasa y también sobre vidrio entre otras más actividades donde experimentaras que TODO LO QUE NECESITAS ESTA DENTRO DE TI.\r\n Contará con Conferencistas Internacionales y Nacionales\r\nConferenciante Internacional\r\n•	Juan Paulo Pinochet A. \r\nPresidente ejecutivo H3 Coaching\r\nCoach Life\r\n\r\nConferenciantes nacionales\r\n•	Alejandro Ortiz\r\n•	David Mariño\r\n•	Jurani Bautista\r\n•	Katherine Herrera\r\n•	Paula Idarraga\r\n•	Tatiana Macias\r\n•	Wilson Vásquez\r\n\r\n\r\nES TU TIEMPO, ES TU MOMENTO DE IR POR RESULTADOS EXTRAORDINARIOS. ES AHORA\r\n','../eventimg/553556879la fabrica de la felicidad.jpg','Centro Social de Agentes y Patrulleros',2,'BogotÃ¡ ','','','ESCUELA REINGENIERIA VIDA S.A.S','Seminario Incluye: \r\n\r\nâ€¢	Material de apoyo\r\nâ€¢	Zona de hidrataciÃ³n\r\nâ€¢	Almuerzo',6,176,57,1,'PUB',2,'2017-01-31 23:58:23','','',0,0,'2017-1-31 23:57:52'),(517,1,'Dos mujeres sin camino ','La primera con su dulzura, su carisma y su característica sonrisa nos presentara su Stand Comedy <b>NO NACÍ PARA SUFRIR,</b> en donde sin rodeos ni tapujos<b> Yaneth Waldman</b> se atreve a decir las mentiras y las verdades que cualquier otra mujer escondería.\r\n\r\nUn monólogo con muchas voces. Entre risa y llanto una profunda y conmovedora confesión. “NO NACÍ PARA SUFRIR...” la prueba perfecta de que en la vida se sufre tanto como se goza.\r\n\r\nLas carcajadas estarán aseguradas con la mujer de la risa más conocida del país.\r\n\r\nTómelo como un manual para descubrir a un esposo infiel, o como una guía imperfecta para lidiar con los hijos adolescentes.\r\nQuizá sea la clave para sobreponerse a los malos negocios del (ex)marido, o simplemente el curso para tolerar el mal gusto de la amante<br>La segunda con su humor negro los espectadores podrán disfrutar de un espectáculo de la cruda y divertida realidad con<b> Alejandra Azcarate&nbsp;</b>.\r\nLos celos, la constante búsqueda de pareja, las frustraciones, el matrimonio, los ex, la luna de miel, las suegras, la convivencia el sexo y la infidelidad, son algunos de los temas que Alejandra toca desde una perspectiva femenina más no feminista, ya polémica, controvertida, rápida, divertida y franca como su protagonista son las características centrales de este show.','../eventimg/1169331356dosmujeres.jpg','Auditorio las Bethlemitas',2,'BogotÃ¡','','','CORPORACION ARTISTICA EN ESCENA http://vive.tuboleta.com/sho','Edad mÃ­nima de ingreso 14 aÃ±os \r\n',2,154,57,1,'PUB',2,'2017-02-01 12:35:56','','',0,0,'2017-2-1 12:30:54'),(518,1,'16Â° Cumbre Mundial de Premios Nobel de Paz BogotÃ¡ 2017','La Cumbre Mundial de Premios Nobel de Paz es reconocida internacionalmente como el evento anual más importante en el campo de construcción de la paz, reuniendo laureados del Premio Nobel de Paz, líderes de alto perfil, organizaciones, estudiantes y docentes universitarios de todo el mundo desde 1999. \r\nEn los últimos 14 años, las Cumbres Mundiales de Premios Nobel de Paz han sido honradas con la participación de numerosos galardonados con el Premio Nobel de Paz y organizaciones de Premios Nobel de Paz, incluyendo a: Mijaíl Gorbachov, Su Santidad el Dalái Lama, Shimon Peres, Óscar Arias Sánchez, Lech Wałęsa, Jimmy Carter, José Ramos-Horta, Dr. Shirin Ebadi, Lord David Trimble, John Hume, Kim Dae Yung y otros líderes mundiales reconocidos.\r\n\r\nLa Cumbre tiene lugar anualmente en diferentes ciudades en todo el mundo en cooperación con las ciudades participantes y el apoyo de varias fundaciones y organizaciones de Premios Nobel de Paz.\r\n\r\nLa Cumbre es la conversación y la plataforma más importante del mundo en el campo de la construcción de paz, la reconciliación y su relación con el desarrollo. La Cumbre se ha realizado desde 1999 en ciudades emblemáticas para la paz mundial (París: Declaración de Derechos Humanos; Berlín: Reunificación Alemana; Hiroshima: Desarme Nuclear; entre otras). En esta oportunidad, Bogotá fue elegida y será la sede mundial de este importante diálogo universal.\r\n\r\nLa elección de Bogotá como ciudad sede es producto del liderazgo de la Cámara de Comercio de Bogotá, en representación del empresariado de la ciudad y la región y es también una manifestación de la sociedad civil, que busca avanzar en la reflexión sobre los retos de la construcción de paz y plantear escenarios de acción desde el sector privado a largo plazo.\r\n\r\nDurante la Cumbre, esperamos la visita de cerca de 20 laureados con el Premio Nobel de Paz y varios líderes mundiales, de los cuales aprenderemos e intercambiaremos experiencias sobre la construcción de paz y la reconciliación. Adicionalmente, luego de la Cumbre, Bogotá será declarada Ciudad de la Paz y pondremos en marcha proyectos e iniciativas que los laureados y sus organizaciones acompañarán y asesorarán. \r\n\r\nEn el marco de la Cumbre, entregaremos dos reconocimientos a figuras mundiales que hayan aportado a la construcción de paz. En cumbres anteriores, han recibido estos reconocimientos personajes como, Bernardo Bertolucci, George Clooney, Bob Geldoff, Bono, Sean Penn, entre otros.','../eventimg/1136445913nobelpaz.png','Corferias',2,'BogotÃ¡ ','','','http://www.bogota-nobelpeacesummit.com/index.php/es/','Para el ingreso estarÃ¡n habilitadas: la entrada de la Avenida La Esperanza con carrera 40 y la entrada principal de Corferias Carrera 37 nro. 24-67.\r\n- Pueden ingresar Ãºnicamente las personas que se registraron previamente, presentando el documento de identidad para validar el registro. \r\n- No se admitirÃ¡ el ingreso de menores de 14 aÃ±os de edad.\r\n',6,137,57,1,'PUB',2,'2017-02-01 21:34:12','','https://www.youtube.com/watch?v=OCFPdeRjRYk',0,0,'2017-2-1 21:13:41'),(519,1,'INSPIRA Un festival diferente ','Tomate un tiempo para respirar con lo mejor de la Música nacional.  El festival Inspira es un evento anual en el que se llevaran a cabo varias actividades y habrán muchas sorpresas.\r\nEste año disfrutaras de lo mejor de: Mike Bahia, Alkilados, Martina la Peligrosa y Sebastian Yatra.\r\nUn espectáculo para todas las edades. !No te lo puedes perder!.','../eventimg/1718480903468-festiyatra.jpg',' Chamarro Entertainment City Hall',2,'BogotÃ¡ ','','','Leonardo Andres Zambrano Endara EU','Edad mÃ­nima 8 aÃ±os ',4,246,57,1,'PUB',2,'2017-02-11 12:07:34','','',0,0,'2017-2-1 22:34:57'),(520,1,'Festival de la Cerveza de Baranoa 2017','<div>Vuelve el Festival de la Cerveza de Baranoa con todo su Show y comodidad incomparable.&nbsp;</div><div>En esta oportunidad te presentamos artistas de primer nivel que querrás estar presente en este show sin igual. Ven, disfrutalo y vive un Carnaval totalmente diferente en la sede de la Banda de Baranoa.&nbsp;</div><div>Para esta oportunidad te presentamos a: Silvestre Dangond - Jowell y Randy - Guayacan - Poncho Zuleta - Martin Elías - Mr. Black - Fusion Orquesta</div>','../eventimg/977365073baranoa.jpg','Sede de la Banda Departamental de Baranoa',2,'Baranoa, Barranquilla','','','FUNDACION BANDA DE MUSICA DEPARTAMENTAL ATLANTICO','    SEDE DE LA BANDA DEPARTAMENTAL DE BARANOA \r\nKM 2 CARRETERA DE LA CORDIALIDAD ',4,781,57,1,'PUB',2,'2017-02-03 13:53:08','','',0,0,'2017-2-2 18:00:20'),(521,530,'prueba','desc prueba','../eventimg/1832877116563208-xlarge-Hombre-con-audifonos-y-microfono2.jpg','dir prueba',2,'bogota','','','','    ',6,58,57,1,'PUB',1,'2017-02-02 21:00:27','','',0,0,'2017-2-2 20:45:44'),(522,1,'Engendros ','Dos historias paralelas que finalmente se encuentran, tienen lugar en dos apartamentos vecinos. Uno de ellos lo ocupa Felipe, quien vive de las mujeres y el otro Simón, quien vive para una sola. Tatiana, la esposa de Simón, se debate en el engañoso torbellino del feminismo; María Paula y María José, dos de las queridas de Felipe, en el papel de las desamadas de un don juan. La eterna batalla de poder entre los géneros o mejor, en toda relación de pareja, teje el hilo de esta historia, pero solo el final permitirá ver si alguien tenía la razón. ¿Los hombres podrían dejar de ser tan machos y las mujeres tan hembras para convertirse en seres humanos?... ¿Es antinatural que un hombre este enamorado de su esposa?... Interrogantes como estos, son los que Engendros pretende develar.\r\n\r\nTIPS\r\n¿Si no es el amor, qué carajos es lo que mantiene unidas a las parejas?\r\n¿Una computadora puede resultar más humana que los humanos?\r\n¿Realmente es posible mantener eternamente engañada a la pareja?\r\n¿Qué demonios hace un heterosexual en la Marcha Gay?','../eventimg/1450073129engendros-1200x600.jpg','Auditorio ABC - Calle  104 #17-20',2,'BogotÃ¡ ','','','GRUPO ALTAVISTA INC','    Edad mÃ­nima de ingreso 14 aÃ±os \r\n',2,261,57,1,'PUB',2,'2017-02-02 20:53:17','','',0,0,'2017-2-2 20:52:28'),(523,1,'Silvestre Dangond - BogotÃ¡','Silvestre Dangond llega a Bogotá con su Gente Valiente World Tour.','../eventimg/1824727010silvestre_dangond.jpg','Centro de Eventos Autopista Norte',2,'BogotÃ¡ ','','','Stage S.A.S','Edad MÃ­nima: 18 AÃ±os\r\nPreventa hasta el 4 de Marzo\r\n',1,338,57,1,'PUB',2,'2017-02-09 00:09:34','','',0,0,'2017-2-2 21:49:04'),(524,1,'MORAT EN SAN VALENTIN','Andan diciendo por la calle que este San Valentín todos los enamorados de Morat podrán cantar junto a ellos y algunos invitados todas esas canciones que les llegan al alma.\r\n\r\nNo queremos que ningún enamorado sin importar su edad se pierda esta ocasión tan especial, por eso mismo contaremos con dos presentaciones.','../eventimg/1446496493morat.jpg','Centro Cultural Gimnasio Moderno',2,'BogotÃ¡ ','','','MELIPA SAS - SERGIO RODRIGUEZ','    Edad mÃ­nima de ingreso 14 aÃ±os \r\n',1,147,57,1,'PUB',2,'2017-02-02 23:06:07','','',0,0,'2017-2-2 23:03:01'),(525,1,'Soy Luna - Concierto Barranquilla','<b>Soy Luna</b> en Concierto, con el elenco encabezado por Karol Sevilla, ofrecerá una puesta en escena impactante y un gran despliegue musical con canciones originales de la serie. <br><br>La música de Soy Luna es un éxito: sus dos álbumes,<b> “Soy Luna”</b> y <b>“Música en Tí”,</b> a la fecha llevan más de 29 millones de reproducciones en Spotify y 205 millones de reproducciones en VEVO.\r\n<br><br>Este es el primer show en vivo de la exitosa serie de Disney Channel. Durante la emisión de su primera temporada, Soy Luna mostró una excelente performance liderando la audiencia en Latinoamérica.&nbsp;','../eventimg/831159173Soy-luna-en-concierto-1.jpg','Colegio San JosÃ© - Cra. 21 #47D ',2,'Barraquilla ','','','A&R Entertainment','Preventa 1, hasta el 23 de Febrero (P1)\r\nPreventa 2, hasta el 24 de Marzo  (P2)\r\n',1,369,57,1,'PUB',2,'2017-02-03 21:54:34','','',0,0,'2017-2-3 21:47:37'),(526,1,'El Concierto del Aire por AndrÃ©s LÃ³pez ','Llega a Bogotá una puesta totalmente diferente y nunca antes vista,<b> “El Concierto del Aire”,</b> una obra llena de historias, con el director Andrés Cristancho y El comediante Andrés López.<br><br>El teatro ABC del Colegio el Buen Consejo abrirá sus puertas a partir del 26 de marzo a este magnífico espectáculo, donde toda la familia podrá disfrutar y aprender del increíble mundo de la música clásica. \r\n\r\nVive un concierto donde oirás los valses más hermosos, las marchas más intensas, la historia de la música dedicada a los sueños, sonidos comunes que nos traen como recuerdo esos pequeños globos que flotan por ahí a quienes solemos poner el nombre de recuerdos, momentos gloriosos de la música. Bach, Copland, Albéniz, Falla, Zimmer, Williams, Rosas, Cristancho, Calvo, Jobim, Sibelius, en fin, desde Colombia, México, Austria, Finlandia, EE.UU, Rusia, Brasil, Japón. Un concierto lleno de sorpresas como esas que explotan y llenan, de nuevo, el aire con confetti.','../eventimg/2029511703andres lopez.jpg','Teatro ABC',2,'BogotÃ¡ ','','',' IDEALO PEZ S.A.S','Edad mÃ­nima 3 aÃ±os ',2,198,57,1,'PUB',2,'2017-02-03 22:33:28','','',0,0,'2017-2-3 22:28:45'),(527,1,'Babasonicos ','Son emblemáticos, son alternos, son rockeros, son Babasónicos.<br><br>Los padres del “Rock Sónico”, los compositores del “Dopadromo” y el “Jessico”, los jóvenes no tan jóvenes vuelven a Colombia. Una vez más el país se presta para que Babasónicos continúe su interminable carrera y afine un sonido que por más de dos décadas ha sabido constituirse como un pilar del rock en español. El 14 de marzo los argentinos se presentarán en Armando Music Hall en un show mezcla de glamour y clase.<br><br>Ya a inicios de los 90 Babasónicos se enfrentaba a una aventura que los llevaría por mares de géneros y sonidos nunca antes explorados.<br><br>Bogotá y los Babasónicos son viejos conocidos, pues la capital de Colombia ha servido como plaza de coqueteo y descubrimiento para los músicos argentinos. Numerosas presentaciones han generado un romance entre sus fieles seguidores y los prodigiosos artistas. Vuelven una vez más cargados de clase y experiencia, pero siempre con esa juventud que los caracteriza, &nbsp;en lo que será una noche nostálgica y memorable.','../eventimg/1382531690babasonicos_1170x450.jpg','Armando Music Hall',2,'BogotÃ¡ ','','','SUEÃ‘O ESTEREO S.A.S.','    Edad mÃ­nima de ingreso 18 aÃ±os\r\n',1,199,57,1,'PUB',2,'2017-02-03 23:04:59','','',0,0,'2017-2-3 22:50:05'),(528,1,'Silvestre Dangond ','Gente Valiente World Tour de Silvestre llega a Cúcuta','../eventimg/277567538silve.jpg','Plaza De Banderas',2,'CÃºcuta ','','','D&G Eventos S.A.S.','Edad MÃ­nima: 18 AÃ±os\r\n\r\nPreventa 1 (PV1) hasta el 04 de Marzo\r\nPreventa 2 (PV2) hasta el 06 de Mayo\r\nPreventa 3 (PV3) hasta el 20 de Mayo\r\n\r\n',1,322,57,1,'PUB',2,'2017-02-05 19:55:59','','',0,0,'2017-2-5 19:23:26'),(529,1,'La historia ilustrada del sexo ','Tras su arrollador éxito a nivel nacional, el teatro ASTOR PLAZA se complace en ofrecer dos únicas funciones especiales de esta divertidísima comedia que catapultó a la querida Flavia Dos Santos como actríz de teatro al lado del talentoso Fernando Solórzano. <br><br>La reconocida sexóloga brasilera y “El flaco” nos hacen un repaso por la sexualidad de nuestros antepasados hasta la modernidad. ¿El propósito? contarnos la historia de la humanidad en un solo acto: el acto sexual. <br><br>&nbsp;Acompañados de dos bailarines y un elenco que abarca desde el pitecántropos erectus, pasando por los filósofos griegos, hasta el hombre moderno, nos cuentan LA HISTORIA ILUSTRADA DEL SEXO y nos enseñan cómo cada logro y cada avance alcanzados por el hombre de cualquier época, han tenido como motor y punto de partida: las posiciones sexuales. \r\n\r\nLA HISTORIA ILUSTRADA DEL SEXO nos hará entender en una hora y veinte minutos por qué, desde el principio de los tiempos, el sexo ha sido el poder detrás, delante, encima y debajo del trono. \r\n\r\nPrepárate para conocer información que de manera muy divertida, podrá contribuir a mejorar tu vida en pareja.','../eventimg/1450542091La-historia-ilustrada-del-sexo.jpg','Teatro Astor Plaza',2,'BogotÃ¡','','','Astot Plaza Sala de Eventos LTDA ','Edad mÃ­nima de ingreso 16 aÃ±os\r\n',2,149,57,1,'PUB',2,'2017-02-05 20:19:55','','',0,0,'2017-2-5 20:09:38'),(530,1,'Carnaval de Verdad ','¡PORQUE ANGLO ES ANGLO!\r\n<br><br>&nbsp;La gran fiesta en Barranquilla se vive éste año con<b> El Carnaval de Verdad</b>, evento que contará con la espectacular presentación del puertorriqueño <b>ANDY MONTAÑEZ</b>, ex-vocalista del gran combo de Puerto Rico con todos sus exitos y en mano a mano los dominicanos <b>SERGIO VARGAS y BONNY CEPEDA</b> con éxitos como \"Cuarto de hotel\", \"Asesina\", \"Por ella\", \"La ventanita\", \"La quiero a morir\", entre otras.<br><br>Por Colombia el vallenato de Los Betos con sus exitos \"Gitana\" y  \"La dama del ajedrez\" y finalmente por la Republica Independiente de Barranquilla el Principe Del Carnaval <b>CHECO ACOSTA</b>.\r\n \r\nEl club Anglo estará preparado con sillas, mesas, parqueadero, vigilancia privada, pista de baile y precios de locura.','../eventimg/1852827356anglo.jpg','Club Anglo - Calle 81 con Carrera 38 ',2,'Barranquilla','','','H & H Eventos SAS','Edad Minima 18 aÃ±os\r\n*La localidad VIP cuenta con sillas y mesas NO NUMERADAS*\r\n',1,171,57,1,'PUB',2,'2017-02-05 21:20:10','','',0,0,'2017-2-5 21:12:33'),(531,1,'Lego Fun Fest','Cerca de un millón de ladrillos de <b>LEGO</b> aterrizarán en Bogotá en 2017, ofreciendo una experiencia interactiva para toda la familia con juegos, espectáculos y actividades de lujo.Los asistentes encontrarán dos piscinas de LEGO, aéreas de la marca como \"<b>LEGO City</b>\" y \"<b>LEGO Friends\"</b>.Asimismo, y como si fuese el sueño de cualquier colombiano en su infancia, LEGO recreará a escala gigante el mapa del país. \"Un evento que invita a crear, diseñar y entretenerse\", señaló Viviana Gómez, jefe del proyecto.<br><br>El<b> \"LEGO Fun Fest\" </b>es un espacio de entretenimiento para chicos y grandes. Todos los fans de este juego creativo, que consiste en construir con bloques todo tipo de objetos, podrán participar en diferentes zonas de construcción guiadas.Estas estarán disponibles para todas las edades y los asistentes se divertirán con las múltiples competencias que ponen a prueba la creatividad y la destreza.Asimismo, tomarse fotografías con sus personajes favoritos hechos con fichas de este legendario juguete.','../eventimg/621875915Lego-fun-festjpg_0.jpg','Corferias',2,'Bogota','','','','* Lunes a viernes de 8:00 a.m. a 7:00 p.m.\r\n\r\n* SÃ¡bados y domingos de 8:00 a.m. a 1:00 p.m. y de 2:30 p.m. a 7:30 p.m\r\n\r\n* Entradas del evento en Taquillas de Corferias',5,214,57,1,'PUB',2,'2017-02-06 21:14:55','','',0,0,'2017-2-6 20:19:23'),(532,1,'Ana Gabriel - Recopilando Amor - BogotÃ¡ ','Llega a Bogotá la Reina de la Ranchera y la Balada<b> Ana Gabriel&nbsp;</b>con su Tour Recopilando amor - Noche de Gala&nbsp;','../eventimg/10873840ana8a.jpg','Centro de Eventos Autopista Norte',2,'BogotÃ¡','','','Eventos Colombia CL','    Edad MÃ­nima: 18 AÃ±os\r\n',1,297,57,1,'PUB',2,'2017-02-06 20:50:09','','https://www.youtube.com/watch?v=js8X0IeJGEY',0,0,'2017-2-6 20:28:55'),(533,1,'Seminario Reforma Tributaria Estructural ','<b>Justificación</b>: Sancionada con fecha 29 de diciembre de 2016, la ley 1819 contiene la denominada Reforma Tributaria Estructural, cuarta reforma tributaria del actual Gobierno Nacional. La nueva ley ha traído cambios sustanciales en los impuestos nacionales, que van desde modificaciones en el hecho generador de los impuestos, pasando por crear nuevos regímenes tributarios, ampliar el Estatuto Tributario con nuevos libros y penalizar la evasión.\r\n\r\n<br><b><br>Objetivo General: </b>Conocer y estudiar los cambios en los sistemas impositivos y en el tratamiento fiscal a los contribuyentes contenidos en la Reforma Tributaria Estructural, brindando al asistente un panorama claro sobre el nuevo tratamiento fiscal e impositivo.\r\n\r\n<br><br><b>Metodología: </b>Con el fin de que el asistente comprenda y entienda el contenido del seminario, se realizará la presentación teórica de cada uno de los temas, ejemplos y análisis de casos prácticos.<br><br><b>Dirigido a: </b>Empresarios, Gerentes, Directores financieros, Contadores Públicos, Revisores Fiscales, Abogados, Economistas, Especialistas en Tributación, Funcionarios Públicos, Asesores Tributarios y en general a todas las personas comprometidas con el tema de la tributación e impuestos','../eventimg/1728424438seminario.jpg','Hotel Double Tree By Hilton',2,'BogotÃ¡ ','','','BCP COLOMBIA	','INCLUYE:\r\n- Refrigerio\r\n- Almuerzo\r\n- Material de apoyo\r\n- Certificado de asistencia\r\n- Copia de las presentaciones',6,134,57,1,'PUB',2,'2017-02-06 21:48:08','','',0,0,'2017-2-6 21:44:04'),(534,1,'Fito PaÃ©z - Solo Piano ','Fito Páez uno de los más grandes músicos latinoamericanos de todos los tiempos, regresa a Bogotá con su concierto “Solo Piano”, después de casi cuatro años de no ofrecer este recital en formato íntimo y personal, con el que el cantautor lleva en un emotivo viaje de canciones y grandes éxitos, a todos los espectadores.<br><br>&nbsp;El autor de \"Mariposa Tecknicolor\", entre muchas otras, actuará solamente acompañado de su piano en el escenario del Teatro Jorge Eliécer Gaitán de Bogotá los días 11 y 13 de marzo, a partir de las 8 de la noche, en una velada con la que espera eclipsar a sus fanáticos, una vez más.\r\n<br><br>Fito Páez realiza desde hace algunos años, una gira de conciertos “Solo piano”, con gran reconocimiento por parte del público y la crítica nacional e internacional.\r\nEsta gira lo ha llevado a ciudades como Santiago de Chile, Río de Janeiro y Porto Alegre Brasil, Madrid, Israel, Londres, Miami, Bogotá y Medellín en Colombia y DF México, entre otras plazas, que han tenido el privilegio de deleitarse con sus grandes clásicos en este formato tan íntimo.','../eventimg/832111010fito paez.jpg','Teatro Jorge EliÃ©cer GaitÃ¡n',2,'BogotÃ¡ ','','','ARTE Y CULTURA PRODUCCIONES SAS ','    ',1,161,57,1,'PUB',2,'2017-02-07 21:14:11','','',0,0,'2017-2-7 21:12:05'),(535,1,'Toc Toc, una comedia obsesiva y compulsiva','Seis personajes coinciden en la sala de espera de un afamado especialista. Todos sufren diferentes tipos de Trastornos Obsesivos Compulsivos, la ansiedad los traiciona provocando miedo, nerviosismo, inquietud y comportamientos repetitivos… El enredo se suscita cuando el reconocido médico jamás se presenta y acaben siendo ellos mismos quienes saquen sus propias conclusiones.','../eventimg/1624690863toc-toc-teatro-libre-chapinero-bogota-2016-facebook.jpg','Teatro Libre de Chapinero',2,'BogotÃ¡','','','FUNDACIÃ“N TEATRO LIBRE DE BOGOTÃ','    Edad mÃ­nima de ingreso 12 aÃ±os\r\n',2,180,57,1,'PUB',2,'2017-02-07 22:15:15','','',0,0,'2017-2-7 22:10:38'),(536,1,'La Dama de Negro ','La experiencia teatral de terror más importante del mundo llega a Casa E<br><br>&nbsp;Arthur Kipps, un hombre de mediana edad, atormentado por escabrosas experiencias vividas años atrás en un pueblo de Londres tiene la necesidad de contarle a su familia y amigos los recuerdos que le atormentan. Para ello se junta con un joven actor, Jhon Morris, con quien recreará los sucesos que había callado durante muchos años.\r\n\r\nUna puesta en escena con 23 años de representaciones seguidas en México e Inglaterra.<br><br><b>&nbsp;¿Vas a venir ... o tienes miedo?\r\n</b><br><br>Con la actuación especial de:<br>- Robinson Díaz (Colombia) y Rafael Perrín (México)\r\n<br>- Dirección: Rafael Perrín','../eventimg/984005487damadenegro.jpg','Casa E, sala ArlequÃ­n',2,'BogotÃ¡','','','CORPORACION CASA ENSAMBLE','Edad mÃ­nima de ingreso 14 aÃ±os\r\n - Funciones:\r\nViernes 8:00 p.m.\r\nSÃ¡bados 5:0 0p.m. y 8:00 p.m. -\r\nDomingo 6:00 p.m.\r\n\r\nDescuento de 30% hasta el 03 de Marzo de 2017',2,214,57,1,'PUB',2,'2017-02-07 22:42:35','','',0,0,'2017-2-7 22:39:19'),(537,1,'Trapitos al Sol 25 aÃ±os de MÃ¡rtir-monio','El Águila Descalza inicia el 2017 celebrando los 25 años de la obra Trapitos al sol, comedia que se estrenó en el año de 1992, registrando desde entonces una multitudinaria acogida por parte del público que ve en los personajes de César Guerra y Marina de Guerra un retrato del matrimonio tradicional, atormentado por las tragedias cotidianas de la convivencia.&nbsp;<br><br>Los celos, la infidelidad, la rutina, las mutuas cantaletas, el machismo, la sumisión y otros matices de la vida en pareja, salen al escenario en esta comedia que identifica al público que se divierte mientras reflexiona.<br><br>Trapitos al sol fue nominada en el año de 1993 a los premios de la Asociación de Críticos de Arte de Miami en las categorías de \"mejor obra\", mejor director\", \"mejor actriz\" y \"mejor actor\".','../eventimg/2071299463trapitos.jpg','Teatro Metropolitano',2,'MedellÃ­n ','','','CORPORACIÃ“N ÃGUILA DESCALZA','Edad mÃ­nima de ingreso 12 aÃ±os \r\n',2,159,57,1,'PUB',2,'2017-02-09 00:01:59','','',0,0,'2017-2-8 23:33:36'),(538,1,'Silvestre Dangond - Bucaramanga ','Gente Valiente World Tour de Silvestre llega tambien a Bucaramanga ','../eventimg/694281889silvestre_dangond 1.jpg','Plaza De Toros SeÃ±or De Los Milagros',2,'Bucaramanga','','','Stage S.A.S','Edad MÃ­nima: 18 AÃ±os\r\nPreventa hasta el 4 de Marzo',1,293,57,1,'PUB',2,'2017-02-09 00:24:55','','',0,0,'2017-2-9 00:23:46'),(539,1,'TÃ©cnicas para Amar ','¿Cómo salvar su matrimonio y no morir en el intento?<br><br>Quién no ha tenido diferencias con su pareja, quien no ha estado a punto de decir no más…. todos!!! Y de esto habla esta gran comedia en donde dos parejas totalmente distintas se prestan para retratar de manera divertida estas situaciones. Dora (María Helena Doering) y Jorge (Juan Pablo Gamboa) están al borde de acabar con su matrimonio pero gracias a sus amigos Leo (Julio Pachón) y Susana (Adriana campos) y a los divertidos tips, ellos reconsideran la situación y deciden aplicar esos consejitos que terminan convirtiéndose en divertidas herramientas de seducción. Técnicas para Amar no es solo una maravillosa comedia, es un gracioso retrato sobre las parejas que se dejan arrastrar por la rutina pero que deciden apostarlo todo por su relación, no se pierdas esta maravillosa oportunidad de aprender alguna de estas “técnicas”','../eventimg/2032584179tecnicas-para-amar-2.jpg','Teatro Sala Belartes',2,'BogotÃ¡ ','','','ARTES Y ESPECTACULOS PRODUCCIONES SAS ','    Edad mÃ­nima de ingreso 18 aÃ±os\r\n',2,182,57,1,'PUB',2,'2017-02-09 00:44:47','','',0,0,'2017-2-9 00:42:24'),(540,1,'Â¡Que desgracia tan infinita!','<b>¡QUE DESGRACIA TAN INFINITA!<br><br></b>&nbsp;A partir de los cuarenta solo queda morirse… de la risa, &nbsp; Qué desgracia tan infinita, una obra para reírnos de nosotros mismos.<br><br>Los cuarenta años son un punto de quiebre en la vida de cualquier ser humano. A los cincuenta, viene el quiebre completo. Ese es el tema central del monólogo de humor <b>Qué desgracia tan infinita</b>, escrita y dirigida por Diego Trujillo, y en donde el comediante es quien le cuenta a los espectadores sus experiencias con la mediana edad. <br><br>&nbsp;La verdad es que todos estamos expuestos a esa dictadura de la edad. A los veinte años nos reímos de ese tío o de ese amigo que ha comenzado a comprar tratamientos contra la calvicie. A los 30, puede que aparezca esa primera cana que da el campanazo de alerta. Todo se puede manejar con relativa calma, hasta que en el ponqué del cumpleaños aparece el número 40 y empezamos a ver en el horizonte la inminencia del declive. \r\n\r\nEs entonces cuando a los hombres los asedian con advertencias sobre el comportamiento de la próstata. Cuando una pizza a media noche es el preludio de una noche infernal y de una semana en la que la barriga delata el exceso de calorías. Cada día aparece una nueva señal que anuncia lo inevitable: estamos envejeciendo<br><br>&nbsp;Al llegar a los cincuenta, solo se puede exclamar: Qué desgracia tan infinita.\r\nLa obra es en realidad divertidísima. Diego Trujillo tuvo buen cuidado en seleccionar anécdotas y situaciones con las que cualquier espectador se puede identificar fácilmente. Es tanta la empatía que ha alcanzado con el público, que en más de una ocasión ha tenido que interrumpir la función porque las carcajadas de alguno de los presentes les impiden concentrarse a los demás.&nbsp;','../eventimg/1717141461que desgracias.jpg','Auditorio Centro Cultural Old Mutual',2,'BogotÃ¡ ','','','FUNDACION T DE TEATRO','Edad mÃ­nima de ingreso 16 aÃ±os\r\n',2,159,57,1,'PUB',2,'2017-02-12 19:42:15','','https://www.youtube.com/watch?v=3tlkltT2T4U',0,0,'2017-2-9 20:36:42'),(541,1,'Ozuna','El cantante, compositor y productor puertorriqueño Ozuna llega a Colombia, a la ciudad de Cartagena con su Genero Urbano, Rap y Reggaeton\r\n','../eventimg/1651957805Ozuna-Besandola.jpg','Centro De Convenciones Las Ãmericas',2,'Cartagena','','','CP Eventos y Entretenimiento S.A.S.','Edad MÃ­nima: 18 AÃ±os\r\nPreventa hasta el 04 de marzo \r\n',1,269,57,1,'PUB',2,'2017-02-09 21:05:52','','',0,0,'2017-2-9 21:03:46'),(542,1,'Lego Fun Fest ','Lego Fun Fest Colombia, llega por primera vez a Medelín <br><br>Diversión y aventuras, para ti y tu familia\r\n<br><br>Tiendas Lego con los últimos lanzamientos\r\n<br><br>Estaciones de Retos <br><br>Imagina los que puedes hacer con miles de ladrillos','../eventimg/2127412409legofunfestcolombia-gtp.png','Plaza Mayor ',2,'MedellÃ­n ','','','Plaza Mayor ','    ',7,180,57,1,'PUB',2,