nte un último diálogo de Frida con La Pelona (La Muerte) evocando los momentos más significativos de su vida. El éxito, el dolor físico, la política, el sexo y la compleja relación entre Frida y el famoso muralista Diego Rivera, trazan la trama de este nuevo texto.<br><br>Esta obra pretende ofrecer al espectador una reflexión con perspectiva histórica acerca del perdón, la des intelectualización del arte, el sexo libre, el amor, la libertad y el pensamiento político.Bajo la dirección musical de José Reinoso, Flora Martínez interpreta alguna de las canciones populares mexicanas favoritas de Frida. Esta nueva pieza teatral de artistas colombianos es un sentido homenaje a la mujer que, tras más de seis décadas de su desaparición física, dejó un legado artístico invaluable para la humanidad; y un ejemplo de lucha, arraigo a su tierra y celebración de la vida.','../eventimg/1607854033soy-frida-soy-libre-protagonizada-flora-martinez.jpg','Teatro Metropolitano',2,'MedellÃ­n ','','','GRUPO TREBOL COMUNICACIONES LTDA','Edad mÃ­nima de ingreso 12 aÃ±os\r\n',2,205,57,1,'PUB',2,'2017-02-10 22:22:07','','',0,0,'2017-2-10 22:18:40'),(545,1,'Esteman ','Plaza Central, uno de los complejos comerciales más nuevos de Bogotá, ofrecerá este sábado 11 de febrero un show musical gratuito, a cargo del cantante y compositor colombiano Esteman, dentro de una variada oferta de planes de entretenimiento que les ofrece este centro comercial a los bogotanos.<br><br>Esteman interpretará temas de sus dos primeros trabajos discográficos, “1er acto” y “Caótica belleza”, en los cuales ha contado con la colaboración de artistas de la talla de Carla Morrison, Natalia Lafourcade y Li Saumet, de Bomba Estéreo.\r\n\r\nSu nombre real es Esteban Mateus Williamson, nació el 4 de mayo de 1984 y se dio a conocer en la escena musical con su éxito<b> “No te metas a mi Facebook”.</b>','../eventimg/1237803640esteman.jpg','Centro Comercial Plaza Central',2,'BogotÃ¡ ','','','C.C. Plaza Central','    ',1,203,57,1,'PUB',2,'2017-02-10 23:05:06','','',0,0,'2017-2-10 22:46:23'),(546,1,'AutosuperaShow ','AutosuperaShow &nbsp;es un monólogo  comedia musical de siete cuadros acompañados de una banda en vivo, que durante 90 minutos reflexionará sobre aspectos absurdos de la tan malinterpretada hoy superación personal, autoayuda, creencias extremistas y radicales.<br><br>El reconocido actor Jimmy Vázquez&nbsp;llega como un ‘antipastor’ que protesta de una manera cómica y a la vez sarcástica contra el concepto de la autoayuda y superación personal que se popularizado en nuestra sociedad en los últimos años.&nbsp;Denuncia lo absurdo de las prácticas optimistas, que según él, en la mayoría de los casos son dadas por charlatanes.<br><br>AutosuperaShow&nbsp;destapa y señala sin sermones, discursos recalentados, manuales, ni milagrosas soluciones, sino con humor, mucho humor...','../eventimg/61451688New-Imagen-autosuperashow-FOTO-642x336.jpg','Teatro Santa Fe',2,'BogotÃ¡ ','','','ARTES Y ESPECTACULOS PRODUCCIONES SAS ','Edad mÃ­nima de ingreso 18 aÃ±os\r\n',2,213,57,1,'PUB',2,'2017-02-13 00:06:43','','',0,0,'2017-2-12 21:57:16'),(547,1,'Silvestre Dangond - Villavicencio','A preparase Villavicencio, ¡porqué llega Silvestre Dangond con su Gente Valiente World Tour!','../eventimg/2042408655silvestre-dangond-sigo-invicto-nueva-foto-2014-599x330.jpg','Coliseo Ãlvaro Mesa Amaya',2,'Villavicencio','','','Stage S.A.S','Edad MÃ­nima: 18 AÃ±os                                          Preventa hasta el 4 de Marzo                                          Entradas en http://bit.ly/2kIVI1N',1,260,57,1,'PUB',2,'2017-02-12 22:35:41','','',0,0,'2017-2-12 22:24:59'),(548,1,'PrevenciÃ³n del Abuso a Menores de Edad.','<b>Prevención del Abuso a Menores de Edad\r\n</b><br><br>Una de cada cinco mujeres adultas y uno de cada 10 hombres adultos dicen que abusaron de ellos cuando eran niños. Esto significa que hay cerca de 40 millones de adultos sobrevivientes del abuso sexual infantil solo en los Estados Unidos. ¡Es