-13 23:38:53','','',0,0,'2017-2-13 23:31:43'),(552,1,'Liderazgo dentro de los Sistemas de GestiÃ³n','A partir de la entrada en vigencia del Anexo SL en 2012, todas las diferentes normas internacionales para Sistemas de Gestión han venido incorporando la Estructura de Alto Nivel como herramienta para mejorar el desempeño de las organizaciones. Dentro de esta estructura, el capítulo 5 habla del requisito de \"<b>Liderazgo</b>\", en el cual se incluyen aspectos de compromiso gerencial, políticas y delegación de roles, responsabilidades, funciones y niveles de autoridad. <br><br>Teniendo en cuenta lo anterior, y la experiencia de<b> Red Gestión Integral&nbsp;</b>brindando servicios de consultoría y auditoría se ha mostrado que para lograr excelentes resultados en un Sistema de Gestión es fundamental garantizar el desarrollo de competencias en las personas sobre este ámbito tan amplio. Por eso, quieren&nbsp;que participes en esta &nbsp;CONFERENCIA GRATUITA para brindarte algunas herramientas que permitan desarrollar tus habilidades blandas en esta área tán interresante.','../eventimg/2081062493liderazgo-empresarial-450x255.jpg','RGI - Red GestiÃ³n Integral',2,'BogotÃ¡','','','RGI - Red GestiÃ³n Integral','Calle 62 NÂ° 9A-82 Ofc. 817',6,122,57,1,'PUB',2,'2017-02-14 21:30:47','','',0,0,'2017-2-14 21:07:27'),(553,1,'Silvestre Dangond - MedellÃ­n ','A prepararse Medellín, ¡Silvestre Dangond arranca con su Gente Valiente World Tour por esta ciudad!','../eventimg/1751174553silvestre.jpg',' Centro de Eventos la Macarena',2,'MedellÃ­n ','','','D&G Eventos S.A.S.','Eda mÃ­nima 18 aÃ±os \r\nPreventa 1 - hasta el 4 de Marzo\r\nPreventa 2 - hasta el 22 de Abril',1,262,57,1,'PUB',2,'2017-02-15 15:18:11','','',0,0,'2017-2-14 22:16:55'),(554,1,'Soy Luna - Cali','Soy Luna en Concierto, con el elenco encabezado por Karol Sevilla, ofrecerá una puesta en escena impactante y un gran despliegue musical con canciones originales de la serie.<br><br>La música de Soy Luna es un éxito: sus dos ál