iferentes, debes hacer cosas diferentes, a veces anhelamos que todo cambie por arte de magia, pero seguimos haciendo lo mismo, es el momento de asumir nuevos retos y emprender un nuevo desafío de vida que te lleve a alcanzar el éxito\", manifestó Norbey Rodríguez.<br><br></div><div>Norbey Rodríguez es MasterCoach certificado por la Universidad Iberoamericana de Liderazgo (UNILID), además de poseer estudios de Ingeniería, Comunicación Social y Teología, es certificado Coach de Vida,&nbsp;Terapeuta Familiar y Conferencista. Actualmente reside en la Isla de Margarita en Venezuela junto a su esposa e hija y realiza diversas capacitaciones en Iberoamérica a través de la Corporación de&nbsp;Estudios Superiores para la Comunicación y Coaching (Corpoleader).<br></div><div><br></div>','../eventimg/1805214138cucuta.jpg','Hotel Ãcora',2,'CÃºcuta','','','Norbey RodrÃ­guez','Reservaciones a travÃ©s de los telÃ©fonos:\r\n+57 3165377276  +57 3012312115 o directamente en el Hotel Ãcora Calle 10',2,274,57,1,'PUB',2,'2017-02-17 23:40:35','','',0,0,'2017-2-17 23:15:44'),(563,1,'Hablemos de FÃºtbol con Vicente del Bosque','Vicente del Bosque es el técnico más exitoso del fútbol español, condujo a su país a ganar el único título de su historia en un mundial.','../eventimg/630365898vicente-del-bosque-.jpg','Salon Jumbo, Country Club',2,'Barranquilla ','','','CIDEC SAS	','    ',3,169,57,1,'PUB',2,'2017-02-18 00:12:48','','https://www.youtube.com/watch?v=e8qrHeLbQd0',0,0,'2017-2-18 00:06:32'),(564,1,'IntroducciÃ³n a la Web 3.0','¿Por qué la atención es el activo más importante para construir una marca global, y cómo puede capturar la atención de sus clientes en esta nueva economía?<br><br>Consejos prácticos y estrategias sobre cómo utilizar las redes sociales para tener éxito hoy, y qué buscar en los próximos 12-36 meses para seguir en el juego.\r\n<br><br>La diferencia entre push y pull marketing y lo que significa mientras se crea o crece una marca.<br><br>¿Cómo alcanzar el equilibrio perfecto entre la marca, el marketing y las ventas, coherente con los hábitos de consumo de la economía de hoy?<br><br>Conferencista &nbsp;Brian Rashid<br><br>&nbsp;Acerca de Brian Rashid <br><br>Brian es conferencista, escritor, coach y experto en millennials. Asesor de empresas como Google, Facebook, Linkedin, Twitter, KPMG, entre otras. Experto en recaudar fondos para startups en Silicon Valley, ha asesorado y capacitado más de 100 empresas de todo el mundo, ayudándoles a recaudar más de $400 millones de dólares de inversión en los últimos 4 años.\r\nBrian también es presentador de TEDx, columnista de la revista Forbes y el Huffington Post y autor del libro,\"Es Tu Hora: Aprendiendo a hablar en público en 60 minutos','../eventimg/827035711web3.0.jpg','Casa de la Cultura La BarquereÃ±a',2,'Sabaneta, Antioquia ','','','AlcaldÃ­a de Sabaneta y The Intern Group Colombia','DirecciÃ³n: Casa de la Cultura La BarquereÃ±a\r\nCalle 68 Sur NÂ° 42 â€“ 40\r\nSabaneta, Antioquia',8,125,57,1,'PUB',2,'2017-02-19 22:40:19','','',0,0,'2017-2-19 22:36:46'),(565,1,'Camilo Cifuentes - Inimitable ','El viernes 17 de marzo para festejar el mes de la mujer en el teatro José Consuegra Higgins el más grande imitador de América latina, KAMILO CIFUENTES a celebrar sus 20 años de carrera artística con su show ¡INIMITABLE! Como la gran mayoría de los humoristas, Kamilo Cifuentes inició su carrera desde muy temprana edad, imitando lo que a su gusto le llamaba la atención: familiares, docentes, compañeros de colegio, vecinos y autoridades locales entre otros, desarrollando y perfeccionando su don de imitar, don de cantar, hasta llegar al don de hacer reír y finalmente… donde poder mostrarse.\r\n<br>&nbsp;Años más tarde, luego de pertenecer durante su etapa universitaria al grupo de teatro de la Facultad de Medicina de la Universidad del Cauca, “Anfiteatro”, del cual fue fundador, y de unirse a la causa de hacer reír por hobby, termina su carrera de medicina en dicha universidad, ejerciendo su profesión durante 7 años, pero alternándola con el arte de imitar con humor de forma esporádica, pues este talento y gusto nunca se fue de su alma. Fue precisamente ese talento lo que lo llevó a conformar su primer grupo de humor, donde interpretaba magistralmente personajes de talla nacional e internacional, talento que fue observado por Crisanto Vargas “Vargasvil” y Saulo García (Integrante de los Marinillos), quienes sin dudarlo lo vincularon al mágico mundo del espectáculo. Fue integrante del “Manicomio de Vargasvil” por cerca de 2 años, donde interpretó personajes famosos como: Helenita Vargas, El Puma, Ricky Martin, entre otros.\r\n<br><br>Ganador en 4 ocasiones consecutivas del programa Sábados Felices en el año 2.001, en el mismo año se vincula al canal RCN Televisión, al programa “La Banda Francotiradores”, programa de humor político y de actualidad que estuvo al aire por 6 años consecutivos realizando imitaciones de diversos personajes nacionales e internacionales, del mismo modo estuvo vinculado con el programa de humor “Clonestilo” y “El Gran Chou” por espacio de 1 año, luego perteneció al elenco del programa ”Hay Con Quien” del canal CITY TV, realizando todas las voces del programa y algunas intervenciones en vivo de personajes, fue humorista en la emisora Candela en el programa de la mañana “Azuquita pa´l Café”. Hoy en día se encuentra vinculado como humorista del canal CARACOL TV. Participando como COACHING del Programa “YO ME LLAMO”,','../eventimg/663617613camilo cifontes.jpg','Teatro Jose Consuegra Higgins',2,'Barranquilla','','','FUNDACIÃ“N CULTURA NUEVA','Preventa PV1 hasta el 5 de marzo\r\nPreventa PV2 hasta el 10 de marzo\r\n\r\n',2,157,57,1,'PUB',2,'2017-02-19 22:47:24','','',0,0,'2017-2-19 22:45:05'),(566,1,'Indignados Social Club ','El arribista, el mediocre, el fanático, el auténtico falso y el indiferente son algunas de las personalidades que conocemos y odiamos, pero que somos. Con mucho humor Diego Camargo, Catalina Guzmán y Diego Mateus, acompañados por el Maestro de Ceremonias Antonio Morales Riveira intentando no herir susceptibilidades, nos divertirán con este novedoso espectáculo. No es una Obra de Teatro, no es un Stand Up Comedy. Es una Sátira con mucho humor y sin rodeos.','../eventimg/852864111indignados 680 x 400 300.jpg','Teatro Astor Plaza',2,'BogotÃ¡ ','','','ASTOR PLAZA SALA DE EVENTOS LTDA ','PREVENTA HASTA EL 2 DE MARZO:\r\n25% de descuento en funciones de Jueves\r\n20% de descuento en funciones de Viernes y SÃ¡bado ',2,186,57,1,'PUB',2,'2017-02-19 23:01:31','','',0,0,'2017-2-19 22:59:29'),(567,1,'Mujeres a la Carta','Próximo 25 y 26 de Febrero ven a disfrutar de un día Campestre en Familia <br><br>PLAN PARA ADULTOS: <br>* Incluye: Entrada a la obra de teatro la gran comedia “Mujeres a la Carta”, almuerzo plato fuerte de la carta, copa de vino, postre y actividades recreativas\r\n<br><br>PLAN PARA NIÑOS (2 A 8 años)\r\n<br>* Incluye: Actividades recreativas (granja, y recreación), almuerzo menú infantil, helado y sorpresa\r\n\r\nQue mejor plan que almorzar en familia en la tranquilidad del campo, luego disfrutar de una gran comedia teatral mientras sus hijos disfrutan de la granja y la huerta con nuestros recreacioncitas.','../eventimg/526186005mujeres a la carta.jpg','Teatro La Baranda',2,' Vda. MÃ¡rquez, La Calera,','','','FUNDACIÃ“N LA BARANDA','',2,149,57,1,'PUB',2,'2017-02-20 21:03:16','','',0,0,'2017-2-20 20:57:39'),(568,1,'Taller DinÃ¡mico ConstrucciÃ³n y RedacciÃ³n de Textos de Alto Impacto  ','<div>Sabía qué….?<br><br>· Utilizando el pensamiento lateral es posible desarrollar nuevos conceptos y una escritura precisa, sencilla, creativa y poderosa. (Bono, 1986).<br><br>· La indebida utilización de las nuevas Tecnologías de la Información y la Comunicación (TIC) está produciendo un empobrecimiento del lenguaje que debilita el desarrollo del pensamiento y de cualquier ejercicio profesional. Es necesario y urgente recuperar el texto escrito, soporte de todos los lenguajes. (Davara, 2000).<br><br>· “La escritura se halla fuertemente ligada con la formación ciudadana y la participación en la vida social. Quien no escribe sus puntos de vista… es un ciudadano a medias que sobrevive en el mar de los lenguajes sociales de modo anónimo”. (Mier, Arias, 2011).<br><br>¿Qué Aprenderá?<br>Desarrollar capacidades de persuasión mediante textos bien escritos.<br>Aumentar la visión del poder de la palabra escrita.<br>Saber combinar la información, las emociones y la lógica en el texto escrito.<br>A generar confianza y credibilidad en sus textos.<br><br><br></div>','../eventimg/1714241277taller practico.jpg','Hotel Double Tree By Hilton',2,'BogotÃ¡ ','','','BCP COLOMBIA	','INCLUYE:\r\nRefrigerio\r\nMaterial de apoyo\r\nCertificado de asistencia\r\nCopia de las presentaciones',2,112,57,1,'PUB',2,'2017-02-20 21:36:22','','',0,0,'2017-2-20 21:22:27'),(569,1,'El poder de estar bien conectados ','iNNpulsa Colombia promueve el crecimiento empresarial superando las barreras mentales y culturales que frenan el desarrollo creativo de las personas y limitan su capacidad emprendedora e innovadora. En línea con eso, inició hace cuatro años una comunidad de agentes de cambio llamada Héroes Fest: un movimiento de creadores basado en la colaboración para diseñar el futuro y desatar el cambio que transforma a Colombia.<br><br>Sin embargo, para que estos cambios tengan un real impacto es necesario que esta comunidad de agentes de cambio&nbsp;tengan constantemente conversaciones, diálogos y espacios que lleven al cambio y a la acción inmediata. Estos espacios han sido llamados&nbsp;Héroes Talks.<br><br>','../eventimg/689625990heroes.jpg','Cra. 13 Nro. 28-01 Piso 8 281',2,'BogotÃ¡ ','','',' iNNpulsa Colombia','    ',2,141,57,1,'PUB',2,'2017-02-20 21:54:48','','',0,0,'2017-2-20 21:49:07'),(570,1,'Colombia vs Bolivia ','Eliminatorias A Rusia 2018','../eventimg/1946199362Colombia-Vs-Bolivia-2018-BANNER-EVENTO-VERT-300X360.jpg','Estadio Metropolitano Roberto MelÃ©ndez',2,'Barranq