l evento, la comunidad podrá participar gratis de una jornada de vacunación.<br><br>El evento contará con la participación de La Alcaldía Local, la Secretaría de Integración Social, la Secretaría de Planeación, la Secretaría de Salud, la Secretaría de Gobierno, IDRD, Policía Nacional (divulgación del Nuevo Código de Policía), entre otras entidades.&nbsp;Las personas que asistan recibirán la vacuna contra la influenza, mientras lo animales recibirán la antirrábica.</div>','../eventimg/271849045JORNADA-VACUNACIÃ“N.png','Centro de Desarrollo Comunit. SimÃ³n BolÃ­var',2,'UsaquÃ©n','','','Centro de Desarrollo Comunitario Simon Bolivar','    ',9,135,57,1,'PUB',2,'2017-02-21 23:49:44','','',0,0,'2017-2-21 23:47:27'),(573,1,'Ozuna & Dani Masi en I Love BogotÃ¡','OZUNA el puertorriqueño del género de Reggaeton más destacado del momento, junto con DANI MASI  desde España, el dj que ha cautivado la escena electrónica en Colombia<br><br>No olvides asistir vestido de blanco.<br><br>','../eventimg/1932891420468-ozunaydani.jpg','Castillo Marroquin',2,'Chia ','','','Jefferson Gonzalez','Castillo Marroquin: Autopista Norte Km 21- Via La Caro\r\n\r\nEdad mÃ­nima 18 aÃ±os \r\n\r\nPreventa hasta el domingo 5 de marzo de 2017\r\n\r\n* Los palcos I love y La OcasiÃ²n incluye un consumo de: Una botella de licor + 5 aguas + 5 energizantes \r\n \r\n** El palco Corazon de Seda incluye un consumo de: Una botella de Champagne\r\n \r\nTodos los palcos tienen capacidad para 10 (diez) personas\r\n \r\nLas localidades Platino y VIP son de pie \r\n ',1,192,57,1,'PUB',2,'2017-02-23 04:58:31','','https://www.youtube.com/watch?v=_JOnM3jmY0o',0,0,'2017-2-23 04:47:41'),(574,1,'Escalada en Roca','La escalada en roca como deporte comienza con el ascenso al cervino, en los Alpes Suizos, aunque ya el 28 de junio de 1492 se había realizado el ascenso al Mont Aiguille por Antoine de Ville, monte que presenta dificultades propias de la escalada en roca. El desarrollo de este deporte surge de la conquista de las cumbres y la filosofía primaria era la de buscar nuevas rutas de ascenso. esta concepción de la escalada encuentra un clímax en Europa a fines de la década de los treinta con la conquista de las últimas tres paredes nortes de los Alpes: las grandes Jorasses, el Eigerwand y la Cara Norte del Cervino. a estas se les conoció entonces como \"los tres últimos problemas de los Alpes\".\r\n<br><br>La escalada es un deporte especial para medir tus miedos, para retar tu mente y alcanzar la meta que es llegar hasta la cima , esta dirigida especialmente para planes familiares, de amigos, de novios, en este caso que quieran interactuar con el bellísimo paisaje y la naturaleza, para salir de la rutina que nos aqueja en la ciudad.<br><br><span><b>Bogotá bungee </b>está conformada por un militar retirado con 7 años de experiencia, en recates helicoportados manejos de cuerdas, descenso en rappel… y calificado para la realización de este deporte con los más altos estándares de calidad, equipos certificados y debidamente capacitado el personal a servicio, usamos póliza contra accidentes.<br></span><br><b>Ubicación del sitio:&nbsp;</b><span>Parador el Kiosko, kilometro 23 via Bogotá Choachi,<br></span><span>Este bello lugar se encuentra a tan sólo 30 minutos de Bogotá. La salida la puede realizar por Monserrate o Guadalupe. Le sugerimos tomar la Avenida Circunvalar en sentido Norte – Sur hasta la Plaza de Mercado ‘Rumichaca’ en el barrio Egipto. Desde allí tome la calle 6, que lo conducirá al municipio de Choachí en 45 minutos.<br></span><br>1.	Escalada en roca 4 rutas de diferente grado de dificultad<br>2.	Seguro<br>3.	Caminata ecológica de 20 minutos<br>4.	Fotos del evento<br>5.	Zapatos gatos tallas 35,38,40,43<br>6.	Equipo certificado&nbsp;<br>7. Guías&nbsp;calificados<br><br><br>','../eventimg/2156609escalada.jpg','Parador el Kiosko',2,'Choach','','',' BOGOTA BUNGEE','Esta actividad no es recomendada para mujeres embarazadas, personas con problemas cardÃ­acos, con fragilidad Ã³sea, osteoporosis o vÃ©rtigo.\r\n\r\n',3,166,57,1,'PUB',2,'2017-02-23 18:27:17','','',0,0,'2017-2-23 05:13:17'),(575,1,'Comic Con Colombia 2017','<b>COMIC CON COLOMBIA</b> es una convención que une a los fanáticos con sus gustos e ídolos, destacándose entre otros los aficionados a los comics, anime, gamers, cine, manga, literatura fantástica, juegos de rol, cosplayers, TV, etc. <br><br>La convención Comic Con hace parte de la cultura del entretenimiento y del universo geek de las principales ciudades y metrópolis del mundo, siendo hoy por hoy una tendencia creciente a nivel internacional.\r\n<br><br>En esta oportunidad tendrá como invitada a Millie Bobby Brown','../eventimg/446528907Millie-Bobby-Brown-Comic-Con-Colombia.jpg','Plaza Mayor - PabellÃ³n Blanco y Amarillo ',2,'MedellÃ­n ','','','ALEJANDRO CABALLERO P','PAQUETE 18 Y 19 MAYO \r\nPreventa 1 - hasta el 20 de marzo (PV1 18 19)\r\nPreventa 2 - hasta el 20 de abril  (PV2 18 19)\r\n\r\nPOR DÃAS 20-21 MAYO\r\nPreventa 1 - hasta el 20 de marzo  (PV1 20 21)\r\nPreventa 2 - hasta el 20 de abril   (PV2 20 21)\r\n',4,217,57,1,'PUB',2,'2017-02-23 06:01:44','','',0,0,'2017-2-23 05:53:38'),(576,1,'Padre Rico Pobre Padre con Diego Trujillo ','Padre Rico Pobre Padre, Diego Trujillo expone con humor cáustico la condición de ser padre, en un mundo contemporáneo, en el que los “papitos” vienen genéticamente codificados para comportarse igual a las “mamitas”; Ellos también se embarazan, sienten antojos y mareos, dice Trujillo: “Partida de Sapos”. Haciendo referencia a la crianza que recibió de sus padres, se muestra a sí mismo como un desadaptado frente a las exigencias modernas que lo obligan a “sorrostricar al embrión a punta de estimulación temprana, hacer el oso en el curso psicoprofiláctico, o desmayarse en la sala de partos apenas nace el bebé”.<br><br>La obra es una reflexión descarnada y divertida que pone de manifiesto lo duro, lo malo y lo feo de ser papá. Desde la concepción hasta la adolescencia el actor hace un recorrido por situaciones que lo llevan a renegar de sus propios hijos y a buscar afanosamente una razón que reivindique la paternidad.<br>','../eventimg/1630651176padre rico.jpg','Auditorio Centro Cultural Old Mutual',2,'BigotÃ¡ ','','','FUNDACION T DE TEATRO ','    ',2,179,57,1,'PUB',2,'2017-02-23 22:01:35','','https://youtu.be/9fovmnRtVj4',0,0,'2017-2-23 21:59:48'),(577,1,'Ni muerta dejo de Vivir con Andrea GuzmÃ¡n ','Viajando por una vida intensa, la protagonista de la obra llega a la única conclusión posible: nadie me quita lo “bailao”. Amores, mentiras, aciertos y desaciertos: ¿Qué mujer no se ha equivocado? ¿Qué mujer no se ha enamorado del hombre equivocado? Desnuda en escena, Manuela baila y canta las emociones de su vida... y de su muerte.<br><br>El paso de niña a mujer la sorprende en pleno colegio de monjas; el primer amor la liquida sin sutilezas. En busca de otra oportunidad Manuela nos divierte entre príncipes fallidos y su deseo profundo de encontrar el verdadero amor.<br><br>En una hora y diez de emociones, vivimos sus fantasías, sus equivocaciones, sus momentos de goce y alegría, dos matrimonios (el suyo y el de su hermana) y un funeral. Porque como decía Frida Kahlo “cada (tic tac) es un segundo de la vida que pasa, que huye y no se repite”','../eventimg/661771184Andrea-Guzman.jpg','Teatro Sala Belartes',2,'BogotÃ¡ ','','','ARTES Y ESPECTACULOS PRODUCCIONES SAS ','Edad mÃ­nima de ingreso 18 aÃ±os\r\n',2,184,57,1,'PUB',2,'2017-02-23 22:39:20','','',0,0,'2017-2-23 22:34:32'),(578,1,'Eddie Santiago ','<div>Eduardo Santiago Rodríguez, más conocido artísticamente como<b> Eddie Santiago</b>, es un cantante puertorriqueño de salsa romántica, famoso por sus éxitos como&nbsp;&nbsp;\"Lluvia\", \"Tu me quemas\", \"Todo empezó\", \"Nadie mejor que tu\" y&nbsp;\"Antídoto y veneno\",&nbsp;</div><br>','../eventimg/1214493812eddie-santiago-cancun-2015.jpg','Centro, Calle del Arsenal',2,'Cartagena ','','','LILIANA DEL CARMEN PADILA','Edad mÃ­nima 18 aÃ±os ',1,195,57,1,'PUB',2,'2017-02-23 22:48:59','','',0,0,'2017-2-23 22:45:31'),(579,1,'Simposio ReproducciÃ³n Bovina ','AVANZA 2017, es el primer Simposio Internacional de avances sobre reproducción Bovina. Es una gran oportunidad para que los profesionales en reproducción se actualicen y estén en contacto con conferencistas de talla internacional, altamente reconocidos en el medio técnico y científico.<br><br>Adicionalmente AVANZA 2017, se convierte en un espacio ideal para ampliar la red de contactos y establecer conexiones con líderes de opinión y especialistas en temas reproductivos de todo el país. Finalmente AVANZA 2017 , puede ser un regalo para usted en el cual podrá aprender, socializar y disfrutar en un ambiente profesional.','../eventimg/140099756avanzada bovina.jpg','Hotel Dann Carlton',2,'Antioquia','','','Grupo E.motion S.A.S','    ',2,155,57,1,'PUB',2,'2017-02-25 10:28:37','','',0,0,'2017-2-25 10:27:28'),(580,1,'TÃ©cnicas para amar ','¿Cómo salvar su matrimonio y no morir en el intento?\r\n<br><br>Quién no ha tenido diferencias con su pareja, quien no ha estado a punto de decir no más…. todos!!! Y de esto habla esta gran comedia en donde dos parejas totalmente distintas se prestan para retratar de manera divertida estas situaciones. Dora (María Helena Doering) y Jorge (Juan Pablo Gamboa) están al borde de acabar con su matrimonio pero gracias a sus amigos Leo (Julio Pachón) y Susana (Adriana campos) y a los divertidos tips, ellos reconsideran la situación y deciden aplicar esos consejitos que terminan convirtiéndose en divertidas herramientas de seducción. Técnicas para Amar no es solo una maravillosa comedia, es un gracioso retrato sobre las parejas que se dejan arrastrar por la rutina pero que deciden apostarlo todo por su relación, no se pierdas esta maravillosa oportunidad de aprender alguna de estas “técnicas”','../eventimg/665382449tecnicas.jpg','Teatro Santa Fe',2,'BogotÃ¡ ','','','KAMALEONIKA','    ',2,148,57,1,'PUB',2,'2017-02-25 15:27:51','','',0,0,'2017-2-25 10:39:42'),(581,1,'PasÃ³ en un Hotel ','Freddy Beltrán presenta un show exclusivo para aquellos viajeros, visitantes, turistas, o sea todos. Hace una reflexión sobre si todos nos portamos igual en hotel. ¿Por qué la gente no puede pronunciar check in ni check out? ¿Por qué le dicen al que carga la maletas botones si se viste de saco? Y muchas más preguntas serán resueltas en \"PASÓ EN UN HOTEL\" \r\n','../eventimg/1963171667freddy.jpg','Hotel Radisson Ar Hotel BogotÃ¡ Airport',2,'BogotÃ¡ ','','',' AR HOTELES S.A.S	','Edad mÃ­nima de ingreso 18 aÃ±os\r\n',2,133,57,1,'PUB',2,'2017-02-25 16:21:09','','',0,0,'2017-2-25 16:18:04'),(582,1,'Deportivo Cali Vs Sportivo LuqueÃ±o','Deportivo Cali Vs Sportivo Luqueño primera fase Copa Sudamericana','../eventimg/746559263deportivo cali.jpg','Estadio Deportivo Cali',2,'Cali','','','ASOCIACIÃ“N DEPORTIVO CALI','Edad mÃ­nima; Oriental, Occidental, Norte y Suites 5 aÃ±os \r\nSur 14 aÃ±os \r\nBoleta para niÃ±o (Aplica para niÃ±os entre 7 y 12 aÃ±os) en Oriental y Norte $6.000 y Occidental $11.000',3,120,57,1,'PUB',2,'2017-02-26 22:12:37','','',0,0,'2017-2-26 22:09:43'),(583,1,'Seminario prÃ¡ctico retenciÃ³n de la fuente ','<b>Objetivo general:</b><br><br>Analizar los cambios operados en el sistema de retención en la fuente a partir de la Ley 1819/2016 de Reforma Tributaria Estructural. Considerando la eliminación de los regímenes tributarios de personas naturales con la consiguiente desaparición del IMAN y del IMAS, para dar paso al sistema de renta cedular en la persona natural, la reforma tributaria estructuró nuevos procedimientos de retención en la fuente para el impuesto sobre la renta acompañados de un régimen de transición. También en materia de retención a personas jurídicas, sobre pagos al exterior y del impuesto sobre las ventas se encuentran nuevos elementos que deben ser observados por los agentes de retención y que serán materia de análisis en este evento.<br><br><b>Metodología:<br></b>Con el fin de que el asistente comprenda y entienda el contenido del seminario práctico, se realizará la presentación teórica de cada uno de los temas, ejemplos y análisis de casos prácticos.','../eventimg/409295796guia-retefuente.jpg','Hotel Double Tree By Hilton',2,'BogotÃ¡ ','','','BCP COLOMBIA	','INCLUYE:\r\nRefrigerio\r\nEstaciÃ³n de cafÃ©\r\nCopia de las presentaciones del evento\r\nMaterial de apoyo\r\nCertificado de asistencia',6,142,57,1,'PUB',2,'2017-02-26 22:35:23','','',0,0,'2017-2-26 22:31:34'),(584,1,'Venga que si es paÂ´ eso ','<span>Ella es una de las pocas mujeres que se han atrevido a hacer stand up comedy, en Colombia y el resultado es este show impactante, divertido y muy exitoso. Es el momento de que los bogotanos disfruten de las ocurrencias de Liss Pereira en <b>VENGA QUE SI ES PA´ ESO!​</b> Porque la calle está dura.<br><br></span>Durante una hora, Liss hará un recorrido ordenado por el “abominable” mundo de la soltería, la envidia mental, la tortura de todo lo que queremos ser pero no somos, la importancia de cuidar su relación de pareja, la mala distribución de la plata, el talento y la belleza, la incompatibilidad entre la soledad y el amor ajeno.<br><br>La comediante, fiel a su estilo, resalta la categorización de los oficios por acento, la cirrosis imaginaria y otras patologías ficticias de la psiquis femenina y masculina, en este tratamiento de crueldad auto recetada, en cápsulas de comedia introspectiva y autocrítica también llamado&nbsp;“VENGA QUE SI ES PA´ ESO”.<br><br>Si alguna vez se ha sentido solo, envidioso, despistado, con ganas de divorciarse, feo, mal ensamblado, si no cree en la felicidad que chicanean los que lo rodean, si es de los que ensaya peleas y respuestas frente al espejo, si cree que habla mucho o piensa mucho... tranquilo, todo puede ser peor, algo que descubrirá con &nbsp;Liss Pereira, en el escenario.<span><br><br></span>','../eventimg/886127536liss-pereira-stand-up-comedy-venga-que-si-es-pa-eso-featured-800x351.jpg','Teatro Astor Plaza',2,'BogotÃ¡ ','','','Astot Plaza Sala de Eventos LTDA ','Edad mÃ­nima de ingreso 14 aÃ±os\r\n',2,143,55,1,'PUB',2,'2017-02-26 22:47:38','','',0,0,'2017-2-26 22:39:52'),(585,531,'Conferencia Descubre tu Potencial ilimitado','Ahora le toca al Zulia\r\n\r\nEl próximo Viernes 17 de Marzo el estado Zulia recibirá la conferencia \"Descubre Tu Potencial Ilimitado\" que desarrolla el MasterCoach de Vida; Norbey Rodríguez, por diferentes ciudades de Venezuela y Colombia.\r\nLa Conferencia es una herramienta para concienciar a las personas a potenciar su vida, además de animarles a caminar en su propósito, invitando a la colectividad a ser parte del cambio y esta abierta a todo público, cuyo único requisito es anhelar ser parte del cambio de Cabimas.\r\nEn Diferentes ciudades de Venezuela y Colombia, el conferencista anima a los participantes a hacer cosas diferentes y animándoles a asumir nuevos retos y emprender nuevos desafíos de vida para alcanzar el éxito.\r\nNorbey Rodríguez es MasterCoach certificado por la Universidad Iberoamericana de Liderazgo (UNILID), además de poseer estudios de Ingeniería, Comunicación Social y Teología, es certificado Coach de Vida, Terapeuta Familiar y Conferencista. Actualmente reside en la Isla de Margarita en Venezuela junto a su esposa e hija y realiza diversas capacitaciones en Iberoamérica a través de la Corporación de Estudios Superiores para la Comunicación y Coaching (Corpoleader).','../eventimg/1621749467arte norbey cabimas.jpg','Teatro Municipal de Cabimas Javier FernÃ¡ndez',1,'Cabimas','https://www.facebook.com/corpoleader/','@corpoleader','','Para mayor informaciÃ³n, reserva tu cupo a travÃ©s del 04266005015',6,103,58,1,'PUB',2,NULL,'','',0,0,'2017-2-28 00:51:59'),(586,531,'Conferencia Descubre tu Potencial ilimitado','Ahora le toca al Zulia\r\n\r\nEl próximo Viernes 17 de Marzo el estado Zulia recibirá la conferencia \"Descubre Tu Potencial Ilimitado\" que desarrolla el MasterCoach de Vida; Norbey Rodríguez, por diferentes ciudades d