³n Integral Calle 62 # 9A-80 O',2,'BogotÃ¡ ','','','RGI - Red GestiÃ³n Integral','    ',6,141,57,1,'PUB',2,'2017-02-28 14:38:51','','',0,0,'2017-2-28 14:21:55'),(588,1,'Segundo Festival del Humor ','ARTISTAS:\r\n<br>Pirobeta<br>La Bruja<br>Dioselina \r\nJoselo','../eventimg/1065279294himor5.jpg','Centro de Convenciones - SalÃ³n GetsemanÃ­',2,'Cartagena ','','',' LILIANA DEL CARMEN PADILLA','Edad mÃ­nima de ingreso 5 aÃ±os \r\n',2,135,57,1,'PUB',2,'2017-02-28 16:46:10','','',0,0,'2017-2-28 16:42:02'),(589,1,'90 - 60 - 60 ','Seis mujeres cuentan su intimidad, su lucha secreta para tener un cuerpo perfecto y el secreto de la eterna juventud, pasando por miles de estrategias ridículas y arriesgando incluso su propia vida. Una adolescente con una dieta miserable, una reina de pueblo, una adicta al trabajo que pierde su marido y debe enfrentar por primera vez el desafío de ser bella, una mujer que trata de sacar de su cuerpo los rastros del abuso y una señora que se niega a envejecer.<br><br>Ellas serán confrontadas por una sexta mujer, ajena al mundo moderno, que se encargará de demostrarles con mucho humor negro que no todo en esta vida es ser 90 – 60 – 90.','../eventimg/2023284383906090.jpg','Sala Bueaventura, Casa  E',2,'BogotÃ¡ ','','','CORPORACIÃ“N CASA ENSAMBLE','    ',2,218,57,1,'PUB',2,'2017-02-28 18:55:33','','',0,0,'2017-2-28 18:53:01'),(590,1,'MonÃ³logos de la Vagina ','<div>Los monólogos de la vagina es una obra escrita por la feminista estadounidense Eve Ensler.&nbsp;<br><br>La obra relata&nbsp;a una docena de personajes relatando sus historias. La edad, actitud y estado de animo de los personajes varía, pero todos los monólogos están relacionados con la vagina, ya sea por tratarse de la sexualidad, la menstruación, la masturbación, el orgasmo, el parto, la violación o la mutilación genital.<br></div>','../eventimg/210702333monologos.jpg','Teatro Nacional La Castellana',2,'BogotÃ¡ ','','','Fundacion Teatro Nacional ','Edad mÃ­nima de ingreso 16 aÃ±os \r\n',2,182,57,1,'PUB',2,'2017-03-12 23:34:06','','https://youtu.be/cWJHOys5QFg',0,0,'2017-2-28 22:24:48'),(591,1,'Juan Alvarez - DejaVu un show de magia ','REGRESA!<br>El espectáculo de magia más aplaudido en los últimos tiempos<br><br>¡Un espectáculo de magia diferente llevado a los límites de lo imposible!<br>El Deja Vú es esa sensación que sentimos los seres humanos cuando creemos estar viviendo algún instante del pasado, algo que suponemos ya vivimos, ya soñamos. Volvamos entonces al instante de nuestra niñez cuando creíamos en la magia, cuando sabíamos con certeza que todo era posible.<br><br><span>Efectos de magia novedosos puestos en escena de una forma sorprendente con ayuda de proyecciones, música, luces y efectos especiales donde los espectadores son llamados a formar parte del espectáculo de una forma integral y divertida.<br><br></span>Juan Alvarez nos invita a hacer un Deja Vú juntos para revivir sensaciones, experiencias y recuerdos donde podamos volver a experimentar el verdadero sabor de la magia.<br>','../eventimg/1269902445Juan alvarez.jpg','Hollywood Casino y CafÃ© Concert',2,'BogotÃ¡ ','','',' JUAN ALVAREZ MAGIA SAS','Edad mÃ­nima de ingreso 18 aÃ±os ',2,162,57,1,'PUB',2,'2017-02-28 22:41:37','','https://youtu.be/IJVmozNC6wI',0,0,'2017-2-28 22:38:45'),(592,1,'Que Viva la Envidia ','¡Qué viva la envidia! El nuevo show de Ricardo Quevedo, que pretende demostrar que todos en algún momento hemos experimentado este sentimiento. No vivimos tranquilos con lo que tenemos porque nos hace falta algo más, porque andamos comparando lo nuestro con lo que tienen los demás, porque basta con que algo no sea nuestro para desearlo. En secreto deseamos las cosas ajenas, ya sea la mujer del prójimo, el sueldo del vecino, la casa del jefe, los viajes de los amigos, el éxito de los compañeros, etc. Este sentimiento que nos lleva a usar esa famosa frase de “me alegra mucho por ti” aunque por dentro nos estamos muriendo de envidia.&nbsp;<br><br>Vivimos a la defensiva y eso nos vuelve poco solidarios, en este show Ricardo Quevedo usa su característico y malhumorado humor como un arma de construcción masiva, para reírnos de nuestros errores y aceptar nuestra condición de envidiosos, el primer paso para dejar de sentir envidia es aceptarla. Por eso el nombre del show ¡Qué viva la envidia! Porque la vida está llena de cosas bonitas que le pasan a los demás.&nbsp;','../eventimg/2075296163ricardo quevedo.jpg','Teatro ECCI El Dorado',2,'BogotÃ¡ ','','','LLENANDO SALAS SAS ','Edad mÃ­nima de ingreso 14 aÃ±os\r\n',2,141,57,1,'PUB',2,'2017-02-28 22:49:20','','',0,0,'2017-2-28 22:47:04'),(593,1,'Nueva Reforma Tributaria para Emprendedoras','¿Conoces la nueva reforma tributaria? ¿Comprendes cuáles son sus implicaciones en las empresas? ¿Sabes que existen incentivos tributarios para el post-conflicto?<br><br><div>MET Community celebra el día de la mujer con el primer taller de 2017 sobre la nueva reforma tributaria para emprendedoras.<br><br></div><div>En este taller presentado por Marcela Parra, Gerente de ReyPar aprenderás:<br><br></div><div>1. Generalidades de la Reforma Estructural</div><div>2. Impuesto Renta Personas Naturales y Jurídicas</div><div>3. Régimen Tributario Especial</div><div>4. Monotributo</div><div>5. Impuestos Territoriales y otros impuestos</div><div>6. Incentivos Tributarios Post- Conflicto<br><br></div><div>En este taller aprenderás todos los cambios tributarios de la nueva reforma para emprendedoras que empezó a regir el 1 de enero.<br></div><br>','../eventimg/941479894reforma.jpeg','Centro de InnovaciÃ³n del BBVA (CIBBVA) 7221 C',2,'BogotÃ¡ ','','','MET Community','    ',6,137,57,1,'PUB',2,'2017-03-01 21:17:40','','',0,0,'2017-3-1 21:07:20'),(594,1,'Felicidad Organizacional ','La Especialización en Gestión de Recursos Humanos invita a toda la comunidad konradista y al público en general a la Conferencia: “Felicidad Organizacional: Oportunidad de innovación en la Gestión del Talento Humano”, ofrecida por Ángela María Rubiano Bello experta en la dirección de organizaciones y en intervención psicosocial con niños, jóvenes y familias.<ul><li>La Felicidad es un tema de estudio científico en la actualidad. Además de ser un bien universal y una aspiración de la humanidad. Así surgen las Ciencias de la Felicidad.</li><li>La Felicidad dentro de las organizaciones puede configurarse como una estrategia para la gestión del recurso humano en la empresa.</li><li>Estudios científicos de Felicidad Organizacional demuestran que impulsar la felicidad dentro de la empresa genera mayor productividad y satisfacción, así como una disminución en la rotación y el ausentismo.</li></ul>','../eventimg/1606957226felicidad organizacional.jpg','FundaciÃ³n Universitaria Konrad Lorenz',2,'BogotÃ¡ ','','','Escuela de Posgrados','FundaciÃ³n Universitaria Konrad Lorenz, Terraza, piso 8 Carrera 9bis 62 - 43 Terraza, piso 8 - BogotÃ¡,',6,130,57,1,'PUB',2,'2017-03-01 21:30:23','','',0,0,'2017-3-1 21:21:38'),(595,1,'Los Caballero las prefieres brutas ','Un Stand up comedy, lleno de humor negro con reflexiones cotidianas.<br><br>Después de escribir su best seller \" Los caballeros las prefieren brutas \"la actriz Isabella Santo <br>Domingo decide hacer su Stand up Comedy basado en su célebre libro. El éxito fue rotundo, demostrado por las más de las 300 presentaciones durante 4 años consecutivos en teatros, convenciones y eventos privados, en territorio nacional e internacional\r\n<br><br>El Stand up comedy cuenta las espontáneas confesiones de esta irreverente autora y actriz, donde muestra con una divertida profundidad los temas cotidianos de nuestro día a día: la lucha de los sexos, el matrimonio, para qué? , el mercado nacional del usado, el machismo por conveniencia y demás ingeniosas ideas que expone la bella y talentosa actriz ISABELLA SANTO DOMINGO a lo largo del show, donde el público no dejara de identificarse y morirse... de la risa.<br>“Lo que ellos no saben es que ninguna mujer es bruta, es que nos hacemos las brutas que es distinto”.<br>','../eventimg/2012543702isabella_santo_domingo.jpg','Teatro Patria',2,'BogotÃ¡ ','','',' GP EVENTOS ARTÃSTICOS','Edad mÃ­nima de ingreso 12 aÃ±os \r\n',2,136,57,1,'PUB',2,'2017-03-01 21:40:37','','',0,0,'2017-3-1 21:37:06'),(596,1,'Todos Somos Huila - Desfile Pro damnificados invierno del Huila','En esta última semana el Huila ha sufrido una de sus más triste y duras tragedia invernales por el desbordamiento y avalancha de la quebrada Riofrio llevándose a su paso barrios completos, puentes, dejando a más de 400 familias sin hogar en condiciones muy precarias sin servicios públicos y sin techo donde vivir. <br><br>Por este motivo hemos organizado este desfile benéfico al cual se han vinculado diseñadoras de moda muy reconocidas, personalidades de la farándula, modelos, reinas y ex reinas de belleza aportando entre todos un granito de arena a esa noble causa y poder ayudar a todas estas familias q tanto lo están necesitando.&nbsp;<br><br>','../eventimg/506986023Rotativo-desfilev2.jpg',' Avalancha en Campoalegre - Huila',2,'Huila ','','','Fundacion Angelitos de Luz','    ',9,134,57,1,'PUB',2,'2017-03-02 22:12:52','','https://youtu.be/FR10m1a4JLc',0,0,'2017-3-2 22:06:48'),(597,1,'Bungee Jumping Puente Las Golondrinas ','<b>Bungee jumping</b><br><br>El bungee jumping es uno de los deportes extremos más atractivos que hay por el derroche de adrenalina y vertigo .... Este deporte es para niños jóvenes y adultos, Bogotá bungee lleva más de 3 años en la práctica venta y comercialización de bungee jumping, y la práctica de otros deportes extremos.<br><br><span>Este deporte se está practicando a 40 km de Bogotá en el municipio de Choachi, puente medina vereda la masa a 1 km de termales santa Mónica, en un clima de 18 grados centígrados, el clima es muy acogedor.<br><br></span><span>SALTO BUNGEE JUMPING INCLUYE:<br>1. Salto a bungee a 40 mts de altura.<br>2. Equipos certificados, arneses, mosquetones, cintas y cuerda elástica de bungee jumping 3. 