as espontáneas confesiones de esta irreverente autora y actriz, donde muestra con una divertida profundidad los temas cotidianos de nuestro día a día: la lucha de los sexos, el matrimonio, para qué? , el mercado nacional del usado, el machismo por conveniencia y demás ingeniosas ideas que expone la bella y talentosa actriz ISABELLA SANTO DOMINGO a lo largo del show, donde el público no dejara de identificarse y morirse... de la risa.<br>“Lo que ellos no saben es que ninguna mujer es bruta, es que nos hacemos las brutas que es distinto”.','../eventimg/258216723caballeros-prefieren-brutas.jpg','Teatro JosÃ© Consuegra Higgins',2,'Barranquilla ','','','Group Entretenimiento Y Publicidad','Edad mÃ­nima 18 aÃ±os \r\nEntradas en ticketshop.com.co',2,149,57,1,'PUB',2,'2017-03-04 06:40:29','','',0,0,'2017-3-4 06:39:12'),(602,1,'Dos mujeres sin camino - Barranquilla','La primera con su dulzura, su carisma y su característica sonrisa nos presentara su Stand Comedy&nbsp;NO NACÍ PARA SUFRIR,&nbsp;en donde sin rodeos ni tapujos&nbsp;Yaneth Waldman<span>&nbsp;se atreve a decir las mentiras y las verdades que cualquier otra mujer escondería. Un monólogo con muchas voces. Entre risa y llanto una profunda y conmovedora confesión. “NO NACÍ PARA SUFRIR...” la prueba perfecta de que en la vida se sufre tanto como se goza. Las carcajadas estarán aseguradas con la mujer de la risa más conocida del país. Tómelo como un manual para descubrir a un esposo infiel, o como una guía imperfecta para lidiar con los hijos adolescentes. Quizá sea la clave para sobreponerse a los malos negocios del (ex)marido, o simplemente el curso para tolerar el mal gusto de la amante<br></span><br>La segunda con su humor negro los espectadores podrán disfrutar de un espectáculo de la cruda y divertida realidad con&nbsp;Alejandra Azcarate&nbsp;. Los celos, la constante búsqueda de pareja, las frustraciones, el matrimonio, los ex, la luna de miel, las suegras, la convivencia el sexo y la infidelidad, son algunos de los temas que Alejandra toca desde una perspectiva femenina más no feminista, ya polémica, controvertida, rápida, divertida y franca como su protagonista son las características centrales de este show.','../eventimg/1612312180dosmujeres.jpg','Teatro JosÃ© Consuegra Higgins',2,'Barranquilla','','','CORPORACION ARTISTICA EN ESCENA ','Edad mÃ­nima de ingreso 14 aÃ±os\r\n\r\nEntradas en tuboleta.com ',2,140,57,1,'PUB',2,'2017-03-05 21:23:46','','',0,0,'2017-3-5 21:18:42'),(603,1,'Todo un Lokillo ','En “Todo un Lokillo” habrá desde una muy peculiar serenata a una quinceañera, pasando por un Tour donde Nairo Quintana es campeón, hasta un recorrido por las distintas maneras de trovar en Colombia. Estos y muchos más cuadros cómicos harán vivir al público un show inolvidable en Bogotá. \r\n<br><br>LOKILLO combina en este espectáculo su capacidad de improvisación, su humor musical y sus mejores imitaciones. Durante hora y media los asistentes podrán conocer cara a cara a nuestro campeón Nairo Quintana, al sexy Maluma, a Pipe Arias, al senador Robledo, entre otros, con el estilo.&nbsp;<br><br>La memoria es la historia de un país y la trova hace parte de esa cultura que nos hace sentir orgullosos de ser colombianos, por esa razón, el Teatro Astor Plaza los invita a pasar 3.600 segundos con las ocurrencias de “LOKILLO”, el trovador con más galardones en el país.&nbsp;<br>','../eventimg/252459360todo un lokillo.jpg','Teatro Astor Plaza',2,'BogotÃ¡ ','','',' ASTOR PLAZA SALA DE EVENTOS LTDA ','Edad mÃ­nima de ingreso 14 aÃ±os.\r\n',2,137,57,1,'PUB',2,'2017-03-05 22:10:16','','',0,0,'2017-3-5 22:07:14'),(604,1,'Paracaidismo - Una aventura Extrema  ','PARACAIDISMO\r\nTodos los fines de semana estamos realizando operaciones de Paracaidismo en nuestra zona de salto (aprox. 3 horas desde Bogotá).<br><br>Tenemos vuelos cada hora desde la 7:00Am hasta las 4:00 Pm.<br><br>Modalidad Tándem y costo:<br><br>Esta es la forma más fácil de saltar de un avión, después de haber recibido una instrucción previa de 10 minutos, ascenderás en el avión a más de 10.000 Pies de altura enganchado a un instructor certificado en Estados Unidos por la USPA (United States Parachute Association) , tendrás una caída libre entre 30 y 45 segundos a más de 220 kms/h de esta forma lo único que debes hacer es disfrutar de tu vuelo, una vez tu instructor haya abierto el paracaídas tendrás un vuelo de aproximadamente 8 minutos en donde podrán hacer maniobras y tu instructor te dará una explicación de como vuela el paracaídas y si lo deseas podrás maniobrarlo.&nbsp;<br><br>Vídeo del salto, debes llegar por tus propios medios a Flandes Tolima se debe reservar al correo o cel 3112630110 limite de peso 80 kg, a partir de 80 kg valor por kg 5000, límite de peso para salto 110 kilos. Si quieres tomar el curso AFF completo te cuesta $4.400.000: son 8 niveles que debes cursar y aprobar te entregaremos una licencia por 3 meses mientras adquieres las tuya. Curso teórico practico 10 horas de teoría el alumno debe pasar todos los niveles de lo contrario tendrá que repetir los que pierda y por ende cancelar extra. Todos los sábados y domingo.Nota si quieres puedes llegar a nuestra sede, tenemos zona de camping donde puedes instalar tu carpa y dormir la noche, aplican restricciones y condiciones.<br>','../eventimg/74182704paracaidismo.jpg','Flandes Via Giradot Espinal',2,'Tolima ','','','BOGOTA BUNGEE ','Edad mÃ­nima 18 aÃ±os\r\n\r\nEntradas en tuboleta.com',3,166,57,1,'PUB',2,'2017-03-05 22:56:54','','',0,0,'2017-3-5 22:53:44'),(605,1,'6ta. Gran Mini Feria del Libro Usado','Esta es una feria que se ha venido realizando los últimos cuatro años entre las ciudades de Medellín y Bogotá, con una gran acogida entre los estudiantes universitarios. <br><br>El evento consiste en brindar al público visitante libros originales usados a $5000 (cinco mil pesos), hay libros de todos los géneros para todos los gustos.','../eventimg/904548204feria del libro.jpg','Centro Creativo Textura',2,'BogotÃ¡ ','','',