.com.co',2,144,57,1,'PUB',2,'2017-03-07 23:11:09','','',0,0,'2017-3-7 23:09:41'),(609,1,'Luis Chataing - Todo gira en BogotÃ¡ ','El comediante y locutor venezolano Luis Chataing, d<span>espués de seis años sobre las tablas con presentaciones nacionales e internacionales de sus tres exitosos monólogos, irrumpe nuevamente en el escenario con un nuevo show de humor titulado <b>Todo Gira.</b> En hora y media de espectáculo, el reconocido locutor y comediante venezolano reúne material sobre la actualidad de su país y una selección de las mejores rutinas de sus trabajos anteriores en el tradicional formato del Stand Up Comedy.</span>','../eventimg/32344216Luis-Chataing-Montreal-Club-Soda.jpg','4.40 Music Hall ',2,'BogotÃ¡ ','','','AGUACATE INK S.A.S.','Edad mÃ­nima de ingreso 12 aÃ±os\r\nEntradas en tuboleta.com ',2,189,57,1,'PUB',2,'2017-03-07 23:19:45','','',0,0,'2017-3-7 23:15:33'),(610,1,'I am Hassam ','<b>I am Hassam</b>, es el tipo de show, donde el artista <b>Hassam</b>, muestra cada uno de sus personajes, todos reunidos en solo escenario, ROGELIO PATAQUIVA TOCASUCHE, un reciclador profesional dicharachero, con anécdotas del diario vivir colombiano; GUEVARDO, con su ternura a veces distraído ademas ingenuo cuenta su historia y remata con PROCULO RICO Y SU ORQUESTA CHIMBILA, con un sin número de burlas graciosas a los integrantes de esta, y una explosión de pirotecnia cantando sus canciones de guasca rap, destello de luces y una puesta en escena de música en vivo muy divertida haciendo que la gente se emocione y se reviente de risa.','../eventimg/1099103222hassam.png','Auditorio las Bethlemitas',2,'BogotÃ¡ ','','','JAVIER DOMINGO SEPULVEDA','Edad mÃ­nima de ingreso 12 aÃ±os\r\nEntradas en tuboleta.com ',2,224,57,1,'PUB',2,'2017-03-07 23:25:13','','',0,0,'2017-3-7 23:23:42'),(611,1,'Tributo Adele concierto ','INTERPRETE:\r\nLAURA ARISTA (Arista Music Band )\r\n\r\nEn 2017 la cantante y compositora británica ADELE vuelve a arrasar en la entrega de premios Grammy llevándose 5 premios entre los que se cuentan los 3 más importantes: canción del año, álbum del año y grabación del año. \r\n\r\n<br><br>En un concierto maravilloso, la agrupación TRIBUTO ADELE, interpreta sus\r\n más grandes éxitos entre los que se encuentran: To make you feel my \r\nlove, Rolling in the Deep, Someone like you, Don\"t you remember, Love \r\nsong, Hello y Skyfall entre otros. Una hora y media de éxitos en la voz \r\nde Laura Arista, una increíble cantante que da vida a ADELE incluso en \r\nsu forma de vestir, pues usa el vestuario que la artista usó en su gira \r\nSKYFALL\r\n <br><br>\r\nUn tributo en el que las canciones serán interpretadas en inglés \r\nbritánico (nativo de la artista) para darle aún más realismo a la \r\ninterpretación, un show con banda en vivo, y en medio de un ambiente \r\npropicio para sentir de cerca las canciones que han convertido en éxito \r\nhistórico a ADELE, que logrará transportar al público a los momentos más\r\n emocionantes con un performance alrededor de su vida, sus triunfos y su\r\n vida personal.&nbsp;<br>','../eventimg/879447272adele_2098c.jpg','Casa E salÃ³n Central',2,'BogotÃ¡ ','','',' CORPORACION CASA ENSAMBLE ','Edad mÃ­nima de ingreso 18 aÃ±os\r\nEntradas en tuboleta.com',1,136,57,1,'PUB',2,'2017-03-09 12:25:54','','',0,0,'2017-3-9 11:36:35'),(612,1,'Teen Festival ','Mario Bautista es un artista internacionalmente conocido por sus videos de Youtube y Vine, su talento lo ha llevado a ser uno de los mas grandes en su genero y estilo. Se ha ganado la simpatía de miles de niñas de Latinoamérica gracias a su perfil de Vine, pero planea conquistar a mucho a través de su música. A su corta edad de 20 años ya es un fenómeno de las redes sociales en Latinoamérica. Su historia es como la de la cenicienta apenas unos años atrás Mario era como cualquier chico de su edad, hoy la legión de BAUTISTERS (como se denominan sus seguidores supera ya los 9 millones en Latinoamérica.<br><br>Premios y Reconocimientos:<br>Ganador en los Millenial Awards de MTV como lo mas Hot 2015<br>Ganador MTV Europe Music Awards al Mejor Artista Latinoamericano Norte 2015<br>Ganador en los kids Choice Awards de Nickelodeon como (El Mas Influyente En Redes Sociales)<br>Conductor en los premios Kids Choice Awards de Nickelodeon 2015 y 2016&nbsp;<br>Ganador en los MTV Millenial Awards 2015 como Artista Buzz e Icono Digital del Año&nbsp;<br>Ganador en los Kids Choice Awards de Nickelodeon como el Favorito en Redes Sociales<br>Ganador en los Kids Choice Awards de Nickelodeon como Artista Favorito Latino 2016<br>','../eventimg/2064872185maxresdefault.jpg','Centro de Eventos Multiparque',2,'BogotÃ¡ ','','','PRO MUSIC LA S.A.','Edad mÃ­nima de ingreso 12 aÃ±os \r\n\r\nEntradas en tuboleta.com',1,233,57,1,'PUB',2,'2017-03-09 17:24:18','','',0,0,'2017-3-9 17:19:23'),(613,1,'Duros de Amar  con Fernando ArÃ©valo y Patrick Delmas...','María y Simón son una pareja moderna, que después de disfrutar las mieles del enamoramiento sucumben ante su primera crisis y deciden romper. Sin embargo, rápidamente descubren que son incapaces de vivir el uno sin el otro. Dispuestos a solucionar sus diferencias, deciden acudir a un excéntrico coach experto en relaciones de pareja, famoso por sus métodos efectivos, pero poco científicos. María y Simón se embarcan en una aventura loca, que al final les permitirá descubrir que su amor, así sea imperfecto, es lo más valioso. En Duros de Amar aprenderemos a través de la comedia, que vale la pena luchar en pareja por vencer las mil trampas que nos trae el amor. <br><br><div>Autores: Melissa Drigeard y Vincent Juillet<br>Traducción y adaptación: Patrick Delmas y Fernando Arévalo<br>Dirección: Manuel Orjuela<br>Elenco: Verónica Orozco o Carolina Acevedo (elenco alterno), Patrick Delmas y Fernando Arévalo<br></div>','../eventimg/904177952duros de amor.png','Teatro Nacional Fanny Mikey',2,'BogotÃ¡ ','','','Fundacion Teatro Nacional ','Edad mÃ­nima 12 aÃ±os \r\nEntradas en tuboleta.com ',2,141,57,1