al para descubrir a un esposo infiel, o como una guía imperfecta para lidiar con los hijos adolescentes. Quizá sea la clave para sobreponerse a los malos negocios del (ex)marido, o simplemente el curso para tolerar el mal gusto de la amante<br></span><br>La segunda con su humor negro los espectadores podrán disfrutar de un espectáculo de la cruda y divertida realidad con&nbsp;Alejandra Azcarate&nbsp;. Los celos, la constante búsqueda de pareja, las frustraciones, el matrimonio, los ex, la luna de miel, las suegras, la convivencia el sexo y la infidelidad, son algunos de los temas que Alejandra toca desde una perspectiva femenina más no feminista, ya polémica, controvertida, rápida, divertida y franca como su protagonista son las características centrales de este show.','../eventimg/1176854319dos mujeres.jpg','Centro de Convenciones Cartagena de Indias',2,'Cartagena ','','','CORPORACION ARTISTICA EN ESCENA ','Edad mÃ­nima 12 aÃ±os \r\nentradas en tuboleta.com ',2,167,57,1,'PUB',2,'2017-03-09 23:11:19','','',0,0,'2017-3-9 23:07:33'),(617,1,'MI PUTA OBRA con Daniel Samper Ospina','El polémico columnista y youtuber de 40 años (42), lleva a la escena su explosivo material de sátira política en esta conferencia que parece una columna (y un video) en vivo. El periodista y youtuber Daniel Samper Ospina expone las vicisitudes de una persona que se dedica a la sátira política en una conferencia desternillante, que de paso hace un recuento de la historia reciente de Colombia, y que viene con gran compendio de videos y fotografías de políticos criollos como si se tratara del primer gran archivo sobre el ridículo nacional.','../eventimg/1333236599mi puta obra.jpg','Teatro Nacional Fanny Mikey',2,'BogotÃ¡ ','','','Fundacion Teatro Nacional ','Edad mÃ­nima 12 aÃ±os \r\nEntradas en tuboleta.com',2,185,57,1,'PUB',2,'2017-03-11 02:15:01','','https://youtu.be/IqK-RvDr4mA',0,0,'2017-3-10 22:54:46'),(618,1,'El desertor y el joven de manos frÃ­as','Un desertor se enamora de una bailarina y cantante por medio de las miradas que cruzan en la taberna.\r\n<br><br>Ella sufre la muerte de su primer amor y se debate entre aceptar la perdida e iniciar una nueva historia o aferrarse al pasado. Sus compañeras de baile, mujeres con más experiencia, la guían en los senderos de desamor y la pasión. El destino o la fatalidad en un pueblo en decadencia, contarán una historia de amor.<div><br></div>','../eventimg/8591892el desertor.png','Teatro Bernardo Romero Lozano',2,'BogotÃ¡ ','','','Circulo Colombiano de Artistas','Edad mÃ­nima 15 aÃ±os \r\nEntradas en.tuticket.com',2,171,57,1,'PUB',2,'2017-03-10 23:21:27','','',0,0,'2017-3-10 23:19:10'),(619,1,'La Real Academia de las buenas maneras','La Real Academia de las buenas maneras\r\nTres mujeres se encuentran en una academia de etiqueta dirigida por Miss Victoria una mujer fascinada con la realeza y maestra de dos particulares alumnas; Rose “la eterna solterona” y Mary “la joven primípara”. Ambas aprenderán sobre elegancia y glamour al mejor estilo europeo. “La real academia de las buenas maneras” es una comedia física que se mueve entre el clown, la danza y los malabares. Se trata de una obra explícita, cómica y atrevida donde a través de la risa se develará el tragicómico mundo de las mujeres.','../eventimg/1744018518La-Real-Academia-de-las-Buenas-Maneras.jpg','Casa e',2,'BogotÃ¡ ','','','CORPORACION CASA ENSAMBLE','Entradas en tuboleta.com ',2,135,57,1,'PUB',2,'2017-03-11 19:53:53','','',0,0,'2017-3-11 19:51:04'),(620,1,'La Gala del Chupe ','ALZATE, PIPE BUENO y PAOLA JARA&nbsp;se unen para ofrecer un verdadero mano a mano de música popular con lo mejor de sus repertorios en un GRAN CONCIERTO DE DESPECHO.&nbsp;<br><br>La música popular tiene un nuevo ídolo paisa llamado Jorge Andrés Alzate, más conocido como ALZATE. Cantautor de música en los géneros de despecho y norteña, ha logrado convertirse en una verdadera estrella gracias a su talento, carisma y la letra de sus canciones que ha llegado al corazón de sus seguidores. Desde sus 13 años se dio cuenta que componer era una necesidad para él, un medio especial para expresar sus sentimientos y una realización personal.&nbsp;<br><span>Con su canción \"Maldita Traición\" salió del anonimato y hoy está posicionado como uno de los cantantes más importantes de la música popular en Colombia. El humanismo siempre ha sido el pilar de su trayectoria, igual para su familia. Su gran influencia ha sido su amigo Darío Gómez.<br><br></span>PIPE BUENO, Andrés Felipe Giraldo Bueno, es una de las figuras más relevantes en este género tanto en el mercado nacional como internacional. Inició su carrera a los 16 años y desde entonces empezó a perfilarse como uno de los mejores, gracias a su indudable talento y estilo. Es conocido como \"El niño bonito del despecho\".<br><br><span>‘Recostada en la cama’, ‘No voy a morir’, ‘Te parece poco’, ‘Si yo fuera Ladrón’, ‘Tu viaje me duele’, ‘No me digas que no’, entre muchas otras canciones, hacen parte del largo repertorio de sus éxitos que lo han llevado por escenarios importantes en el mundo y al lado de grandes figuras de la música vallenata y popular.<br></span><br>Paola Jara, más conocida como actriz que como cantante, en los últimos 10 años ha incursionado en esta música cantando en sitios y eventos tanto públicos como privados acompañada de mariachis entre otros grupos musicales de renombre. Con gran aceptación por parte del público de todo el país se ha dado a conocer como Paola Jara “La voz ranchera”.<br><br>En su trayectoria ha compartido escenario con artistas de talla internacional como Vicente Fernández, Alejandro Fernández y Juan Gabriel; y con artistas nacionales como Johnny Rivera, Giovanny Ayala, Darío Gómez, Marbell, Jorge Celedón, El Charrito Negro, Luis Alberto Posada, Carlos Arturo (El Señor del Bolero), Elenita Vargas, Los Gigantes del Vallenato, Heber Vargas, Silvestre Dangong, Los inquietos, El Combo de las Estrellas, Las Hermanitas Calle y El Binomio de Oro, entre otros.<br><br>Estos artistas ya son verdaderas estrellas de la música de despecho en el mercado internacional en países como México, Estados Unidos, Ecuador, y Venezuela.<br>','../eventimg/1427707536gala_del_chupe.jpg','Gran Carpa AmÃ©ricas - CORFERIAS',2,'BogotÃ¡ ','','','ARTE Y CULTURA PRODUCCIONES SAS ','Edad mÃ­nima 18 aÃ±os \r\nEntradas en tuboleta.com ',1,178,57,1,'PUB',2,'2017-03-13 05:20:19','','',0,0,'2017-3-13 05:13:45'),(621,1,'Entre Perros nos entendemos','Después del éxito de Cada niño con su boleta, en el 2017 llega Alejandro Riaño con su nuevo show: Entre perros nos entendemos. Con su característica forma de ver la vida y peculiar humor, en esta oportunidad echa al agua a los hombres revelando las técnicas que utilizan para levantar, entre otras estrategias que le harán descubrir el perro que lleva dentro. Venga y ríase del suyo. Riaño pone en evidencia sus similitudes con sus mejores amigos, los perros; sus comportamientos a la hora de entablar una relación; sus gustos, su instinto animal, y su manera de acechar a la hembra, entre otras conductas que lo llevan a criticar por qué entre perros nos entendemos. ','../eventimg/1039220896entre-perros.jpg','Teatro Nacional La Castellana',2,'BogotÃ¡ ','','','FUNDACION TEATRO NACIONAL','Edad mÃ­nima 12 aÃ±os \r\nEntradas en tuboleta.com ',2,153,57,1,'PUB',2,'2017-03-13 05:36:05','','https://youtu.be/OGO5BuXWFC8',0,0,'2017-3-13 05:29:55'),(622,1,'El Cigala indestructible con la Big Band de Cali','Gran homenaje que rinde el cantador español y su dinastía Flamenca a la música salsa que en su recorrido por latinoamerica encontró en la ciudad de Cali a la BIG BAND  que lo acompañara en su desafío musical. El resultado como para no perdérselo\r\n','../eventimg/1962925687diegoelcigalafb29092016.jpg','Teatro Jorge EliÃ©cer GaitÃ¡n',2,'BogotÃ¡ ','','',' INSTITUTO DISTRITAL DE LAS ARTES - IDARTES','Edad mÃ­nima 12 aÃ±os \r\nEntradas en tuboleta.com',1,138,57,1,'PUB',2,'2017-03-13 05:40:56','','',0,0,'2017-3-13 05:39:35'),(623,1,'TEE