ones que podemos llegar a tener con la voz de una aplicación aunque no nos conteste los insultos.&nbsp;<br><br>Un show de Stand-up Comedy para que aprendamos a reírnos de nosotros mismos.<br>','../eventimg/1099968510sonriaynojoda.jpg','Teatro Astor Plaza',2,'BogotÃ¡ ','','','ASTOR PLAZA SALA DE EVENTOS LTDA ','Edad mÃ­nima 16 aÃ±os \r\nEntradas en tuboleta.com ',2,279,57,1,'PUB',2,'2017-03-17 20:35:42','','',0,0,'2017-3-17 06:42:19'),(635,1,'NA SA Narradores de Salitre ','<span>¡NA-SA Narradores de Salitre, regresa! . <br><br>El legendario espacio de cuenteria y comedia, famoso por ser el más grande de Latinoamérica en su estilo, celebra sus 15 años de creación. Por esta razón Ricardo Quevedo, Tato Devia, Jorge Torres \"El Diablo\" y Edwin Castiblanco \"Bart\", los integrantes originales, se unen nuevamente en un show especial, para recordar esas viejas historias que durante muchos años le entregaban a sus seguidores cada viernes, sabado y domingo en ciudad salitre. Los famosos \"cuenteros de Maloka\" han vuelto y si durante estos 15 años usted fue de alguna de las generaciones que los acompañó, venga y re-viva esas noches de risas, cuentos y comedia. Tranquilo que aquí los aviones no van a interrumpir y por favor, \"páguele a Tato\".&nbsp;</span><br>','../eventimg/694227340na sa.jpg','AUDITORIO COLEGIO AGUSTINIANO',2,'BogotÃ¡ ','','','HUGO ARMANDO DEVIA','Edad mÃ­nima 14 aÃ±os \r\nEntradas en tuboleta.com',2,140,57,1,'PUB',2,'2017-03-17 23:33:51','','',0,0,'2017-3-17 23:23:38'),(637,1,'Dario GÃ³mez','Noche de gala en Martín Fierro con el numero uno de la música popular.\r\n<br><br>INTERPRETANDO TODOS SUS EXITOS<br><br>Sera la puesta en escena más importantes y que mejor que con el icono de la música popular el sr DARIO GOMEZ en vivo y en exclusiva.&nbsp;<br>','../eventimg/1922626759elrey.jpg','MartÃ­n Fierro',2,'BogotÃ¡ ','','','EVENTOS MARTIN FIERRO','Edad mÃ­nima 18 aÃ±os\r\nEntradas en tuboleta.com ',1,298,57,1,'PUB',2,'2017-03-18 06:02:59','','',0,0,'2017-3-18 05:57:01'),(638,1,'Vanesa MartÃ­n - Munay ','Vanesa Martín se alista para visitar por primera vez Colombia&nbsp;<br><br>Una noche de alivio para los corazones bogotanos tendremos junto a la cantante española Vanesa Martín<br><br>La cantautora española llega con su quinto álbum llamado \"Munay”, título de su nuevo trabajo discográfico y, también, de su gira.&nbsp;<br><br><span>Munay es una palabra de origen indio que significa “<b>amar</b>” y que se utiliza para definir por su creación, el amor a la naturaleza, el amor a uno mismo y al otro.&nbsp;</span><br><br>“Un vuelo incombustible de sueños, vida y experiencias. Las canciones de Munay son un canto a la vida y a momentos que he vivido en primera persona o han vivido otros a mi alrededor. Experiencias que me van contando, voy viendo, que percibo y convierto en canciones. A veces puede parecer todo muy personal porque a la hora de componer siempre intento ponerme en el lugar de otra persona para imaginar lo que ha podido sentir”.<br><br>El 23 de abril ofrecerá los temas de su álbum y de su carrera en Bogotá, y aunque es la primera vez que viene a Colombia a presentar su propia música, la cantante ya cuenta con fieles seguidores y con grandes amigos como lo es Manuel Medrano con quien versiona el tema “Complicidad” para este disco.&nbsp;<br><br>Ahora la oportunidad es para nosotros de dejarnos envolver y sentir con Vanesa Martín .','../eventimg/768056947FOTO-VANESA-MARTIN.jpg','Teatro ECCI El Dorado',2,'BogotÃ¡ ','','','PRISA MÃšSICA AMÃ‰RICA S.A.S','Edad mÃ­nima 12 aÃ±os \r\nEntradas en tuboleta.com',1,166,57,1,'PUB',2,'2017-03-18 06:21:28','','',0,0,'2017-3-18 06:16:51'),(639,1,'NaciÃ³n Geek ','Es el encuentro de fanáticos y apasionados por los cómics, entusiastas de la tecnología, coleccionistas de action figures y soñadores del mundo cosplay. <br><br>Un evento inspirado en las ferias y convenciones mundiales creadas en los Estados Unidos hace 47 años, convirtiéndose en una plataforma de promoción no solo de marca