Sábado de abril de cada año.&nbsp;La entrada es gratuita&nbsp;y su principal objetivo es promover el uso del software libre, dando a conocer al público en general su filosofía, alcances, avances y desarrollo.&nbsp;<br><br>El evento es organizado por las diversas comunidades locales de Software Libre y se desarrolla simultáneamente con eventos en los que se instala, de manera gratuita y totalmente legal, software libre en las computadoras que llevan los asistentes. Además, en forma paralela, se ofrecen charlas, ponencias y talleres, sobre temáticas locales, nacionales y latinoamericanas en torno al Software Libre, en toda su gama de expresiones: artística, académica, empresarial y social.<br>','../eventimg/344143254flisol.jpg','Inst. Distrital para la RecreaciÃ³n y el Depor',2,'BogotÃ¡ ','','',' Comunidad FLISOL','Instituto Distrital para la RecreaciÃ³n y el Deporte, IDRD.\r\nCalle 63 No. 59A-06\r\nBogotÃ¡ D.C',2,152,57,1,'PUB',2,'2017-03-26 22:48:48','','',0,0,'2017-3-26 21:57:31'),(652,1,'Nadie estÃ¡ a salvo de un ciberataque de Plugin Coworking','El delito siempre está presente, incluso en el entorno digital. Cada día sin que nos demos cuenta, nuestros datos y hasta nuestra información financiera es vulnerable a posibles hackeos, fraudes y ataques cibernéticos. ¿Conoces a que eres las vulnerabilidades a las que se enfrentan día a día?\r\n<br><br>Conoces cómo protegerte de delitos informáticos y cómo resguardar tu información, tu intimidad y tu vida en el mundo digital, ya sea desde el punto de vista de una persona del común o de una empresa.<div><br></div>','../eventimg/693253739ciber.png','PlugIn Coworking',2,'BogotÃ¡ ','','','Plugin Coworking','PlugIn Coworking\r\nAv. Cra 19 #36 55\r\nBogotÃ¡',6,108,57,1,'PUB',2,'2017-03-26 22:25:23','','',0,0,'2017-3-26 22:22:40'),(653,1,'Primo Rojas y Las Botas de TÃ­o Manuel ','Un humilde campesino, después de un esfuerzo titánico, logra enviar a sus hijas a la ciudad para que estudien. El propósito, ingenuo, es que se conviertan en unas personas de bien. Una vez que las hijas se han integrado a la ciudad y especialmente al ambiente universitario, sienten vergüenza de su origen, y más concretamente de su padre. Ante sus nuevas amistades fingen ser otra cosa, pertenecer a una condición social diferente por lo que ocultan la existencia de un padre tan humilde, tan insignificante. Una circunstancia inesperada y trágica para ellas, las obligará a enfrentar la verdad que tanto las abochorna. Es una obra de tono casi bucólico pero salpicada de humor negro y de profusas dosis de ternura.<div><br></div>','../eventimg/1717363928primo rojas.jpg','Teatro Municipal Enrique Buenaventura ',2,'Cali','','','I.E.C. EVENTOS Y ESPECTACULOS S.A.S ','Edad mÃ­nima 13 aÃ±os \r\nEntradas en tuboleta.com ',2,104,57,1,'PUB',2,'2017-03-28 05:27:38','','',0,0,'2017-3-28 05:25:43'),(654,1,'CubismFashion','El Centro de Emprendimiento de la Universidad del Rosario, te invita a la segunda edición del CubismFashion, este es un espacio que busca promover el arte y emprendimiento como filosofía de vida, a través de este espacio, buscamos incentivar el Arte de Emprender como estrategia pedagógica innovadora que impulsa el emprendimiento, el arte y la música como una disciplina, entendiendo que el artista y el emprendedor tienen habilidades similares.','../eventimg/2027854963cubisn.png','Universidad del Rosario Sede Norte',2,'BogotÃ¡ ','','','Universidad del Rosario - Red Iberoamericana de InnovaciÃ³n','Registrarse en eventbrite.es\r\nUniversidad del Rosario Sede Norte\r\nCalle 200 entre carrera 7Âª y Autopista norte\r\nBogotÃ¡',2,146,57,1,'PUB',2,'2017-03-28 05:33:52','','',0,0,'2017-3-28 05:30:38'),(655,1,'Encuentra tu balance a travÃ©s de la nutriciÃ³n','¿Te gustaría saber la conexión que existe entre la alimentación, tus hábitos diarios, tus emociones y tu salud? Por miles de años, las tradiciones ancestrales del Ayurveda y la medicina china han utilizado las propiedades de los alimentos para preservar el balance entre la mente y el cuerpo. La falta de vitalidad, la inflamación crónica, los problemas digestivos, una microbiota pobre y el estrés, son algunos síntomas mas comunes de una salud desbalanceada y son el resultado de exponer nuestro cuerpo de manera constante a un estilo de vida inconsciente. Haz el cambio desde adentro y aprende. Nuevos hábitos nutricionales para preservar el balance de tu cuerpo y tu mente,<div><br></div>','../eventimg/771128675Rotativo-salud.jpg','Auditorio Edficio Paralelo 108',2,'BogotÃ¡ ','','','Infinite Wellness S.A.','Edad mÃ­nima 14 aÃ±os \r\nEntradas en tuticket.com',2,172,57,1,'PUB',2,'2017-03-28 05:48:19','','',0,0,'2017-3-28 05:46:23'),(656,1,'Expoartesanos 2017 ','Expoartesano es una alianza estratégica entre Artesanías de Colombia y Plaza Mayor Medellín, orientada a fomentar la oferta artesanal nacional.\r\n\r\n<br><br>Con este proyecto ferial, también se busca ofrecer a visitantes y compradores una muestra representativa de lo mejor de la producción artesanal del país, así como propiciar buenos negocios y oportunidades de expansión y visibilidad para el sector. Expoartesano es la mejor opción para disfrutar de lo mejor de la cultura y la tradición de cada rincón del país, desde las historias de sus protagonistas, las artesanías y la gastronomía.<div><br></div>','../eventimg/2067764024artesanos.png','Plaza Mayor MedellÃ­n ',2,'MedellÃ­n ','','','Plaza Mayor ','    ',7,154,57,1,'PUB',2,'2017-04-01 09:36:09','','',0,0,'2017-4-1 09:30:06'),(657,1,'Carlos Donoso y sus Personajes ','Todas las madres a reír a carcajadas.\r\n<br><br>Reconocido por ser el padre de los ventrílocuos, una habilidad que desarrollo desde muy joven y que pocos poseen hablar sin mover los labios, sus personajes Kini, Lalo, el Mono, etc, casi 50 años compartiendo en el mundo de la comedia.','../eventimg/270190414carlos donoso.jpg','Teatro Jose Consuegra Higgins',2,'Barranquilla ','','','FUDNACION CULTURAL NUEVA CARIBE','Edad mÃ­nima 15 aÃ±os \r\nEntradas en tuboleta.com',2,190,57,1,'PUB',2,'2017-04-01 09:41:50','','',0,0,'2017-4-1 09:40:21'),(658,1,'Yo no me llamo Feddy Mercury ','Freddie Mercury, la leyenda del rock regresa a la vida a través de la voz de Camilo Colmenares, con el espectáculo musical basado en el repertorio de la banda Queen y la vida del propio artista, el público podrá disfrutar de clásicos como: Under Pressure, Crazy Little Thing Called Love, Break Free, Love Of My Life, Somebody To Love y Bohemian Rhapsody entre otros.\r\n<br><br><span>Concierto que toma el repertorio de Queen para contar las dificultades y anécdotas del mundo del canto lírico y popular en Bogotá desde una posición anecdótica y realista. El mundo del Rock y su permanente resistencia en el colectivo latinoamericano son la inspiración y el motor central del discurso alrededor del ser o no Freddy Mercury.<br></span><br>Freddie Mercury, fuente de inspiración de esta pieza fue un cantante, compositor y músico británico de origen parsi e indio, conocido por haber sido el fundador y vocalista de la banda de rock Queen. Como intérprete, fue reconocido por su poderosa voz y extravagantes puestas en escena. Como compositor, escribió muchos de los éxitos de Queen, tales como Bohemian Rhapsody, Killer Queen, Somebody to Love, Don\"t Stop Me Now, Crazy Little Thing Called Love, Innuendo o We Are the Champions. Considerado como uno de los mejores músicos masculino de todos los tiempos.<br>','../eventimg/895730861fredy mercury.jpg','Casa E',2,'BogotÃ¡','','','CORPORACION CASA ENSAMBLE ','Edad mÃ­nima 18 aÃ±os \r\nEntradas en tuboleta.com ',1,145,57,1,'PUB',2,'2017-04-01 09:46:27','','',0,0,'2017-4-1 09:45:17'),(659,1,'Bodas de Oro de Alci Acosta ','50 Años del Rey del bolero, en una noche llena de recuerdos musicales&nbsp;','../eventimg/1400244239ALCI-ACOSTA.jpg','Discoteca Cabaret',2,'Cartagena ','','','LILIANA PADILLA','Edad mÃ­nima 18 aÃ±os \r\nEntradas en tuboleta.com\r\nPreventa hasta el 7 del Abril ',1,135,57,1,'PUB',2,'2017-04-03 05:27:43','','',0,0,'2017-4-3 05:21:57'),(660,1,'Que desgracia tan infinita con Diego Trujillo ','Los cuarenta años son un punto de quiebre en la vida de cualquier ser humano. A los cincuenta, viene el quiebre completo. Ese es el tema central del monólogo de humor Qué desgracia tan infinita, escrito y dirigido por Diego Trujillo, y en donde el comediante es quien le cuenta a los espectadores sus experiencias con la mediana edad. \r\n<br><br>La verdad es que todos estamos expuestos a esa dictadura de la edad. A los veinte años nos reímos de ese tío o de ese amigo que ha comenzado a comprar tratamientos contra la calvicie. A los 30, puede que aparezca esa primera cana que da el campanazo de alerta. Todo se puede manejar con relativa calma, hasta que en el ponqué del cumpleaños aparece el número 40 y empezamos a ver en el horizonte la inminencia del declive.&nbsp;<br><br>Es entonces cuando a los hombres los asedian con advertencias sobre el comportamiento de la próstata. Cuando una pizza a media noche es el preludio de una noche infernal y de una semana en la que la barriga delata el exceso de calorías. Cada día aparece una nueva señal que anuncia lo inevitable: estamos envejeciendo. Al llegar a los cincuenta, solo se puede exclamar: Qué desgracia tan infinita.<br><br>La obra es en realidad divertidísima. Diego Trujillo tuvo buen cuidado en seleccionar anécdotas y situaciones con las que cualquier espectador se puede identificar fácilmente. Es tanta la empatía que ha alcanzado con el público, que en más de una ocasión ha tenido que interrumpir la función porque las carcajadas de alguno de los presentes les impiden concentrarse a los demás.&nbsp;<br>','../eventimg/580930775diego-trujillo-que-desgracia-tan-infinita-1.jpg','Auditorio Centro Cultural Old Mutual',2,'BogotÃ¡ ','','','FUNDACION T DE TEATRO','Edad mÃ­nima 16 aÃ±os \r\nEntradas en tuboleta.com ',1,139,57,1,'PUB',2,'2017-04-03 05:33:02','','',0,0,'2017-4-3 05:29:44'),(661,1,'Suso el Paspi -  Tirando Caja Parte 2','En Tirando Caja 2 “Encajando en el mundo”&nbsp;<br><br>Suso el Paspi cuenta una divertida historia de cómo los colombianos tenemos que hacer para tratar de encajar en el mundo donde decir la verdad es pecado. Los asistentes podrán ver ese paso por la vida donde se elige el nombre y se entra a la adolescencia con sus miedos, sus angustias y su sexualidad; además Suso nos invita a respetar la diferencia, nos enseñará a besar y nos contará cómo pierde la virginidad. \r\n<br><br>Se tiene la teoría que en el mundo de hoy quien no baila, no encaja y quien no viaja, no goza con todas las cosas que pueden ocurrir en un paseo. Es una obra de grandes sorpresas donde podemos ver al personaje en múltiples facetas, todas muy divertidas y originales. Es una obra para disfrutar en familia.<div><br></div>','../eventimg/1097951703susos.jpg','Teatro Astor Plaza',2,'BogotÃ¡ ','','','TE CREO S.A.S.','Edad mÃ­nima 8 aÃ±os \r\nEntradas en tuboleta.com ',2,174,57,1,'PUB',2,'2017-04-03 05:42:25','','',0,0,'2017-4-3 05:36:00'),(662,1,'Gran Noche De Compositores â€“ Valledupar 2017','Gran Noche De Compositores con&nbsp;<br><br><ul><li>Poncho Zuleta y Cocha Molina</li><br><li>Indira De La Cruz y sus clásicos Vallenatos</li><br><li>Gustavo Gutiérrez</li><br><li>Fabián Corrales</li><br><li>Romualdo Brito y su banda vallenata</li><br><li>Rita Fernández</li><br><li>Rafael Manjarrez</li><br><li>Isaac Carrillo</li><br><li>Jorge Valbuena</li><br><li>Reynaldo \"Chuto\" Díaz</li><br><li>Adolfo Pacheco</li><br><li>Alberto \"Beto\" Murgas</li></ul>','../eventimg/1129217615Gran-Noche-de-Compositores-Valledupar-2017-BANNER-PRINCIPAL-HORIZONTAL-760X400.jpg','Colegio Colombo InglÃ©s',2,'Valledupar ','','','FundaciÃ³n Cultural y Social Romualdo Brito','Edad minÃ­ma 18 aÃ±os \r\nEntradas en ticketshop.com.co\r\nPreventa hasta el 14 de abril ',1,244,57,1,'PUB',2,'2017-04-04 05:17:09','','',0,0,'2017-4-4 05:12:17'),(663,1,'Reluciente Rechinante Aterciopelado','Nuevamente la capital acogerá con los brazos abiertos a uno de sus hij