 2017 es un evento de clase mundial y celebra su cuarta versión.\r\n\r\nEn Bogotá contara con la suma de expertos del país sobre tecnologías de nube enfocadas a la transformación digital, con sesiones de alta calidad que demostrara su aplicación real en escenarios empresariales.\r\n\r\nDisponemos de 430 cupos limitados, sujetos a inscripción valida y/o disponibilidad previa.\r\n\r\nEste evento es posible y sostenible, gracias a la suma de los actores de la comunidad empresarial y académica que promueven el uso del cloud computing y la transformación digital en Colombia, en conjunto con los expertos tecnologicos del país y sus organizadores.','../eventimg/1284222921cloudfirstcamp.png','Universidad EAN - Calle 79 No. 11 - 45',1,'Bogota','','','Universidad EAN','    ',6,29,57,1,'PUB',2,'2017-10-18 16:48:12','','',0,0,'2017-10-18 16:47:39'),(692,1,'Conferencia mundial \"Gestione su dinero en bolsa con Ã©xito\" - Colombia','El reconocido gestor de fondos español José Antonio Madrigal impartirá una conferencia gratuita en Bogotá el próximo 8 de noviembre.\r\nBajo el título \"Gestione su dinero en bolsa con éxito\", Madrigal resumirá las principales claves de su metodología de inversión basada en la lógica. Según datos auditados, esta metodología está dando sorprendentes resultados positivos entre los integrantes de Eurekers, la comunidad de inversionistas particulares que él mismo fundó.','../eventimg/1665402379Eurekers.jpg','Cinemark Avenida Carrera 68 No. 90 - 88 Local',1,'Bogota','','','Eurekers','    ',6,44,57,1,'PUB',2,'2017-10-18 17:23:36','','',0,0,'2017-10-18 16:54:51'),(693,1,'Workshop el potencial del Social Selling','El Social Selling es el fin de la puerta fría. es la utilización de medios sociales para obtener inteligencia de datos y sus conexiones entre personas con el objetivo de generar leads y convertirlos en clientes.\r\nEn este Workshop aprenderás:\r\n- A tener una red profesional obteniendo alta tasa de respuestas.\r\n- Funcionalidades clave de la cuenta Premium de venta (Sales Navigator).\r\n- Trucos de las nuevas versiones de LinkedIn (cuenta básica y Premium).\r\n- A hacer campañas de prospección por personas, industrias y empresas.\r\n- Cómo realizar seguimiento comercial alineado al proceso de venta B2B.\r\nDirigido a:\r\n- Directores, Gerentes y/o profesionales de venta, marketing y atención al cliente.\r\n- Empresas de servicios corporativos (B2B).','../eventimg/853529142SosialSelling.png','Sector TIC: Cra 18A #103 - 11, BogotÃ¡ DC ',1,'Bogota','','','Marketing TI','    ',6,43,57,1,'PUB',2,'2017-10-18 18:02:53','','',0,0,'2017-10-18 18:02:45'),(694,1,'Colombia Glass 2017','COLOMBIA GLASS 2017 es la primera reunión de negocios dedicada al sector de la industria del vidrio en Colombia, Venezuela, Ecuador, Perú y Panamá. Los profesionales locales tendrán la oportunidad de reunirse con clientes y proveedores en un evento dedicado.','../eventimg/1578996307ColombiaGlass.jpg','Hotel Sheraton BogotÃ¡ Calle 25B No 69C-80',1,'Bogota','','','Colombia Glass','    ',6,30,57,1,'PUB',2,'2017-10-18 18:10:24','','',0,0,'2017-10-18 18:10:14'),(695,1,'Influencer Marketing Summit','Gosocial, Goldfish y Alter, empresas pioneras en mercadeo en redes sociales, se unieron para transmitir conocimientos sobre las mejores prácticas, claves y procesos para hacer una integración exitosa del marketing y la publicidad con influenciadores. Para lograrlo, organizaron el Influencer Marketing Summit 2017, que se celebrará este jueves 19 de octubre en el Hall 74, centro de eventos de la Universidad Sergio Arboleda, en Bogotá (Calle 74 # 14 – 25).\r\n\r\nEl objetivo principal de este evento es que las agencias de publicidad de Colombia y Lationamérica aprendan a crear contenidos que lleguen a más clientes y descubran metodologías efectivas para medir el impacto de sus campañas, desarrollando estrategias que calculen el retorno de las inversiones realizadas en sus campañas. ','../eventimg/66541452Influencers.jpg','Universidad Sergio Arboleda - Carrera 15 # 74',1,'Bogota','','','Universidad Sergio Arboleda','    ',6,34,57,1,'PUB',2,'2017-10-18 18:13:28','','',0,0,'2017-10-18 18:13:24'),(696,1,' Scrum Product Owner en Bogota','El Scrum Product Owner  es una inmersión en el rol Dueño de Producto con actividades prácticas enseñando cómo construir productos a los que los clientes les encanta usar métodos Agile.   “La clase era absolutamente fabulosa. Fabian estaba muy bien informado. Él es uno de los mejores instructores que he conocido en mis 30 años de carrera.” – Arturo Reyes, Sr. Integration Manager\r\n\r\nContenido:\r\nLos principios Lean que establecen las bases para Scrum\r\nValores y principios ágiles – cómo hacerlos servir de guía\r\nEl marco de Scrum – cómo todas las piezas encajan, y lo que falta\r\nLas funciones de Scrum: Product Owner, ScrumMaster y el equipo de desarrollo\r\nResponsabilidades – y autoridad – del Dueño del Producto\r\nVarias formas impactantes de comunicar la visión de su producto\r\nHerramientas para crear sucintamente el caso comercial de su producto\r\nHerramientas sencillas para construir una Roadmap de Producto efectiva\r\nTécnicas para involucrar a sus interesados de manera significativa\r\nDefinir sus segmentos de clientes\r\nDescubrir características y organizarlas en un formato manejable\r\nAprendizaje validado: cómo descubrir las características que los clientes realmente necesitan\r\nUna variedad de modelos para secuenciar (priorizar) las características y proyectos\r\nAprovechamiento de historias de usuarios para una mejor definición de características (requisitos)\r\nPatrones para romper grandes rasgos en pequeñas historias de usuario\r\nCómo obtener información actualizable, rápida y frecuente sobre los productos\r\nTécnicas de refinamiento de backlog (refinement) para optimizar la efectividad\r\nMétodos de pronóstico de productos a largo plazo – la forma Lean-Agile\r\n\r\nLa inversión incluye:\r\nMateriales del curso en forma electrónica.\r\nAlmuerzo y bebidas.\r\n16 PDU´s categoria A','../eventimg/729330361Bogota.jpg','BogotaLugano Imperial Suites  762 Calle 70a',1,'Bogota','','','Fabian Schwartz','    ',6,64,57,1,'PUB',2,'2017-11-21 19:10:45','','',0,0,'2017-10-18 18:18:40'),(697,593,'Primera Jornada de Finanzas Personales','Queremos propiciar un escenario de intercambio de experiencias y proyectos de negocio entre inversionistas, empresarios y académicos en el ámbito de las finanzas personales, especialmente en lo relativo a las opciones en planes de inversión, sucesión y educación económica de las empresas familiares.','../eventimg/1736186001profile.jpg','Sede Uniandinos - Calle 92 # 16 - 11',1,'BogotÃ¡','https://www.facebook.com/jornadadefinanzaspersonales/','@JFinPersonales','Twelvefaces.co ','    ',8,77,57,1,'PUB',2,'2017-10-30 18:20:50','','',0,0,'2017-10-30 18:20:29'),(698,595,'networking  para comezar el 2018','evento para mostrar tu idea de negocio o emprendimiento a  otros empresarios y comienza el 2018 con  nuevos clientes','','bogota',1,'bogota','','','la consultoria','    ',8,0,57,1,'PUB',1,NULL,'','',0,0,'2017-11-15 18:07:50'),(699,597,'La Pola Social','Te encontrarás con personas interesadas en temas sociales, culturales y ambientales, y en general interesadas en temas de emprendimiento.\r\n\r\nEs un evento de networking, tratamos que sea muy informal, está abierto a todos lo emprendedores, organizaciones, fundaciones, y personas con ideas, curiosidad, o buscando información o motivación.\r\n\r\nEn la Pola puedes intercambiar aprendizajes y experiencias, encontrar motivación y guía, desarrollar redes de trabajo, articular actividades y proyectos y apoyar emprendimientos sociales.\r\n\r\nSe realiza el último martes de cada mes, en un lugar diferente cada vez. Puedes llegar en cualquier momento entre las 6:00pm y las 8:30pm.\r\n\r\nPara más información escríbenos a info@lapolasocial.com.\r\n\r\nVisítanos en facebook.com/lapolasocial (https://www.facebook.com/lapolasocial/), instagram/lapolasocial (https://www.instagram.com/lapolasocial/).','../eventimg/75610402620160426_190809.jpg','SECTORTIC, Carrera 18A N 103 - 11 ',1,'BOGOTA','lapolasocial','LaPolaSocial','La Pola Social','Evento sin costo.',9,71,57,1,'PUB',2,'2017-11-20 20:09:46','','',2,0,'2017-11-20 20:08:25');
