INSERT INTO `lider` VALUES (2,679,'Edinson Morales','Directo','','','../liderimg/1642234566PhotoLinkedIn.jpg','asdfaslkfjklasdjfljdaslkfdsfasddasg','Colombia','linkedin','twitter123','2017-07-10 19:09:34'),(3,664,'Carlos Andrade','Director Tecnologia','Mware','','../liderimg/318725686fotoTED_2.jpg','Profesor de doctorado de las Facultades de Informática, Comunicación y Ciencias del Seguro\r\nde la Universidad Pontificia de Salamanca. Profesor de Doctorado en Ciencias Empresariales\r\nde la Universidad Nebrija y colaborador de otras universidades españolas. Profesor Visitante\r\nde diferentes universidades latinoamericanas. Ha sido hasta el año 2013, Director e\r\nInvestigador Principal del Grupo de Investigación GISSIC, “Ingeniería de Software y Sociedad de\r\nla Información y el Conocimiento” de la Facultad de Informática de la Universidad Pontificia de\r\nSalamanca campus Madrid','Chile','https://www.linkedin.com/in/edinsonm/','edinsonm','2017-10-12 16:18:44'),(4,664,'Giovanny Velez','IT Senior','','','../liderimg/1619218411PhotoCV.jpg','sfdsafdsgdfagadf','Chile','https://www.linkedin.com/in/edinsonm/','evenpot','2017-07-10 19:36:50'),(5,664,'Ricardo Velez','Falabella','','','../liderimg/1097455891TarjetaProfesional.JPG','safsfadsfdsagds','Colombia','linkedin','','2017-07-10 22:08:51'),(6,664,'Giovanny Velez','Lider de Proyectos','Telesource','cristi3009@gmail.com','../liderimg/1557125134GiovannyVelez.jpg','Ingeniero de Sistemas con más de 11\r\naños de experiencia en tecnología. Líder de Proyectos en internet con\r\nexperiencia de dirección de equipos en departamentos digitales y tecnología.\r\n\r\nParticipación en proyectos de gran\r\nescala en cuanto a integraciones, software, backend, frontend, infraestructura\r\ny comunicaciones. \r\n\r\n <br>','Colombia','linkedin','twitter123','2017-10-08 18:53:03');
